INSERT INTO `gde_disciplinas` (`id_disciplina`, `sigla`, `nome`, `creditos`, `nivel`, `periodicidade`, `parte`, `ementa`, `bibliografia`, `quinzenal`, `id_instituto`, `cursacoes`, `reprovacoes`, `max_reprovacoes`) VALUES
(239, 'AM018', 'Trabalhos Comunit√°rios I', 4, 'G', 5, 0, 'Participa√ß√£o supervisionada em projetos ligados √† √°rea de extens√£o e assuntos comunit√°rios.', NULL, 0, 24, 1240, 5, 2),
(251, 'AM030', 'T√©cnicas e Organiza√ß√£o de Apresenta√ß√µes em P√∫blico', 2, 'G', 6, 0, '<p>T&eacute;cnicas de comunica&ccedil;&atilde;o. Postura de voz e postura corporal na apresenta&ccedil;&atilde;o em p&uacute;blico. Estrutura&ccedil;&atilde;o do discurso. Espa&ccedil;o e equipamentos auxiliares. Prepara&ccedil;&atilde;o de material auxiliar.</p>', NULL, 0, 7, 329, 1, 1),
(258, 'AM037', 'Propriedade Intelectual, Inova√ß√£o e Empreendedorismo: Temas Contempor√¢neos', 1, 'G', 5, 0, 'Intensificar o relacionamento da universidade com institui√ß√µes (empresas e organiza√ß√µes), atrav√©s do canal da discuss√£o dos temas propostos, tratados por especialistas e profissionais convidados, no contexto das atividades de ensino e pesquisa da universidade. Oferecer um panorama de temas contempor√¢neos relacionados √† propriedade intelectual, inova√ß√£o e empreendedorismo, no contexto da produ√ß√£o cient√≠fica e tecnol√≥gica da Unicamp. Contribuir para a complementa√ß√£o da grade de disciplinas existentes e relacionadas aos temas, atrav√©s de palestras e discuss√µes estruturadas e abertas √† comunidade.', NULL, 0, 24, 881, 13, 2),
(481, 'AR301', 'Psicologia do Desenvolvimento Aplicado √†s Artes I', 4, 'G', 1, 0, '<p>A compreens&atilde;o do desenvolvimento do ser humano em rela&ccedil;&atilde;o aos aspectos da habilidade motora, da amplia&ccedil;&atilde;o do conhecimento e da capacidade criadora, levando-se em conta a express&atilde;o l&uacute;dica e o aprofundamento da percep&ccedil;&atilde;o corporal, visual e auditiva do indiv&iacute;duo. A experi&ecirc;ncia do fen&ocirc;meno da arte, tanto em sua aproxima&ccedil;&atilde;o do material concreto quanto na realiza&ccedil;&atilde;o de composi&ccedil;&otilde;es mais elaboradas, permitindo a compreens&atilde;o do processo criativo e evidenciando a necessidade da express&atilde;o individual, experi&ecirc;ncia essa adequada &agrave;s diversas fases evolutivas e variadas formas de aprendizagem.</p>', NULL, 0, 14, 590, 4, 2),
(482, 'AR501', 'Ensino das Artes e Necessidades Educativas Especiais I', 4, 'G', 1, 0, '<p>Discute conhecimentos que integram corpo e educa&ccedil;&atilde;o, apresentando fundamentos hist&oacute;rico-contextuais, te&oacute;ricos, pr&aacute;ticos e metodol&oacute;gicos direcionados ao ensino. Prepara o aluno para refletir e atuar no ensino da arte em ambientes de educa&ccedil;&atilde;o formal e n&atilde;o formal, dando suporte ao ensino-aprendizado dos conte&uacute;dos necess&aacute;rios &agrave; condu&ccedil;&atilde;o dos est&aacute;gios e TCC em Arte Educa&ccedil;&atilde;o. Estuda processos educacionais e produ&ccedil;&otilde;es art&iacute;sticas de diferentes p&uacute;blicos, propondo tamb&eacute;m estrat&eacute;gias de inclus&atilde;o para pessoas com necessidades especiais.</p>', NULL, 0, 14, 372, 3, 1),
(605, 'BD190', 'Participa√ß√£o Cultural I', 2, 'G', 1, 0, '<p>Aspectos pol&iacute;ticos e socioculturais.&nbsp;Participa&ccedil;&atilde;o em eventos art&iacute;sticos da Universidade, tais como Bioart, apresenta&ccedil;&atilde;o de coral, encena&ccedil;&atilde;o de pe&ccedil;as teatrais, audi&ccedil;&atilde;o musical. Debates de temas gerais relacionados ao ensino e &agrave; pesquisa nos diferentes campos da Biologia, com participa&ccedil;&atilde;o de diretores de Instituto de Pesquisa isolados ou Instituto de Ensino Superior. Avalia&ccedil;&atilde;o do ensino no Instituto no 1&ordm; semestre; proposta de ensino para semestre seguinte.</p>', NULL, 0, 15, 1720, 2, 2),
(607, 'BD290', 'Participa√ß√£o Cultural II', 2, 'G', 2, 0, '<p>Aspectos pol&iacute;ticos e socioculturais.&nbsp;Participa&ccedil;&atilde;o em eventos art&iacute;sticos da Universidade, tais como Bioart, apresenta&ccedil;&atilde;o de coral, encena&ccedil;&atilde;o de pe&ccedil;as teatrais, audi&ccedil;&atilde;o musical. Debates de temas gerais relacionados ao ensino e &agrave; pesquisa nos diferentes campos da Biologia, com participa&ccedil;&atilde;o de diretores de Instituto de Pesquisa isolados ou Instituto de Ensino Superior. Avalia&ccedil;&atilde;o do ensino no Instituto no 2&ordm; semestre; proposta de ensino para semestre seguinte.</p>', NULL, 0, 15, 1324, 3, 2),
(628, 'BE310', 'Ci√™ncias do Ambiente', 2, 'G', 5, 0, '<p>Popula&ccedil;&atilde;o humana e recursos naturais renov&aacute;veis e n&atilde;o renov&aacute;veis. Intera&ccedil;&atilde;o entre o homem e ambientes naturais ou constru&iacute;dos. Ambientes brasileiros terrestres e aqu&aacute;ticos. An&aacute;lise de ambientes: diagramas energ&eacute;ticos e modelos. O homem como modificador do ambiente. Popula&ccedil;&atilde;o, energia, clima, ecotoxicologia, extin&ccedil;&atilde;o, biodiversidade e sustentabilidade. Direito ecol&oacute;gico e pol&iacute;tica ambiental. Responsabilidade do profissional com rela&ccedil;&atilde;o &agrave; sociedade e ao ambiente.</p>', NULL, 0, 15, 3150, 126, 3),
(762, 'BS410', 'Rela√ß√£o Parasita-Hospedeiro', 16, 'G', 2, 0, 'Rela√ß√£o entre o ser humano e o ambiente. Microorganismo e parasitos associados com o ser humano. Rela√ß√µes de equil√≠brio na associ√ß√£o entre organismos. Biologia dos microorganismos e parasitos e suas rela√ß√µes com a epidemiologia, resposta imune, patogenia, diagn√≥stico, controle e profilaxia. Resposta imune e sua regula√ß√£o nas infec√ß√µes.', NULL, 0, 15, 659, 6, 2),
(770, 'BT330', 'Bot√¢nica B√°sica', 2, 'G', 5, 0, '<p>Aspectos gerais de morfologia de Dicotiled&ocirc;neas e Monocotiled&ocirc;neas, raiz, caule, folhas, flores, frutos e sementes. Aspectos gerais da fisiologia de plantas superiores, enfocando rela&ccedil;&otilde;es energ&eacute;ticas, rela&ccedil;&otilde;es h&iacute;dricas e minerais, rela&ccedil;&otilde;es hormonais e a fisiologia da germina&ccedil;&atilde;o. Aspectos gerais de taxonomia vegetal, com &ecirc;nfase nas esp&eacute;cies cultivadas. Ciclo de vida das culturas de maior import&acirc;ncia econ&ocirc;mica.</p>', NULL, 0, 15, 622, 10, 1),
(829, 'CE038', 'Economia das Empresas para Engenharia', 4, 'G', 5, 0, '<p>O Objeto da Economia. Divis&atilde;o do Trabalho e Produtividade. Produ&ccedil;&atilde;o e Pre&ccedil;os. Pre&ccedil;o e Lucro. O Planejamento Econ&ocirc;mico e suas aplica&ccedil;&otilde;es nas Empresas. Estrutura e Organiza&ccedil;&atilde;o das Empresas. Mercado. Produ&ccedil;&atilde;o e Finan&ccedil;as Aplicadas &agrave;s Empresas. An&aacute;lise Econ&ocirc;mica de Investimentos.</p>', NULL, 0, 17, 591, 7, 2),
(842, 'CE304', 'Direito', 2, 'G', 5, 0, '<p>Fundamento de direito p&uacute;blico e privado. Aplica&ccedil;&atilde;o de normas jur&iacute;dicas aos fatos econ&ocirc;micos.</p>', NULL, 0, 17, 4786, 47, 2),
(885, 'CE730', 'Economia Brasileira', 4, 'G', 1, 0, '<p>Forma&ccedil;&atilde;o econ&ocirc;mica do Brasil at&eacute; meados do s&eacute;culo XIX. Economia cafeeira e industrializa&ccedil;&atilde;o. Evolu&ccedil;&atilde;o da economia no p&oacute;s-guerra.</p>', NULL, 0, 17, 943, 25, 3),
(887, 'CE738', 'Economia para Engenharia', 4, 'G', 5, 0, '<p>O processo de produ&ccedil;&atilde;o visto pelas &oacute;ticas micro e macroecon&ocirc;micas. Produ&ccedil;&atilde;o e propriedade. Produ&ccedil;&atilde;o como t&eacute;cnica e como processo social. Agrega&ccedil;&atilde;o da produ&ccedil;&atilde;o. Mercados. Papel do governo.</p>', NULL, 0, 17, 3911, 352, 4),
(893, 'CE838', 'Contabilidade para Engenharia', 2, 'G', 5, 0, '<p>A empresa e a tomada de decis&otilde;es. Fun&ccedil;&otilde;es da contabilidade. Relat&oacute;rios Cont&aacute;beis. An&aacute;lise aplicada das demonstra&ccedil;&otilde;es financeiras e indicadores nas empresas.</p>', NULL, 0, 17, 1527, 69, 3),
(894, 'CE839', 'Introdu√ß√£o √† Administra√ß√£o para Computa√ß√£o', 2, 'G', 5, 0, '<p>Administra&ccedil;&atilde;o p&uacute;blica e privada. Fun&ccedil;&otilde;es e princ&iacute;pios da administra&ccedil;&atilde;o. O planejamento da empresa.</p>', NULL, 0, 17, 947, 27, 2),
(1085, 'CV001', 'Projeto e Implanta√ß√£o de Loteamento', 2, 'G', 6, 0, '<p>Estudo da idade de cria&ccedil;&atilde;o de projetos de expans&atilde;o urbana. An&aacute;lise do plano diretor urbano. Legisla&ccedil;&atilde;o municipal, estadual e federal. Organiza&ccedil;&atilde;o do espa&ccedil;o f&iacute;sico. Estudo das t&eacute;cnicas de circula&ccedil;&atilde;o e geometria vi&aacute;ria. Representa&ccedil;&atilde;o gr&aacute;fica de um projeto. Equipamentos urbanos. Projetos integrados de infraestrutura urbana. Processo de implanta&ccedil;&atilde;o de loteamento. Cria&ccedil;&atilde;o de legisla&ccedil;&atilde;o espec&iacute;fica do loteamento.</p>', NULL, 0, 8, 121, 0, 0),
(1087, 'CV003', 'Tecnologia de Argamassas e Revestimento', 2, 'G', 6, 0, '<p>Conceito de revestimento como parte do edif&iacute;cio. Conceitos b&aacute;sicos sobre revestimento de edif&iacute;cios: vis&atilde;o sist&ecirc;mica, import&acirc;ncia e classifica&ccedil;&otilde;es. Caracter&iacute;stica das mat&eacute;rias primas. Propriedades e caracter&iacute;sticas dos revestimentos no estado fresco e no estado endurecido.</p>', NULL, 0, 8, 134, 1, 1),
(1130, 'CV068', 'T√©cnicas Construtivas II', 3, 'G', 1, 0, '<p>Execu&ccedil;&atilde;o de elementos construtivos estruturais. Constru&ccedil;&otilde;es industrializadas. M&aacute;quinas e equipamentos de obras. Patologias e otimiza&ccedil;&atilde;o da qualidade na constru&ccedil;&atilde;o. Intera&ccedil;&atilde;o entre projeto e obra. Atualidades e estudos de casos no &acirc;mbito do Complexo da Constru&ccedil;&atilde;o Civil.</p>', NULL, 0, 8, 382, 7, 2),
(1159, 'CV511', 'Mec√¢nica dos S√≥lidos II', 6, 'G', 1, 0, '<p>Tens&atilde;o. Deforma&ccedil;&atilde;o. Energia de deforma&ccedil;&atilde;o. Tor&ccedil;&atilde;o. Teoremas de energia. Flambagem. Crit&eacute;rios de resist&ecirc;ncia.</p>', NULL, 0, 8, 742, 121, 3),
(1163, 'CV532', 'Eletrot√©cnica e Energia', 3, 'G', 1, 0, '<p>No&ccedil;&otilde;es de corrente alternada. Aterramento. Sistemas monof&aacute;sicos e trif&aacute;sicos. Fator de pot&ecirc;ncia. Transformadores. Motores el&eacute;tricos.</p>', NULL, 0, 8, 656, 55, 2),
(1165, 'CV612', 'Teoria das Estruturas I', 4, 'G', 2, 0, '<p>Princ&iacute;pio dos trabalhos virtuais. Deslocamentos de estruturas lineares. Processo dos esfor&ccedil;os: treli&ccedil;as, grelhas, p&oacute;rticos e arcos. Linhas de influ&ecirc;ncia de estruturas isost&aacute;ticas.</p>', NULL, 0, 8, 747, 234, 2),
(1166, 'CV613', 'Estruturas de Madeira', 3, 'G', 2, 0, '<p>A &aacute;rvore. Propriedades f&iacute;sicas e mec&acirc;nicas. Estados limites. Compress&atilde;o simples. Instabilidade. Tra&ccedil;&atilde;o. Cisalhamento. Elementos para projetos de coberturas. Liga&ccedil;&otilde;es: sambladuras, pregos e parafusos. Flex&atilde;o simples e composta. Escoamento de valas.</p>', NULL, 0, 8, 637, 43, 2),
(1167, 'CV621', 'Geotecnia II', 3, 'G', 2, 0, '<p>Adensamento e compressibilidade. Resist&ecirc;ncia ao cisalhamento dos solos. Estabilidade de taludes. Empuxos. Estruturas de arrimo.</p>', NULL, 0, 8, 652, 140, 2),
(1169, 'CV631', 'Sistemas El√©tricos Prediais', 3, 'G', 2, 0, '<p>No&ccedil;&otilde;es de gera&ccedil;&atilde;o, transmiss&atilde;o e distribui&ccedil;&atilde;o de energia el&eacute;trica. Materiais el&eacute;tricos. Prote&ccedil;&atilde;o e comando de circuitos el&eacute;tricos. Luminot&eacute;cnica. Luz artificial e natural. Projeto de instala&ccedil;&otilde;es el&eacute;tricas. Instala&ccedil;&otilde;es de para-raios. TV, som e telefone. Introdu&ccedil;&atilde;o &agrave; instala&ccedil;&atilde;o de motores.</p>', NULL, 0, 8, 525, 35, 1),
(1170, 'CV632', 'Hidrologia B√°sica', 4, 'G', 2, 0, '<p>Ciclo hidrol&oacute;gico, bacia hidrogr&aacute;fica, precipita&ccedil;&otilde;es, escoamento superficial, infiltra&ccedil;&atilde;o, evapora&ccedil;&atilde;o e transpira&ccedil;&atilde;o. &Aacute;guas subterr&acirc;neas. Medi&ccedil;&otilde;es de vaz&atilde;o. Previs&atilde;o de enchentes por m&eacute;todos determin&iacute;sticos (hidrogramas unit&aacute;rios), probabil&iacute;sticos (Gumbel, Gumbel-chow, log-Pearson tipo III, log Normal, GRADEX, etc). Regulariza&ccedil;&atilde;o de vaz&otilde;es. Amortecimento de cheias em reservat&oacute;rios. Propaga&ccedil;&atilde;o de Enchentes em Canais.</p>', NULL, 0, 8, 552, 26, 2),
(1173, 'CV701', 'Planejamento e Controle de Empreendimentos', 4, 'G', 1, 0, '<p>Conceitos fundamentais e organiza&ccedil;&atilde;o de empreendimentos. O gerenciamento no canteiro de obras. Fases e opera&ccedil;&atilde;o da constru&ccedil;&atilde;o civil, estruturas organizacionais para o gerenciamento de opera&ccedil;&otilde;es. Or&ccedil;amentos e BDI. Programa&ccedil;&atilde;o de atividades: metodologia, sistem&aacute;tica de programa&ccedil;&atilde;o, t&eacute;cnicas determin&iacute;sticas e probabil&iacute;sticas. Acompanhamento e controle operacional.</p>', NULL, 0, 8, 546, 17, 1),
(1174, 'CV702', 'Sistemas Prediais, Hidr√°ulico-Sanit√°rios e G√°s I', 3, 'G', 1, 0, '<p>Sistemas prediais de &aacute;gua fria, quente, combate a inc&ecirc;ndio com hidrantes e extintores, esgoto sanit&aacute;rio, &aacute;gua pluvial e g&aacute;s combust&iacute;vel: conceitua&ccedil;&atilde;o, crit&eacute;rios de projeto e normaliza&ccedil;&atilde;o. Conserva&ccedil;&atilde;o de &aacute;gua em edif&iacute;cios: conceitos fundamentais.</p>', NULL, 0, 8, 525, 3, 1),
(1175, 'CV712', 'Teoria das Estruturas II', 5, 'G', 1, 0, '<p>Coeficientes relativos &agrave;s barras e cargas. Processo dos deslocamentos: manual e matricial. Simplifica&ccedil;&otilde;es de simetria. Linhas de influ&ecirc;ncia de estruturas hiperest&aacute;tica.</p>', NULL, 0, 8, 727, 209, 1),
(1176, 'CV713', 'Estruturas Met√°licas I', 4, 'G', 1, 0, '<p>Coeficientes de pondera&ccedil;&atilde;o de cargas. Dimensionamento de barras sob cargas axiais de tra&ccedil;&atilde;o e compress&atilde;o de barras com perfil laminado. Dimensionamento de barras sob cargas de flex&atilde;o ou de flexo-compress&atilde;o com perfil laminado. Dimensionamento de liga&ccedil;&otilde;es parafusadas e/ou soldadas sob cargas axiais e/ou de flex&otilde;es.</p>', NULL, 0, 8, 643, 101, 1),
(1177, 'CV714', 'Estruturas de Concreto Armado I', 6, 'G', 1, 0, '<p>Fundamentos do concreto armado. Principais elementos estruturais. Desenhos de f&ocirc;rmas. Dimensionamento nos estados limites &uacute;ltimos. Lajes e vigas. Verifica&ccedil;&atilde;o dos estados limites de servi&ccedil;os.</p>', NULL, 0, 8, 737, 202, 1),
