(1574, 'EE300', 'Fundamentos da F√≠sica Moderna', 4, 'G', 5, 0, '<p>Introdu&ccedil;&atilde;o &agrave; teoria da relatividade restrita. A teoria cin&eacute;tica da mat&eacute;ria. A Quantiza&ccedil;&atilde;o da radia&ccedil;&atilde;o, da carga el&eacute;trica e da energia. Modelos at&ocirc;micos cl&aacute;ssicos. Propriedades ondulat&oacute;rias das part&iacute;culas. Equa&ccedil;&atilde;o de Schr&ouml;dinger. O &aacute;tomo com muitos el&eacute;trons. A estrutura do n&uacute;cleo at&ocirc;mico e rea&ccedil;&otilde;es nucleares. Part&iacute;culas elementares. Mol&eacute;culas.</p>', NULL, 0, 9, 926, 11, 2),
(1575, 'EE301', 'Laborat√≥rio de Fundamentos F√≠sicos para a Engenharia El√©trica', 2, 'G', 5, 0, 'Medidas em condutores. Efeito da temperatura. Condu√ß√£o em eletr√≥litos. Condu√ß√£o e ruptura em materiais diel√©tricos. Difra√ß√£o e refra√ß√£o da Luz. Polariza√ß√£o e birefring√™ncia. Espectrometria √≥ptica. Efeito fotoel√©trico e efeito Hall.<br />Obs.: Esta disciplina ser√° ministrada quinzenalmente.', NULL, 1, 9, 856, 5, 2),
(1577, 'EE400', 'M√©todos da Engenharia El√©trica', 4, 'G', 5, 0, '<p>Sistemas de coordenadas e vetores. Gradiente, divergente, rotacional e laplaciano. Teoremas de Gauss e de Stokes. Fun&ccedil;&otilde;es de vari&aacute;veis complexas. Res&iacute;duos e p&oacute;los. M&eacute;todo de transforma&ccedil;&atilde;o conforme; m&eacute;todo de separa&ccedil;&atilde;o de vari&aacute;veis na solu&ccedil;&atilde;o da equa&ccedil;&atilde;o de Laplace.</p>', NULL, 0, 9, 1716, 248, 5),
(1578, 'EE410', 'Introdu√ß√£o √† Ci√™ncia dos Materiais para Engenharia El√©trica', 4, 'G', 5, 0, '<p>Estado s&oacute;lido. Propriedades mec&acirc;nicas dos s&oacute;lidos. Propriedades &oacute;pticas dos materiais. Propriedades magn&eacute;ticas. Propriedades t&eacute;rmicas. Propriedades el&eacute;tricas.</p>', NULL, 0, 9, 1086, 182, 2),
(1580, 'EE521', 'Introdu√ß√£o √† Teoria Eletromagn√©tica', 4, 'G', 5, 0, '<p>For&ccedil;a e campo eletrost&aacute;tico. Densidade de fluxo el&eacute;trico e lei de Gauss. Potencial eletrost&aacute;tico. Corrente estacion&aacute;ria. Condutor e Resist&ecirc;ncia. Diel&eacute;trico e capacit&acirc;ncia. Equa&ccedil;&otilde;es de Poisson e Laplace. Campo magnetost&aacute;tico. Campos vari&aacute;veis no tempo. For&ccedil;a em materiais magn&eacute;ticos indut&acirc;ncia. Sistemas de unidade.</p>', NULL, 0, 9, 1127, 224, 4),
(1581, 'EE522', 'Laborat√≥rio de Eletromagnetismo', 2, 'G', 5, 0, 'Mapeamento de equipot√™ncias. Fotoc√≥pia eletrost√°tica. Descargas el√©tricas em alta tens√£o. Intera√ß√£o de campos magn√©ticos e el√©tricos com feixe de el√©trons. Bomba i√¥nica. Radia√ß√£o de antena de micro-ondas.<br />Obs.: Esta disciplina ser√° ministrada quinzenalmente.', NULL, 1, 9, 852, 5, 1),
(1582, 'EE530', 'Eletr√¥nica B√°sica I', 4, 'G', 5, 0, '<p>Conceitos b&aacute;sicos de projeto. Amplificadores operacionais Ideais. Circuitos com amplificadores operacionais. Semicondutores. Circuitos com diodos semicondutores. Circuitos com FET. Circuitos com transistores bipolares. Amplificadores de pot&ecirc;ncia e fontes de alimenta&ccedil;&atilde;o.</p>', NULL, 0, 9, 1883, 444, 6),
(1583, 'EE531', 'Laborat√≥rio de Eletr√¥nica B√°sica I', 2, 'G', 5, 0, 'Diodos. Transistores bipolares. Transistores JFET. Transistores MOS e estruturas CMOS. Caracteriza√ß√£o e aplica√ß√µes.<br />Obs.: Esta disciplina ser√° ministrada quinzenalmente.', NULL, 1, 9, 1544, 28, 2),
(1584, 'EE540', 'Teoria Eletromagn√©tica', 4, 'G', 5, 0, '<p>Campos vari&aacute;veis no tempo e equa&ccedil;&otilde;es de Maxwell. Ondas planas no v&aacute;cuo e em diel&eacute;tricos: polariza&ccedil;&atilde;o, imped&acirc;ncia do meio. Propaga&ccedil;&atilde;o de ondas eletromagn&eacute;ticas: velocidade de fase e de grupo, fluxos de pot&ecirc;ncia, atenua&ccedil;&atilde;o. Reflex&atilde;o e refra&ccedil;&atilde;o em interfaces planas: ondas TE e TM, &acirc;ngulo de Brewster, reflex&atilde;o total, ondas evanescentes. Potenciais retardados e antenas. Radiopropaga&ccedil;&atilde;o. Difra&ccedil;&atilde;o.</p>', NULL, 0, 9, 975, 130, 2),
(1586, 'EE610', 'Eletr√¥nica Digital I', 4, 'G', 5, 0, '<p>Pulsos e circuitos de temporiza&ccedil;&atilde;o. Circuitos l&oacute;gicos-digitais. Circuitos Integrados Digitais. Dispositivos L&oacute;gicos Program&aacute;veis-PLDs.</p>', NULL, 0, 9, 1169, 230, 5),
(1587, 'EE640', 'Eletr√¥nica B√°sica II', 4, 'G', 5, 0, '<p>Projeto de amplificadores com BJT. Estrutura dos amplificadores operacionais. Resposta em frequ&ecirc;ncia de amplificadores. Circuitos quasi-lineares. Circuitos n&atilde;o-lineares. Dispositivos de aplica&ccedil;&atilde;o espec&iacute;fica. Filtros ativos.</p>', NULL, 0, 9, 902, 103, 3),
(1588, 'EE641', 'Laborat√≥rio de Eletr√¥nica B√°sica II', 2, 'G', 5, 0, 'Amplificador a transistor bipolar. Amplificador diferencial. Amplificador operacional. Circuitos com amplificadores operacionais.<br />Obs.: Esta disciplina ser√° ministrada quinzenalmente.', NULL, 1, 9, 743, 11, 2),
(1590, 'EE754', 'Ondas Guiadas', 4, 'G', 5, 0, '<p>Guias diel&eacute;tricos: surgimento de modos TE e TM em guias laminares, equa&ccedil;&atilde;o modal, guias circulares. Fibras &oacute;pticas: programa&ccedil;&atilde;o modal, aproxima&ccedil;&atilde;o de guiamento fraco, modos linearmente polarizados. Tipologia das fibras &oacute;pticas. Atenua&ccedil;&atilde;o e dispers&atilde;o em fibras &oacute;pticas. Guias met&aacute;licos: geometria retangular e circular, modos dominantes, filtros modais, perdas nas paredes. O modo TEM em guias com m&uacute;ltiplos condutores: linhas de transmiss&atilde;o, modelo circuital. A Teoria de linhas de transmiss&atilde;o: imped&acirc;ncia caracter&iacute;stica, transforma&ccedil;&atilde;o de imped&acirc;ncias, casamento de imped&acirc;ncias, carta de Smith.</p>', NULL, 0, 9, 873, 65, 2),
(1591, 'EE755', 'Laborat√≥rio de Ondas Guiadas', 2, 'G', 5, 0, 'Experi√™ncias relacionadas com estruturas de dois pares de terminais e com linhas de transmiss√£o.<br />Obs.: Recomenda-se que seja cursada concomitantemente com EE753. Esta disciplina ser√° ministrada quinzenalmente.', NULL, 1, 9, 766, 3, 1),
(1593, 'EE833', 'Eletr√¥nica de Pot√™ncia', 4, 'G', 5, 0, '<p>Diodos de pot&ecirc;ncia. Retificadores. Tiristores. Retificadores controlados. Controladores de tens&atilde;o AC. Transistores de pot&ecirc;ncia. Retalhadores DC. Inversores. Controle de Motores DC. Controle de Motores AC. Experimentos.</p>', NULL, 0, 9, 789, 43, 2),
(1594, 'EE838', 'Introdu√ß√£o √† Engenharia de Som I', 2, 'G', 6, 0, 'Introdu√ß√£o: Ac√∫stica, ondas sonoras e instrumentos musicais. Instrumenta√ß√£o. Ondas El√°sticas I. Corpos sonoros I. Instrumentos de Percuss√£o. Ondas El√°sticas II. Corpos Sonoros II. Instrumentos de Sopro. Salas e Conforto Ambiental. Piano. Palestras convidadas.', NULL, 0, 9, 125, 0, 1),
(1595, 'EE840', 'Introdu√ß√£o √† Engenharia do Som II', 2, 'G', 6, 0, 'Introdu√ß√£o: Panorama de Inform√°tica na M√∫sica - Conceitos e Exemplos de Mercado e Experimentais. Protocolo MIDI. Sequenciadores. MIDI Aplicada √† Composi√ß√£o Algor√≠tmica. Audi√ß√£o e Psico-Ac√∫stica. Fundamentos do √Åudio Digital. Sound Design: Aplica√ß√µes Criativas do √Åudio Digital - Cinema, √Åudio Visual, Paisagem Sonora. T√©cnicas de S√≠ntese de Sinais Digitais. Sintetizadores Virtuais. Aplica√ß√µes Musicais do √Åudio Digital I. Aplica√ß√µes Musicais do √Åudio Digital II. Perspectivas da Computa√ß√£o Musical.', NULL, 0, 9, 87, 0, 0),
(1598, 'EE881', 'Princ√≠pios de Comunica√ß√µes I', 4, 'G', 5, 0, '<p>Canal de comunica&ccedil;&atilde;o. Processos estoc&aacute;sticos. Modula&ccedil;&atilde;o de amplitude. Modula&ccedil;&atilde;o angular. Codifica&ccedil;&atilde;o de sinais anal&oacute;gicos. Transmiss&atilde;o digital em banda b&aacute;sica. Modula&ccedil;&atilde;o digital. Sistemas de m&uacute;ltiplo acesso. T&oacute;picos em comunica&ccedil;&otilde;es.</p>', NULL, 0, 9, 1280, 175, 3),
(1599, 'EE882', 'Laborat√≥rio de Comunica√ß√µes I', 2, 'G', 5, 0, 'Experi√™ncias de laborat√≥rio com: Sinais. Modula√ß√£o AM convencional e espalhada, DSB-SC e FM. Amostragem. Codifica√ß√£o. TV.<br />Obs.: Esta disciplina ser√° ministrada quinzenalmente.', NULL, 1, 9, 1073, 7, 1),
(1601, 'EE884', 'T√≥picos Avan√ßados em Engenharia El√©trica', 2, 'G', 6, 0, 'Disciplina abordando t√≥picos vari√°veis: tend√™ncias, desenvolvimento de t√©cnicas modernas em Engenharia El√©trica. O programa √© divulgado por ocasi√£o do oferecimento da disciplina. <br />Obs.: O pr√©-requisito ser√° definido por ocasi√£o de seu oferecimento.', NULL, 0, 9, 19, 0, 1),
(1646, 'EE938', 'Engenharia de Som I: Ac√∫stica', 4, 'G', 6, 0, '<p>Som. Ac&uacute;stica. Cordas, tubos e membranas vibrantes, instrumentos musicais. Ac&uacute;stica fisiol&oacute;gica: audibilidade, curvas de Fletcher Munson, intelegibilidade. Transdutores. Amplificadores: ganho, resposta em frequ&ecirc;ncia, distor&ccedil;&atilde;o. Grava&ccedil;&atilde;o: discos, fitas, grava&ccedil;&atilde;o digital.</p>', NULL, 0, 9, 45, 0, 0),
(1816, 'EG507', 'Computa√ß√£o Evolutiva', 4, 'G', 6, 0, '<p>Introdu&ccedil;&atilde;o a t&eacute;cnicas de solu&ccedil;&atilde;o de problemas inspiradas na natureza. Base biol&oacute;gica e representa&ccedil;&atilde;o computacional. Algor&iacute;tmos gen&eacute;ticos. Estrat&eacute;gias evolutivas. Programa&ccedil;&atilde;o gen&eacute;tica. Programa&ccedil;&atilde;o evolutiva. Sistemas classificadores. Extens&otilde;es, operadores avan&ccedil;ados e aplica&ccedil;&otilde;es.</p>', NULL, 0, 9, 9, 0, 1),
(1919, 'EL101', 'Inicia√ß√£o Cient√≠fica em Educa√ß√£o I', 2, 'G', 6, 0, '<p>Introdu&ccedil;&atilde;o &agrave;s atividades de pesquisa em educa&ccedil;&atilde;o sob a supervis&atilde;o de um professor.</p>', NULL, 0, 5, 21, 0, 1),
(1925, 'EL201', 'Inicia√ß√£o Cient√≠fica em Educa√ß√£o II', 2, 'G', 6, 0, '<p>Introdu&ccedil;&atilde;o &agrave;s atividades de pesquisa em educa&ccedil;&atilde;o sob a supervis&atilde;o de um professor.</p>', NULL, 0, 5, 11, 0, 1),
(1932, 'EL284', 'Educa√ß√£o Matem√°tica Escolar I', 2, 'G', 2, 0, '<p>O objetivo deste curso &eacute; promover an&aacute;lise e estudo de Problemas e perspectivas da Educa&ccedil;&atilde;o Matem&aacute;tica brasileira.</p>', NULL, 0, 5, 609, 15, 2),
(1947, 'EL511', 'Psicologia e Educa√ß√£o', 6, 'G', 5, 0, '<p>Fundamentos te&oacute;ricos e contribui&ccedil;&otilde;es da psicologia para o estudo e compreens&atilde;o de quest&otilde;es relacionadas &agrave; Educa&ccedil;&atilde;o, considerando as possibilidades de &nbsp;atua&ccedil;&atilde;o docente. Inser&ccedil;&atilde;o em contextos educativos e an&aacute;lise do cotidiano escolar.</p>', NULL, 0, 5, 5351, 190, 4),
(1967, 'EL683', 'Escola e Cultura', 6, 'G', 5, 0, '<p>Dimens&otilde;es da escola e da cultura na Pesquisa e no Conhecimento em Educa&ccedil;&atilde;o.</p>', NULL, 0, 5, 6175, 180, 4),
(1981, 'EL774', 'Est√°gio Supervisionado I', 8, 'G', 5, 0, '<p>Imers&atilde;o no campo de trabalho, que propicie ao professor, em forma&ccedil;&atilde;o inicial, o contato com experi&ecirc;ncias, pr&aacute;ticas e conhecimentos de natureza profissional, tanto na escola quanto em espa&ccedil;os educativos n&atilde;o escolares. Conhecer as caracter&iacute;sticas das institui&ccedil;&otilde;es educativas no contexto socioecon&ocirc;mico cultural brasileiro, articulando as diferentes formas de ensino-aprendizagem, de gest&atilde;o e de organiza&ccedil;&atilde;o.</p>', NULL, 0, 5, 3997, 105, 3),
(1993, 'EL874', 'Est√°gio Supervisionado II', 8, 'G', 5, 0, '<p>Atua&ccedil;&atilde;o no campo de trabalho que propicie ao professor em forma&ccedil;&atilde;o o contato com experi&ecirc;ncias, pr&aacute;ticas e conhecimentos de natureza profissional, articulando as diferentes formas de ensino-aprendizagem, de gest&atilde;o e de organiza&ccedil;&atilde;o. Trabalho de campo orientado para a avalia&ccedil;&atilde;o dos componentes da pr&aacute;tica educativa, procurando compreend&ecirc;-la a partir dos contextos nos quais se desenvolvem. Elabora&ccedil;&atilde;o e implementa&ccedil;&atilde;o de projetos e propostas que ampliem as alternativas de interven&ccedil;&atilde;o e atua&ccedil;&atilde;o.</p>', NULL, 0, 5, 2918, 97, 2),
(2087, 'EM230', 'Oficinas em Instala√ß√µes El√©tricas', 4, 'G', 1, 0, 'Tecnologia b√°sica. Opera√ß√µes b√°sicas de instala√ß√µes el√©tricas residencial e industrial, de enrolamento de motor monof√°sico. Liga√ß√µes de comandos el√©tricos autom√°ticos.<br />Obs.: Realizado nas Oficinas da Escola SENAI &quot;Roberto Mange&quot;, na Rua Pastor C√≠cero Canuto de Lima, n¬∫71 - S√£o Bernardo - Campinas - SP.', NULL, 0, 11, 1004, 6, 2),
(2089, 'EM306', 'Est√°tica', 4, 'G', 5, 0, '<p>Sistemas de for&ccedil;as aplicadas equivalentes. Equil&iacute;brio de um corpo r&iacute;gido. Equil&iacute;brio de corpos r&iacute;gidos interligados. Treli&ccedil;as planas e espaciais. Baricentro e carregamento distribu&iacute;do. Esfor&ccedil;os internos em elementos estruturais. Diagrama dos esfor&ccedil;os solicitantes. Momento de in&eacute;rcia de figuras planas. Atrito</p>', NULL, 0, 11, 3400, 1030, 6),
(2091, 'EM312', 'Desenho T√©cnico', 4, 'G', 5, 0, '<p>Instrumenta&ccedil;&atilde;o e normas. Teoria das proje&ccedil;&otilde;es: Monjeanas, cotadas. Axonometria e perspectiva. Constru&ccedil;&otilde;es geom&eacute;tricas. Ajustes e toler&acirc;ncias. Desenho de elementos b&aacute;sicos de m&aacute;quinas. M&eacute;todos de composi&ccedil;&atilde;o e de reprodu&ccedil;&atilde;o de desenhos.</p>', NULL, 0, 11, 2627, 35, 2),
(2092, 'EM330', 'Oficinas I', 4, 'G', 5, 0, 'Medidas lineares com instrumentos de medida direta e indireta. No√ß√µes de toler√¢ncia ISO. Tra√ßagem de pe√ßas, trabalhos de bancada. Opera√ß√µes b√°sicas com m√°quinas operatrizes, furadeira, plaina limadora, torno mec√¢nico horizontal e fresadora. <br />Obs.: Realizado nas oficinas da Escola SENAI &quot;Roberto Mange&quot;, na Rua Pastor C√≠cero Canuto de Lima, 71 - S√£o Bernardo - Campinas - SP.', NULL, 0, 11, 2124, 8, 1),
(2094, 'EM360', 'Termodin√¢mica I', 4, 'G', 5, 0, '<p>Conceitos introdut&oacute;rios e defini&ccedil;&otilde;es. Energia e Primeira Lei da Termodin&acirc;mica. Propriedades de uma subst&acirc;ncia pura. Balan&ccedil;o de energia em volume de controle. Segunda Lei da Termodin&acirc;mica. Entropia. No&ccedil;&otilde;es de ciclos motores e refrigera&ccedil;&atilde;o.</p>', NULL, 0, 11, 2530, 804, 5),
(2095, 'EM404', 'Din√¢mica', 4, 'G', 5, 0, '<p>Estudo vetorial de curvas. Cinem&aacute;tica da part&iacute;cula. Movimento relativo. Cinem&aacute;tica dos corpos r&iacute;gidos nos movimentos plano e espacial. Princ&iacute;pios b&aacute;sicos da din&acirc;mica: Leis de Newton, conserva&ccedil;&atilde;o dos momentos linear a angular e conserva&ccedil;&atilde;o de energia. Impacto e atrito. Cin&eacute;tica da part&iacute;cula. Cin&eacute;tica dos sistemas de part&iacute;culas. Cin&eacute;tica dos corpos r&iacute;gidos nos movimentos plano e espacial.</p>', NULL, 0, 11, 2260, 672, 6),
(2096, 'EM406', 'Resist√™ncia dos Materiais I', 4, 'G', 5, 0, '<p>Introdu&ccedil;&atilde;o a mec&acirc;nica dos s&oacute;lidos. Esfor&ccedil;os solicitantes e Equa&ccedil;&otilde;es diferenciais de equil&iacute;brio. An&aacute;lise de Tens&atilde;o. An&aacute;lise de Deforma&ccedil;&atilde;o. Leis constitutivas. Modelos de barra, tor&ccedil;&atilde;o de eixos de se&ccedil;&atilde;o circular e flex&atilde;o de vigas.</p>', NULL, 0, 11, 2972, 931, 4),
(2097, 'EM423', 'Resist√™ncia dos Materiais', 3, 'G', 5, 0, '<p>No&ccedil;&otilde;es sobre o material. Conceitua&ccedil;&atilde;o de tens&otilde;es, solicita&ccedil;&atilde;o axial. Cisalhamento puro. Tor&ccedil;&atilde;o em eixos circulares. Flex&atilde;o pura, simples e obl&iacute;qua. Deflex&atilde;o em vigas retas. Estado triplo de tens&otilde;es e deforma&ccedil;&otilde;es. C&iacute;rculo de Mohr. Cisalhamento puro. Estado hidrost&aacute;tico de tens&otilde;es.</p>', NULL, 0, 11, 2599, 123, 7),
(2099, 'EM440', 'Transforma√ß√µes de Fase dos Materiais', 2, 'G', 5, 0, '<p>Nuclea&ccedil;&atilde;o e crescimento de fases. Recupera&ccedil;&atilde;o, recristaliza&ccedil;&atilde;o e crescimento de gr&atilde;os. Solubiliza&ccedil;&atilde;o e precipita&ccedil;&atilde;o. Ligas ferro-carbono. Tratamentos t&eacute;rmicos e termoqu&iacute;micos das ligas ferro-carbono. Oxida&ccedil;&atilde;o e corros&atilde;o de metais.</p>', NULL, 0, 11, 875, 43, 3),
(2100, 'EM460', 'Termodin√¢mica II', 4, 'G', 2, 0, '<p>An&aacute;lise exerg&eacute;tica. Ciclos motores a vapor. Ciclos padr&atilde;o-ar. Ciclos de refrigera&ccedil;&atilde;o e frigor&iacute;ficos; bomba de calor. Propriedade de misturas. Pscicrometria. Rea&ccedil;&otilde;es qu&iacute;micas e combust&atilde;o. Princ&iacute;pios de equil&iacute;brio qu&iacute;mico. Rela&ccedil;&otilde;es de Maxwell e propriedades termodin&acirc;micas.</p>', NULL, 0, 11, 1630, 430, 4),
(2101, 'EM461', 'Mec√¢nica dos Fluidos I', 4, 'G', 5, 0, '<p>Introdu&ccedil;&atilde;o e conceitos fundamentais. Lei b&aacute;sica da est&aacute;tica dos fluidos. Leis b&aacute;sicas na forma integral para volume de controle e o Teorema de Transporte de Reynolds. An&aacute;lise dimensional e semelhan&ccedil;a. Escoamento viscoso incompress&iacute;vel interno: perda de carga. Escoamento viscoso incompress&iacute;vel externo: arrasto e sustenta&ccedil;&atilde;o. M&aacute;quinas de Fluxo.</p>', NULL, 0, 11, 2252, 616, 5);
