(2102, 'EM503', 'Introdu√ß√£o aos M√©todos Num√©ricos Aplicados √† Engenharia', 4, 'G', 1, 0, '<p>Introdu&ccedil;&atilde;o aos m&eacute;todos das diferen&ccedil;as finitas, dos volumes finitos e dos elementos finitos. Uso de aplicativos computacionais na solu&ccedil;&atilde;o de problemas de engenharia mec&acirc;nica.</p>', NULL, 0, 11, 1472, 245, 4),
(2104, 'EM506', 'Resist√™ncia dos Materiais II', 4, 'G', 5, 0, '<p>Tens&otilde;es de cisalhamento em vigas. Vigas de material composto. Estado de tens&atilde;o e deforma&ccedil;&atilde;o. Tens&otilde;es e deforma&ccedil;&otilde;es principais. Carregamentos combinados. Crit&eacute;rios de resist&ecirc;ncia. M&eacute;todos de energia. Flambagem.</p>', NULL, 0, 11, 2893, 845, 4),
(2106, 'EM524', 'Fen√¥menos de Transporte', 4, 'G', 5, 0, '<p>Conceitos fundamentais. Primeira e segunda leis da termodin&acirc;mica. Equa&ccedil;&otilde;es gerais da cinem&aacute;tica e din&acirc;mica dos fluidos. Equa&ccedil;&otilde;es b&aacute;sicas de transfer&ecirc;ncia de calor e massa.</p>', NULL, 0, 11, 1919, 438, 4),
(2108, 'EM561', 'Mec√¢nica dos Fluidos II', 4, 'G', 1, 0, '<p>For&ccedil;as est&aacute;ticas exercidas por fluidos sobre superf&iacute;cies. Conceitos cinem&aacute;ticos. Introdu&ccedil;&atilde;o &agrave; analise diferencial dos escoamentos. Equa&ccedil;&otilde;es de Navier-Stokes. Escoamento incompress&iacute;vel de fluidos n&atilde;o viscosos. No&ccedil;&otilde;es de escoamentos em canais abertos. Camada-limite. Introdu&ccedil;&atilde;o ao escoamento compress&iacute;vel.&nbsp;</p>', NULL, 0, 11, 1617, 311, 4),
(2109, 'EM570', 'Transfer√™ncia de Calor I', 4, 'G', 5, 0, '<p>Introdu&ccedil;&atilde;o &agrave; Transfer&ecirc;ncia de Calor e &agrave; Condu&ccedil;&atilde;o. Condu&ccedil;&atilde;o Unidimensional em Regime Permanente. Introdu&ccedil;&atilde;o &agrave; Condu&ccedil;&atilde;o Bidimensional em Regime Permanente. Formula&ccedil;&atilde;o Concentrada da Condu&ccedil;&atilde;o Transit&oacute;ria. Introdu&ccedil;&atilde;o &agrave; Convec&ccedil;&atilde;o T&eacute;rmica. Convec&ccedil;&atilde;o em Escoamentos Externos. Convec&ccedil;&atilde;o Natural em Escoamentos Externos. Radia&ccedil;&atilde;o T&eacute;rmica: Processos e Propriedades e Transfer&ecirc;ncia de Calor.</p>', NULL, 0, 11, 2322, 655, 7),
(2116, 'EM607', 'Vibra√ß√µes de Sistemas Mec√¢nicos', 4, 'G', 5, 0, '<p>Estudo das vibra&ccedil;&otilde;es mec&acirc;nicas. Sistemas lineares de um grau de liberdade. Vibra&ccedil;&otilde;es livres e for&ccedil;adas. Transformada de Laplace. Transmissibilidade e isola&ccedil;&atilde;o de vibra&ccedil;&otilde;es. Sistemas lineares discretos. Frequ&ecirc;ncia natural e modos pr&oacute;prios. Absorvedores de vibra&ccedil;&atilde;o. Introdu&ccedil;&atilde;o aos ensaios din&acirc;micos.&nbsp;</p>', NULL, 0, 11, 2220, 677, 6),
(2124, 'EM641', 'Ensaios dos Materiais', 2, 'G', 2, 0, '<p>Propriedades mec&acirc;nicas dos materiais.&nbsp;Normas e especifica&ccedil;&otilde;es de ensaios de materiais. Ensaios mec&acirc;nicos est&aacute;ticos e din&acirc;micos. Metalografia. An&aacute;lise qu&iacute;mica. Ensaios n&atilde;o destrutivos.</p>', NULL, 0, 11, 1270, 71, 3),
(2125, 'EM670', 'Transfer√™ncia de Calor II', 4, 'G', 2, 0, '<p>Convec&ccedil;&atilde;o em Escoamentos Internos. Ebuli&ccedil;&atilde;o e Condensa&ccedil;&atilde;o. Trocadores de Calor. Condu&ccedil;&atilde;o Bidimensional em Regime Permanente e em Regime Transit&oacute;rio: Solu&ccedil;&otilde;es Anal&iacute;ticas e M&eacute;todos Num&eacute;ricos. Transfer&ecirc;ncia de Massa por Difus&atilde;o. Introdu&ccedil;&atilde;o &agrave; Convec&ccedil;&atilde;o de Calor e Massa. Convec&ccedil;&atilde;o em Escoamentos Externos. Convec&ccedil;&atilde;o de Massa em Escoamentos Internos. Convec&ccedil;&atilde;o Natural em Escoamentos Internos.</p>', NULL, 0, 11, 1452, 296, 3),
(2126, 'EM672', 'Sistemas Fluidot√©rmicos I', 4, 'G', 5, 0, '<p>Introdu&ccedil;&atilde;o a sistemas: de compress&atilde;o; de distribui&ccedil;&atilde;o de gases e l&iacute;quidos; de ventila&ccedil;&atilde;o; de condicionamento de ar; de refrigera&ccedil;&atilde;o; aos motores de combust&atilde;o interna; gera&ccedil;&atilde;o de pot&ecirc;ncia e cogera&ccedil;&atilde;o; gera&ccedil;&atilde;o, distribui&ccedil;&atilde;o e utiliza&ccedil;&atilde;o de vapor.</p>', NULL, 0, 11, 933, 115, 5),
(2128, 'EM703', 'Instrumenta√ß√£o', 4, 'G', 1, 0, '<p>Caracter&iacute;sticas est&aacute;ticas e din&acirc;micas dos instrumentos e sensores. An&aacute;lise de dados e incertezas experimentais. Medida e an&aacute;lise de deslocamento, velocidade, acelera&ccedil;&atilde;o, for&ccedil;a, torque, pot&ecirc;ncia mec&acirc;nica. Problemas na amplifica&ccedil;&atilde;o, transmiss&atilde;o e armazenamento de sinais. Medi&ccedil;&otilde;es de som. Medidas de press&atilde;o, vaz&atilde;o e tempreatura. Medidas de propriedades t&eacute;rmicas e de transporte. Introdu&ccedil;&atilde;o ao processamento de sinais, amostragem, filtros digitais, janelamento e espectro de frequ&ecirc;ncia.</p>', NULL, 0, 11, 1317, 36, 4),
(2129, 'EM707', 'Controle de Sistemas Mec√¢nicos', 4, 'G', 1, 0, '<p>Conceitos fundamentais. Crit&eacute;rios de estabilidade. Resposta em frequ&ecirc;ncia. Lugar das ra&iacute;zes. A&ccedil;&otilde;es de controle b&aacute;sicas. No&ccedil;&otilde;es de modelagem de estado. Aplica&ccedil;&otilde;es em controle de sistemas mec&acirc;nicos, hidr&aacute;ulicos e pneum&aacute;ticos, usando PID/CLP.</p>', NULL, 0, 11, 1848, 668, 6),
(2131, 'EM730', 'Conforma√ß√£o Mec√¢nica', 2, 'G', 1, 0, '<p>Classifica&ccedil;&atilde;o dos processos de conforma&ccedil;&atilde;o. Metalurgia e mec&acirc;nica da conforma&ccedil;&atilde;o. Descri&ccedil;&atilde;o de processos de conforma&ccedil;&atilde;o. Projetos de ferramentas de estampagem e forjamento.</p>', NULL, 0, 11, 1298, 29, 2),
(2132, 'EM731', 'Processos Metal√∫rgicos de Fabrica√ß√£o', 2, 'G', 2, 0, '<p>Princ&iacute;pios de metalurgia do princ&iacute;pio de solidifica&ccedil;&atilde;o. Tecnologia da fundi&ccedil;&atilde;o. Simbologia e normaliza&ccedil;&atilde;o em soldagem. Equipamentos e processos de soldagem. Metalurgia da soldagem.</p>', NULL, 0, 11, 1423, 59, 3),
(2133, 'EM733', 'Sistemas Produtivos', 4, 'G', 2, 0, '<p>Conceitua&ccedil;&atilde;o da manufatura. Tempos padr&otilde;es. Classifica&ccedil;&atilde;o dos sistemas de manufatura. Tecnologia de grupo. Produtividade industrial. Planejamento e controle da produ&ccedil;&atilde;o. Teoria das Restri&ccedil;&otilde;es. MRP I e II. Arranjo f&iacute;sico. Sistema Toyota de Produ&ccedil;&atilde;o.</p>', NULL, 0, 11, 1176, 42, 2),
(2137, 'EM738', 'Propriedades Mec√¢nicas dos Materiais e Mecanismos de Fratura', 4, 'G', 5, 0, '<p>Propriedades de flu&ecirc;ncia. Propriedades de fadiga. Mecanismos de fratura e fadiga. No&ccedil;&otilde;es de mec&acirc;nica da fratura. Ensaios de tenacidada &agrave; fratura. Influ&ecirc;ncias de vari&aacute;veis microestruturais na tenacidade da fratura. Aplica&ccedil;&atilde;o da mec&acirc;nica de fratura el&aacute;stica linear ao projeto estrutural. No&ccedil;&otilde;es de mec&acirc;nica da fratura elastopl&aacute;stica. No&ccedil;&otilde;es de propaga&ccedil;&atilde;o de t&eacute;cnicas por fadiga.</p>', NULL, 0, 11, 905, 66, 3),
(2138, 'EM739', 'Materiais Comp√≥sitos', 2, 'G', 5, 0, '<p>Defini&ccedil;&atilde;o de materiais comp&oacute;sitos. Comp&oacute;sitos de matriz met&aacute;lica. Comp&oacute;sitos de matriz polim&eacute;rica. Comp&oacute;sitos de matriz cer&acirc;mica. Processos de fabrica&ccedil;&atilde;o, caracteriza&ccedil;&atilde;o estrutural e de propriedades. Compatibilidade de matriz e refor&ccedil;o, problemas de incorpora&ccedil;&atilde;o, rea&ccedil;&otilde;es de interface.</p>', NULL, 0, 11, 353, 0, 1),
(2139, 'EM740', 'Laborat√≥rio de Engenharia dos Materiais', 2, 'G', 2, 0, '<p>Experi&ecirc;ncias de laborat&oacute;rio relativas a estrutura, propriedades e transforma&ccedil;&otilde;es de fase de materiais met&aacute;licos e n&atilde;o met&aacute;licos.</p>', NULL, 0, 11, 727, 4, 1),
(2140, 'EM741', 'Engenharia de Superf√≠cie', 4, 'G', 5, 0, '<p>Introdu&ccedil;&atilde;o &agrave; corros&atilde;o. Revestimentos galv&acirc;nicos; pintura; filmes finos; convers&atilde;o qu&iacute;mica; metaliza&ccedil;&atilde;o; implanta&ccedil;&atilde;o i&ocirc;nica; laser; difus&atilde;o e tratamentos termo qu&iacute;micos. Caracteriza&ccedil;&atilde;o de superf&iacute;cie.</p>', NULL, 0, 11, 305, 0, 1),
(2144, 'EM790', 'Engenharia Assistida por Computador', 2, 'G', 2, 0, '<p>Conceitos de CAD, CAE e CAM integrados. Sistemas de visualiza&ccedil;&atilde;o 2D e 3D. Conceitos de Projeto Mec&acirc;nico. Modelagem para refinamento, an&aacute;lise e otimiza&ccedil;&atilde;o de sistemas mec&acirc;nicos. Aplica&ccedil;&atilde;o do m&eacute;todo de elementos finitos a problemas estruturais e t&eacute;rmicos. Desenvolvimento de projeto assistido por computador.</p>', NULL, 0, 11, 1094, 20, 2),
(2147, 'EM802', 'Caracteriza√ß√£o de Reservat√≥rios Petrol√≠feros', 4, 'G', 5, 0, '<p>Propriedades de rochas e fluidos. Avalia&ccedil;&atilde;o de reservat&oacute;rios. An&aacute;lise de testes de forma&ccedil;&atilde;o. Mecanismos de produ&ccedil;&atilde;o. An&aacute;lise de reservas.</p>', NULL, 0, 11, 183, 1, 1),
(2158, 'EM833', 'Sele√ß√£o de Materiais', 2, 'G', 1, 0, '<p>Crit&eacute;rios de sele&ccedil;&atilde;o de materiais. Matriz de decis&atilde;o ponderada. Sele&ccedil;&atilde;o de materiais(met&aacute;licos, polim&eacute;ricos, cer&acirc;micos e conjugados) para atender &agrave;s solicita&ccedil;&otilde;es: resist&ecirc;ncia mec&acirc;nica, fadiga, tenacidade, desgaste, altas temperaturas, corros&atilde;o. Trabalho pr&aacute;tico de sele&ccedil;&atilde;o de materiais junto &agrave; ind&uacute;stria.</p>', NULL, 0, 11, 1237, 11, 2),
(2162, 'EM853', 'Engenharia Econ√¥mica', 2, 'G', 1, 0, '<p>Matem&aacute;tica financeira. Custos. An&aacute;lise de investimentos. No&ccedil;&otilde;es de contabilidade.</p>', NULL, 0, 11, 1229, 67, 3),
(2170, 'EM865', 'Motores de Combust√£o Interna', 4, 'G', 5, 0, '<p>Conceitos pr&aacute;ticos de motores &agrave; gasolina, diesel e g&aacute;s. Teoria de combust&atilde;o aplicada a motores. Ondas de combust&atilde;o. Projeto de c&acirc;mara de combust&atilde;o. Curvas de pot&ecirc;ncia, torque, consumo e press&atilde;o m&eacute;dia. Avalia&ccedil;&atilde;o pr&aacute;tica do motor.</p>', NULL, 0, 11, 392, 20, 2),
(2178, 'EM884', 'Sistemas Fluidot√©rmicos II', 4, 'G', 1, 0, '<p>Introdu&ccedil;&atilde;o a sistemas fluidot&eacute;rmicos. Combust&iacute;veis e combust&atilde;o. Gera&ccedil;&atilde;o, distribui&ccedil;&atilde;o e utiliza&ccedil;&atilde;o de vapor. Fornos, aquecedores e incineradores. Sistemas de gera&ccedil;&atilde;o de pot&ecirc;ncia. Turbinas t&eacute;rmicas. Motores de combust&atilde;o interna. Sistemas de cogera&ccedil;&atilde;o. Projeto, an&aacute;lise, integra&ccedil;&atilde;o de crit&eacute;rios econ&ocirc;micos, ambientais e otimiza&ccedil;&atilde;o de sistemas de gera&ccedil;&atilde;o de pot&ecirc;ncia.</p>', NULL, 0, 11, 719, 80, 3),
(2185, 'EM907', 'Desenho 3D Assistido por Computador', 2, 'G', 2, 0, '<p>MODELAGEM 3D. O conceito de &quot;features&quot; para desenho. A concep&ccedil;&atilde;o atrav&eacute;s de &quot;sketchs&quot; (esbo&ccedil;os). O processamento geom&eacute;trico de perfis a partir de esbo&ccedil;os. A Cota&ccedil;&atilde;o inteligente-funcional. A obten&ccedil;&atilde;o de vistas e cortes a partir do modelo s&oacute;lido. A obten&ccedil;&atilde;o autom&aacute;tica de grandezas de massa. Desenhos de conjuntos. Padr&otilde;es para exporta&ccedil;&atilde;o/importa&ccedil;&atilde;o de desenhos entre sistemas distintos. O conceito de &quot;model-space&quot; e &quot;paper-space&quot;. O interfaceamento CAD/CAM.</p>', NULL, 0, 11, 157, 4, 1),
(2187, 'EM909', 'Projeto de Sistemas Mec√¢nicos', 4, 'G', 2, 0, '<p>Metodologia e sistem&aacute;tica do projeto. M&eacute;todos de sistematiza&ccedil;&atilde;o da criatividade. Concep&ccedil;&atilde;o a partir de crit&eacute;rios de funcionalidade. QFD e an&aacute;lise do valor. Arquitetura mec&acirc;nica. Metodologias Design for X: Seguran&ccedil;a, Manufatura, Confiabilidade. Otimiza&ccedil;&atilde;o. Documenta&ccedil;&atilde;o de projeto. Projeto detalhado. Prototipagem e maquetagem.</p>', NULL, 0, 11, 668, 6, 1),
(2189, 'EM914', 'Trabalho de Gradua√ß√£o I', 2, 'G', 5, 0, '<p>Trabalho de car&aacute;ter te&oacute;rico e/ou pr&aacute;tico, envolvendo conhecimentos adquiridos em diversas disciplinas do curso de Engenharia Mec&acirc;nica. O trabalho ser&aacute; desenvolvido sob a orienta&ccedil;&atilde;o de um professor, com apresenta&ccedil;&atilde;o final escrita e analisada por, ao menos, dois professores do Curso de Engenharia Mec&acirc;nica.</p>', NULL, 0, 11, 1120, 67, 3),
(2191, 'EM916', 'Est√°gio Supervisionado', 12, 'G', 5, 0, '<p>Acompanhamento de projetos. Montagens e execu&ccedil;&otilde;es de equipamentos e sistemas em Engenharia Mec&acirc;nica junto a um &oacute;rg&atilde;o credenciado pelo departamento. O est&aacute;gio &eacute; orientado bilateralmente e conclui com a apresenta&ccedil;&atilde;o de um relat&oacute;rio.</p>', NULL, 0, 11, 1040, 54, 2),
(2193, 'EM918', 'T√≥picos em Engenharia Aeron√°utica', 2, 'G', 1, 0, '<p>Ementa vari&aacute;vel. Semin&aacute;rios sobre t&oacute;picos espec&iacute;ficos em engenharia aeron&aacute;utica: Novas tecnologias e m&eacute;todos utilizados em engenharia aeron&aacute;utica. Novos produtos e equipamentos. Processos especiais. T&oacute;picos complementares em engenharia aeron&aacute;utica.</p>', NULL, 0, 11, 664, 6, 2),
(2194, 'EM919', 'Trabalho de Gradua√ß√£o II', 4, 'G', 5, 0, '<p>Trabalho de car&aacute;ter te&oacute;rico e/ou pr&aacute;tico, envolvendo conhecimentos adquiridos em diversas disciplinas do curso de Engenharia Mec&acirc;nica. O trabalho, que dever&aacute; ser uma continua&ccedil;&atilde;o do trabalho iniciado na disciplina EM914, ser&aacute; desenvolvido sob a orienta&ccedil;&atilde;o de um professor, com apresenta&ccedil;&atilde;o final escrita e analisada por, ao menos, dois professores do Curso de Engenharia Mec&acirc;nica.</p>', NULL, 0, 11, 1194, 163, 4),
(2196, 'EM921', 'Manufatura Assistida por Computador', 4, 'G', 5, 0, '<p>CNC: Tipos de CNC, Centros de Torneamento; Centros de Usinagem; Programa&ccedil;&atilde;o manual; Programa&ccedil;&atilde;o via CAM; DNC; Desenvolvimento de programas.</p>', NULL, 0, 11, 379, 1, 1),
(2203, 'EM949', 'Manuten√ß√£o Industrial', 2, 'G', 5, 0, '<p>Organiza&ccedil;&atilde;o, Planejamento e controle de manuten&ccedil;&atilde;o. Manuten&ccedil;&atilde;o mec&acirc;nica e el&eacute;trica de equipamentos e instala&ccedil;&otilde;es. Lubrifica&ccedil;&atilde;o.</p>', NULL, 0, 11, 474, 3, 1),
(2212, 'EM972', 'Oferta e Demanda de Energia', 2, 'G', 5, 0, '<p>Recursos minerais energ&eacute;ticos e fontes renov&aacute;veis de energia. Hist&oacute;ria da produ&ccedil;&atilde;o e consumo da energia no Brasil e no mundo. Influ&ecirc;ncia dos fatores tecnol&oacute;gicos, econ&ocirc;micos, pol&iacute;ticos, sociais e ecol&oacute;gicos em sistemas energ&eacute;ticos como petr&oacute;leo, carv&atilde;o mineral, g&aacute;s natural e outros. Avalia&ccedil;&atilde;o cr&iacute;tica do cumprimento de energia. Descri&ccedil;&atilde;o dos usos de energia nos principais setores da sociedade moderna e sua evolu&ccedil;&atilde;o recente. Demanda e utiliza&ccedil;&atilde;o de energia. Fluxos de energia e estruturas de consumo. Gest&atilde;o e pol&iacute;ticas energ&eacute;ticas. Planejamento energ&eacute;tico.</p>', NULL, 0, 11, 456, 4, 2),
(2214, 'EM974', 'M√©todos Computacionais em Engenharia T√©rmica e Ambiental', 2, 'G', 5, 0, '<p>Introdu&ccedil;&atilde;o ao m&eacute;todo dos volumes finitos, aplicado em programas computacionais para a simula&ccedil;&atilde;o de fen&ocirc;menos envolvendo escoamento de fluidos, transfer&ecirc;ncia de calor e transfer&ecirc;ncia de massa, no &acirc;mbito do estudo de sistemas energ&eacute;ticos e de seus impactos ambientais.</p>', NULL, 0, 11, 234, 3, 1),
(2215, 'EM975', 'Gest√£o do Uso da Energia', 2, 'G', 5, 0, '<p>Uso racional de energia: conceitos e princ&iacute;pios da conserva&ccedil;&atilde;o e da substitui&ccedil;&atilde;o. An&aacute;lise de processos industriais energo-intensivos e caracteriza&ccedil;&atilde;o do uso de energia. Instrumento de an&aacute;lise, diagn&oacute;stico e auditoria. Princ&iacute;pios da gest&atilde;o do uso da energia. Otimiza&ccedil;&atilde;o energ&eacute;tica em sistemas industriais. Aspectos ambientais da gest&atilde;o do uso de energia: subprodutos, res&iacute;duos, efluentes e reciclagem.</p>', NULL, 0, 11, 209, 0, 1),
(2220, 'EM984', 'Sistemas Fluidot√©rmicos III', 4, 'G', 2, 0, '<p>Projeto, an&aacute;lise e otimiza&ccedil;&atilde;o de sistemas fluidot&eacute;rmicos. An&aacute;lise sist&ecirc;mica de plantas de bombeamento, recupera&ccedil;&atilde;o de calor, gera&ccedil;&atilde;o de pot&ecirc;ncia, refrigera&ccedil;&atilde;o e ar-condicionado. Integra&ccedil;&atilde;o de crit&eacute;rios econ&ocirc;micos e ambientais. Uso integrado de ferramentas computacionais de c&aacute;lculo de propriedades termofluidodin&acirc;micas na simula&ccedil;&atilde;o e otimiza&ccedil;&atilde;o de sistemas fluidot&eacute;rmicos.</p>', NULL, 0, 11, 470, 14, 2),
(2382, 'EP368', 'Educa√ß√£o, Sa√∫de e Trabalho', 4, 'G', 6, 0, '<p>Implica&ccedil;&otilde;es da organiza&ccedil;&atilde;o do trabalho na pr&aacute;tica dos profissionais em Educa&ccedil;&atilde;o e Sa&uacute;de. Rela&ccedil;&atilde;o desta pr&aacute;tica com as necessidades concretas da popula&ccedil;&atilde;o em suas condi&ccedil;&otilde;es de vida e trabalho.</p>', NULL, 0, 5, 69, 0, 0),
(2504, 'EQ481', 'Introdu√ß√£o √† Engenharia Qu√≠mica', 4, 'G', 5, 0, '<p>A ind&uacute;stria qu&iacute;mica. Opera&ccedil;&otilde;es e processos unit&aacute;rios. Estequiometria. Balan&ccedil;os de massa e de energia. Aplica&ccedil;&otilde;es simples a processos de balan&ccedil;o de massa e energia combinados.</p>', NULL, 0, 12, 1413, 114, 3),
(2572, 'ES235', 'Engenharia de Fabrica√ß√£o', 2, 'G', 2, 0, '<p>Normas t&eacute;cnicas. Toler&acirc;ncias dimensionais. Rugosidade superficial. Metrologia industrial. Ajustes e toler&acirc;ncias (furo-base, eixo-base). Controle estat&iacute;stico de processo e sistema de medi&ccedil;&atilde;o em processo.</p>', NULL, 0, 11, 420, 3, 2),
(2573, 'ES242', 'Materiais de Engenharia', 2, 'G', 1, 0, '<p>A estrutura cristalina dos metais: modelos e defeitos. Liga&ccedil;&otilde;es e difus&atilde;o at&ocirc;mica. Estrutura e propriedades dos materiais. Materiais cer&acirc;micos e polim&eacute;ricos. Materiais conjugados. Materiais de grau eletr&ocirc;nico (obten&ccedil;&atilde;o/extra&ccedil;&atilde;o, beneficiamento e caracteriza&ccedil;&atilde;o). Materiais espec&iacute;ficos para o segmento eletro/eletr&ocirc;nico (placas de CI, materiais para contactores e/ou disjuntores). Materiais para aplica&ccedil;&atilde;o em micro-eletr&ocirc;nica. Materiais espec&iacute;ficos para constru&ccedil;&atilde;o de rob&ocirc;s industriais.</p>', NULL, 0, 11, 567, 26, 2),
(2575, 'ES333', 'Laborat√≥rio de Ensaio dos Materiais', 2, 'G', 2, 0, '<p>Normas de ensaios de materiais. Ensaios mec&acirc;nicos. Ensaios n&atilde;o-destrutivos. An&aacute;lise metalografia. Caracteriza&ccedil;&atilde;o de materiais de grau eletr&ocirc;nico.</p>', NULL, 0, 11, 298, 3, 1),
(2577, 'ES401', 'Matem√°tica para Engenharia', 2, 'G', 2, 0, '<p>Introdu&ccedil;&atilde;o &agrave;s vari&aacute;veis complexas e fun&ccedil;&otilde;es de vari&aacute;veis complexas. Transformada de Laplace. Solu&ccedil;&atilde;o de equa&ccedil;&otilde;es diferenciais de primeira e segunda ordem. S&eacute;rie de Fourier e Transformada de Fourier. Transformada discreta de Fourier. Equa&ccedil;&otilde;es a diferen&ccedil;as. Transforma Z. Solu&ccedil;&atilde;o de equa&ccedil;&otilde;es a diferen&ccedil;as de primeira e segunda ordem.</p>', NULL, 0, 11, 427, 45, 3),
(2581, 'ES542', 'Tratamentos T√©rmicos', 2, 'G', 1, 0, '<p>Leis de difus&atilde;o e conceitos fundamentais de solidifica&ccedil;&atilde;o. T&eacute;cnicas de refino zonal e crescimento de cristais. Tratamentos t&eacute;rmicos e termoqu&iacute;micos. Fundamentos eletroqu&iacute;micos da corros&atilde;o e tipos de corros&atilde;o. M&eacute;todos de prote&ccedil;&atilde;o contra a corros&atilde;o. Oxida&ccedil;&atilde;o. Tratamentos e revestimentos de superf&iacute;cie.</p>', NULL, 0, 11, 350, 10, 2),
(2582, 'ES563', 'Laborat√≥rio de M√°quinas El√©tricas', 2, 'G', 1, 0, '<p>Pot&ecirc;ncia e energia el&eacute;trica. Circuitos monof&aacute;sicos e trif&aacute;sicos. Transformadores. M&aacute;quinas de corrente cont&iacute;nua de pequeno porte, motores de im&atilde; permanente e de passo. M&aacute;quinas de corrente cont&iacute;nua de grande porte. M&aacute;quinas de indu&ccedil;&atilde;o mono e trif&aacute;sicos. M&aacute;quinas s&iacute;ncronas.</p>', NULL, 0, 11, 229, 0, 1),
(2583, 'ES572', 'Circuitos L√≥gicos', 4, 'G', 2, 0, '<p>Conceitos l&oacute;gicos. Circuitos b&aacute;sicos. Minimiza&ccedil;&atilde;o de fun&ccedil;&otilde;es Booleanas. Sistemas de numera&ccedil;&atilde;o. Aritm&eacute;tica bin&aacute;ria. C&oacute;digos. Circuitos &agrave; contato. S&iacute;ntese de circuitos combinacionais. Circuitos de mem&oacute;ria. Circuitos sequenciais. Projeto de circuitos sequenciais. M&aacute;quinas de Mealy e Moole. Projeto de contadores, decodificadores e multiplexadores. Temporizadores: monoest&aacute;veis, ast&aacute;veis e osciladores. Dispositivos l&oacute;gicos program&aacute;veis.</p>', NULL, 0, 11, 331, 27, 1),
(2586, 'ES575', 'Laborat√≥rio de Circuitos L√≥gicos', 2, 'G', 1, 0, '<p>Circuitos combinacionais. Flip-flops, contadores e temporizadores. Circuitos sequenciais. Conversor digital/anal&oacute;gico e anal&oacute;gico/digital. Dispositivos l&oacute;gicos program&aacute;veis.</p>', NULL, 0, 11, 291, 2, 1),
(2588, 'ES601', 'An√°lise Linear de Sistemas', 4, 'G', 2, 0, '<p>Caracteriza&ccedil;&atilde;o de sistemas lineares no tempo cont&iacute;nuo e no tempo discreto. Teorema da amostragem. Fun&ccedil;&atilde;o de transfer&ecirc;ncia. An&aacute;lise de resposta em frequ&ecirc;ncia de sistemas no tempo cont&iacute;nuo e no tempo discreto. Representa&ccedil;&atilde;o no espa&ccedil;o de estado. Realiza&ccedil;&otilde;es can&ocirc;nicas de fun&ccedil;&otilde;es de transfer&ecirc;ncia. Solu&ccedil;&atilde;o temporal no espa&ccedil;o de estado. Estabilidade de sistemas cont&iacute;nuos e discretos. Conceitos b&aacute;sicos de controlabilidade e observabilidade.</p>', NULL, 0, 11, 480, 135, 3),
(2591, 'ES626', 'Modelagem de Dispositivos Eletromec√¢nicos', 2, 'G', 1, 0, '<p>Eletromagnetismo aplicado a dispositivos eletromec&acirc;nicos. Sistemas multidom&iacute;nio. Modelagem e an&aacute;lise din&acirc;mica de dispositivos multidom&iacute;nio. Sistemas eletromec&acirc;nicos, magn&eacute;ticos e eletro-hidr&aacute;ulicos. Sensores e atuadores. Simula&ccedil;&atilde;o de comportamento din&acirc;mico usando circuitos equivalentes e grafos de conex&otilde;es (bond graphs). Aplica&ccedil;&atilde;o a sistemas mecatr&ocirc;nicos.</p>', NULL, 0, 11, 272, 54, 0),
(2592, 'ES663', 'Eletr√¥nica para Automa√ß√£o Industrial', 4, 'G', 1, 0, '<p>Revis&atilde;o de m&aacute;quinas el&eacute;tricas de corrente cont&iacute;nua e corrente alterada. M&eacute;todos de controle de velocidade de motores. Revis&atilde;o dos componentes eletr&ocirc;nicos utilizados, diodos de pot&ecirc;ncia, transistores bipolares, mosfet de pot&ecirc;ncia e dispositivos tiristores. Controle de motores de baixa pot&ecirc;ncia. Controle de motores de im&atilde; permanente, sem escova e de passo. Acionamento a velocidade vari&aacute;vel de motores trif&aacute;sicos de alta pot&ecirc;ncia. Acionamento a velocidade vari&aacute;vel de motores de corrente cont&iacute;nua e de indu&ccedil;&atilde;o. Retificadores, conversores e inversores de frequ&ecirc;ncia.</p>', NULL, 0, 11, 368, 27, 4),
(2593, 'ES664', 'Laborat√≥rio de Eletr√¥nica para Automa√ß√£o Industrial', 2, 'G', 2, 0, '<p>Dispositivos de pot&ecirc;ncia: diodos, tiristores, transistores e outros dispositivos semi-condutores. Reguladores de pot&ecirc;ncia. Conversores. Controle de motores CC. Inversores. Controles de motores CA.</p>', NULL, 0, 11, 293, 4, 2),
(2596, 'ES670', 'Projeto de Sistemas Embarcados', 4, 'G', 1, 0, '<p>Conceitos gerais de sistemas embarcados. Arquiteturas de microprocessadores, microcontroladores e processadores digitais de sinais. Conceito b&aacute;sico de sistemas de tempo real. Metodologia de projeto de sistemas embarcados. Sistemas de m&aacute;quinas de estados. Metodologia SDL. Administra&ccedil;&atilde;o do tempo em sistemas computacionais. Linguagens de programa&ccedil;&atilde;o e sistemas operacionais para tempo real. Exemplos pr&aacute;ticos de projeto de sistemas.</p>', NULL, 0, 11, 238, 6, 1),
(2597, 'ES672', 'Sistemas Fluidot√©rmicos I', 4, 'G', 1, 0, '<p>Introdu&ccedil;&atilde;o &agrave; psicometria. Sistemas de ventila&ccedil;&atilde;o, condicionamento de ar e frigor&iacute;ficos. Conceitos aplicados ao c&aacute;lculo de carga t&eacute;rmica. Fluidos refrigerantes. Componentes dos sistemas de compress&atilde;o. Componentes dos sistemas de distribui&ccedil;&atilde;o de gases e l&iacute;quidos. C&aacute;lculo de redes de condutos. Projeto. Introdu&ccedil;&atilde;o &agrave; combust&atilde;o. Motores de combust&atilde;o interna. Gera&ccedil;&atilde;o e Distribui&ccedil;&atilde;o de vapor. Gera&ccedil;&atilde;o de pot&ecirc;ncia e co-gera&ccedil;&atilde;o.</p>', NULL, 0, 11, 254, 6, 1),
(2598, 'ES690', 'Sistemas Mec√¢nicos', 4, 'G', 2, 0, '<p>Descri&ccedil;&atilde;o, dimensionamento, sele&ccedil;&atilde;o e utiliza&ccedil;&atilde;o de elementos mec&acirc;nicos. An&aacute;lise de sistemas mec&acirc;nicos e transmiss&atilde;o de energia. Modelagem matem&aacute;tica de sistemas din&acirc;micos.</p>', NULL, 0, 11, 278, 10, 2),
(2599, 'ES704', 'Instrumenta√ß√£o B√°sica', 2, 'G', 2, 0, '<p>Caracter&iacute;sticas est&aacute;ticas e din&acirc;micas dos instrumentos e sensores. An&aacute;lise de dados e incertezas experimentais. Principios gerais de transdu&ccedil;&atilde;o. Medidas de press&atilde;o, vaz&atilde;o e temperatura. Medida e an&aacute;lise de deslocamento, velocidade, acelera&ccedil;&atilde;o, for&ccedil;a, torque, pot&ecirc;ncia mec&acirc;nica. Medi&ccedil;&otilde;es de som. Instrumenta&ccedil;&atilde;o industrial.</p>', NULL, 0, 11, 241, 15, 1),
(2600, 'ES710', 'Controle de Sistemas Mec√¢nicos', 4, 'G', 2, 0, '<p>Conceito de realimenta&ccedil;&atilde;o. Modelagem de sistemas din&acirc;micos no tempo cont&iacute;nuo e no tempo discreto. Equivalentes discretos e sistemas amostrados. An&aacute;lise de resposta em regime transit&oacute;rio e estacion&aacute;rio. An&aacute;lise de resposta em frequ&ecirc;ncia. Crit&eacute;rios de estabilidade: Routh-Hurwitz e de Nyquist. Projetos no dom&iacute;nio da frequ&ecirc;ncia cont&iacute;nuo e discreto: avan&ccedil;o-atraso; lugar das ra&iacute;zes; PID. Convers&atilde;o de controladores do tempo cont&iacute;nuo para discreto.</p>', NULL, 0, 11, 313, 82, 1),
(2605, 'ES726', 'Laborat√≥rio de Sistemas Pneum√°ticos e Hidr√°ulicos', 2, 'G', 1, 0, '<p>Introdu&ccedil;&atilde;o aos dispositivos b&aacute;sicos hidr&aacute;ulicos e pneum&aacute;ticos; circuitos b&aacute;sicos pneum&aacute;ticos e hidr&aacute;ulicos e an&aacute;lise de suas caracter&iacute;sticas; circuitos b&aacute;sicos eletropneum&aacute;ticos e eletro-hidr&aacute;ulicos; controle manual e autom&aacute;tico; sensores e atuadores; controlador l&oacute;gico program&aacute;vel.</p>', NULL, 0, 11, 224, 3, 0),
(2607, 'ES728', 'Controle Avan√ßado de Sistemas', 4, 'G', 2, 0, '<p>Modelagem no espa&ccedil;o de estado para sistemas cont&iacute;nuos e discretos. Projeto de controladores cont&iacute;nuos e discretos por realimenta&ccedil;&atilde;o completa de estado. Projeto de rastreadores. Controlabilidade e Observabilidade. Estimadores e observadores de estado. Projeto de controladores din&acirc;micos cont&iacute;nuos e discretos por realimenta&ccedil;&atilde;o de sa&iacute;da. Controlador linear quadr&aacute;tico &oacute;timo cont&iacute;nuo e discreto. Normas H2 e H-infinito. Projetos de controladores H2 e H-infinito. Introdu&ccedil;&atilde;oa incertezas de modelagem e robustez.</p>', NULL, 0, 11, 403, 76, 5),
(2608, 'ES730', 'Processos Mec√¢nicos de Fabrica√ß√£o', 2, 'G', 1, 0, '<p>Processos de conforma&ccedil;&atilde;o pl&aacute;stica - descri&ccedil;&atilde;o e aplica&ccedil;&atilde;o; Processos de usinagem - descri&ccedil;&atilde;o e aplica&ccedil;&atilde;o; Sele&ccedil;&atilde;o da pe&ccedil;a bruta; Sequ&ecirc;ncia de opera&ccedil;&otilde;es de fabrica&ccedil;&atilde;o - defini&ccedil;&atilde;o da superf&iacute;cie de refer&ecirc;ncia, escolha das opera&ccedil;&otilde;es, c&aacute;lculo dos sobremateriais e das dimens&otilde;es intermedi&aacute;rias.</p>', NULL, 0, 11, 304, 12, 1),
(2615, 'ES826', 'Engenharia Simult√¢nea', 2, 'G', 5, 0, '<p>A organiza&ccedil;&atilde;o fabril por departamentos. A organiza&ccedil;&atilde;o por Centros de Custos. A organiza&ccedil;&atilde;o por Centros de Lucros. T&eacute;cnicas modernas de gest&atilde;o de projetos. O arranjo celular para manufatura. O conceito de equipes de trabalho multidisciplinares. A organiza&ccedil;&atilde;o integrada por computador.</p>', NULL, 0, 11, 254, 1, 1),
(2617, 'ES828', 'Laborat√≥rio de Controle de Sistemas', 2, 'G', 1, 0, '<p>Identifica&ccedil;&atilde;o de par&acirc;metros de sistemas, controladores avan&ccedil;o-atraso, controladores PID, controladores por realimenta&ccedil;&atilde;o de estados, reguladores lineares quadr&aacute;ticos, controladores em tempo-discreto.</p>', NULL, 0, 11, 357, 3, 3),
(2618, 'ES879', 'Sistemas de Aquisi√ß√£o de Dados', 4, 'G', 2, 0, '<p>Amplificadores e condicionadores de sinais. Principais filtros anal&oacute;gicos. Convers&atilde;o D/A e A/D, amostragem e efeitos de quantiza&ccedil;&atilde;o. Transformada z e Tranformada de Fourier discreta. Filtros digitais FIR e IIR. Experimentos apresentando os efeitos e o teorema da amostragem, filtros anal&oacute;gicos e digitais t&iacute;picos e an&aacute;lise de resposta em frequ&ecirc;ncia.</p>', NULL, 0, 11, 389, 46, 2),
(2621, 'ES926', 'Automa√ß√£o Industrial', 4, 'G', 2, 0, '<p>Aplica&ccedil;&otilde;es da automa&ccedil;&atilde;o pneum&aacute;tica, hidr&aacute;ulica e el&eacute;trica. Circuitos eletro-hidr&aacute;ulicos e eletropneum&aacute;ticos industrias. Modelagem e controle de sistemas automatizados. Aplica&ccedil;&otilde;es de controladores industriais: controladores program&aacute;veis e computadores industrias. Integra&ccedil;&atilde;o com m&eacute;todos de engenharia de produ&ccedil;&atilde;o. Controle de c&eacute;lulas de manufatura. Dispositivos de seguran&ccedil;a. Estudo de casos pr&aacute;ticos envolvendo sistemas de produ&ccedil;&atilde;o industrial automatizados.</p>', NULL, 0, 11, 310, 10, 3),
(2623, 'ES931', 'Administra√ß√£o dos Sistemas de Produ√ß√£o', 2, 'G', 5, 0, '<p>Evolu&ccedil;&atilde;o das teorias de administra&ccedil;&atilde;o. Estrutura e funcionamento das organiza&ccedil;&otilde;es. T&eacute;cnicas de planejamento, programa&ccedil;&atilde;o e gerenciamento e controle da produ&ccedil;&atilde;o. An&aacute;lise de valores. MRP. PERT-CPM. Pesquisa operacional.</p>', NULL, 0, 11, 319, 0, 1),
(2625, 'ES952', 'Trabalho de Gradua√ß√£o II', 4, 'G', 2, 0, '<p>Conclus&atilde;o do TG, com &ecirc;nfase te&oacute;rica e/ou tecnol&oacute;gica de forma a englobar conhecimentos adquiridos em diversas disciplinas do curso de Engenharia de Controle e Automa&ccedil;&atilde;o. A orienta&ccedil;&atilde;o poder&aacute; ser feita por professor da FEM, FEEC ou IC. Ao final do trabalho o aluno apresentar&aacute; uma monografia escrita, al&eacute;m da apresenta&ccedil;&atilde;o final &agrave; uma banca examinadora constitu&iacute;da por professores/profissionais da &aacute;rea.</p>', NULL, 0, 11, 394, 61, 3),
(2626, 'ES965', 'Projeto de Sistemas Mecatr√¥nicos', 4, 'G', 2, 0, '<p>Sistem&aacute;tica e Metodologia do projeto Industrial. Arquitetura Mec&acirc;nica, concep&ccedil;&atilde;o a partir de crit&eacute;rios de funcionalidade do produto, QFD. An&aacute;lise do valor no desenvolvimento do projeto. M&eacute;todos de Sistematiza&ccedil;&atilde;o da criatividade no projeto. Projeto Seguro. Ergonomia, Confiabilidade. Projetar para modularidade, expans&atilde;o, disponibilidade, Controle, custo, etc (design for). Documenta&ccedil;&atilde;o t&eacute;cnica de um projeto: Atributos do produto, detalhes construtivos desenho de montagem final.</p>', NULL, 0, 11, 308, 5, 2),
(2629, 'ET520', 'Princ√≠pios de Convers√£o de Energia', 4, 'G', 5, 0, '<p>Circuitos magn&eacute;ticos. Transformadores. Princ&iacute;pios de convers&atilde;o eletromec&acirc;nica de energia. Introdu&ccedil;&atilde;o &agrave;s m&aacute;quinas el&eacute;tricas rotativas.</p>', NULL, 0, 9, 1427, 316, 5),
(2630, 'ET521', 'Laborat√≥rio de Princ√≠pios de Convers√£o de Energia', 2, 'G', 5, 0, 'Propriedades de circuitos magn√©ticos. Estudo de eletro√≠m√£. Funcionamento de m√°quinas el√©tricas rotativas. Transformador el√©trico.<br />Obs.: Esta disciplina ser√° ministrada quinzenalmente.', NULL, 1, 9, 883, 19, 3),
(2632, 'ET620', 'M√°quinas El√©tricas', 4, 'G', 5, 0, '<p>M&aacute;quina de Corrente Cont&iacute;nua. M&aacute;quina S&iacute;ncrona. M&aacute;quina de Indu&ccedil;&atilde;o. Motores de Pot&ecirc;ncia Fracion&aacute;ria e Subfracion&aacute;ria.</p>', NULL, 0, 9, 1048, 226, 3),
(2633, 'ET621', 'Laborat√≥rio de M√°quinas El√©tricas', 2, 'G', 5, 0, 'Caracter√≠stica de partida de cada tipo de motor. Ensaios com m√°quina CC. Ensaios com m√°quina s√≠ncrona. Ensaios com m√°quina de indu√ß√£o.<br />Obs.: Esta disciplina ser√° ministrada quinzenalmente.', NULL, 1, 9, 792, 31, 2),
(2634, 'ET720', 'Sistemas de Energia El√©trica I', 4, 'G', 5, 0, '<p>Introdu&ccedil;&atilde;o geral. Linhas de transmiss&atilde;o. Transformadores de pot&ecirc;ncia. M&aacute;quinas s&iacute;ncronas. Introdu&ccedil;&atilde;o ao c&aacute;lculo de fluxo de pot&ecirc;ncia. Introdu&ccedil;&atilde;o a sistemas de distribui&ccedil;&atilde;o.</p>', NULL, 0, 9, 887, 131, 4),
(2658, 'EX001', 'Extens√£o Comunit√°ria I', 2, 'G', 6, 0, 'Esta disciplina √© oferecida a alunos de gradua√ß√£o envolvidos efetivamente no desenvolvimento de projeto de Extens√£o Universit√°ria Comunit√°ria supervisionados por docentes da Unicamp, na intera√ß√£o com comunidades externas √† Universidade. A Extens√£o Universit√°ria envolve, obrigatoriamente, e de forma indissol√∫vel, atividades de investiga√ß√£o cient√≠fica e outras de ensino e forma√ß√£o de recursos humanos.', NULL, 0, 24, 369, 0, 1),
(2660, 'F 010', 'Est√°gio em Empresas J√∫nior - F√≠sica', 4, 'G', 6, 0, '<p>Estudo de situa&ccedil;&otilde;es reais em F&iacute;sica, desenvolvimento e acompanhamento de projetos em F&iacute;sica - pesquisa, desenvolvimento, divulga&ccedil;&atilde;o, ensino - junto a uma Empresa J&uacute;nior. O est&aacute;gio &eacute; orientado bilateralmente, incluindo um docente do curso e &eacute; conclu&iacute;da com a apresenta&ccedil;&atilde;o de um relat&oacute;rio.</p>', NULL, 0, 20, 76, 1, 1),
(2666, 'F 016', 'T√≥picos de F√≠sica Aplicada VI', 4, 'G', 6, 0, '<p>T&oacute;picos atuais de F&iacute;sica Aplicada VI.</p>', NULL, 0, 20, 31, 0, 1),
(2667, 'F 017', 'T√≥picos de F√≠sica Aplicada VII', 4, 'G', 6, 0, '<p>T&oacute;picos atuais de F&iacute;sica Aplicada VII.</p>', NULL, 0, 20, 46, 0, 1),
(2736, 'F 128', 'F√≠sica Geral I', 4, 'G', 5, 0, '<p>Cinem&aacute;tica do ponto. Leis de Newton. Est&aacute;tica e din&acirc;mica da part&iacute;cula. Trabalho e energia. Conserva&ccedil;&atilde;o da Energia. Momento linear e sua conserva&ccedil;&atilde;o. Colis&otilde;es. Momento angular da part&iacute;cula e de sistemas de part&iacute;culas. Rota&ccedil;&atilde;o de corpos r&iacute;gidos.</p>', NULL, 0, 20, 15218, 4342, 7),
(2737, 'F 129', 'F√≠sica Experimental I', 2, 'G', 5, 0, '<p>Grandezas f&iacute;sicas e suas medidas. Erros. Instrumentos de medida. Tabelas, gr&aacute;ficos. Leis de Newton. Lei de Hooke. Estat&iacute;stica de dados, m&eacute;todo de m&iacute;nimos quadrados e propaga&ccedil;&atilde;o de erros. Movimento bidimensional. Conserva&ccedil;&atilde;o de energia. Colis&otilde;es e conserva&ccedil;&atilde;o do movimento linear.</p>', NULL, 0, 20, 10208, 872, 5),
(2739, 'F 228', 'F√≠sica Geral II', 4, 'G', 5, 0, 'Oscila&#231;&#245;es. Gravita&#231;&#227;o. Ondas em meios el&#225;sticos. Ondas sonoras. Hidrost&#225;tica e hidrodin&#226;mica. Viscosidade. Temperatura. Calorimetria e condu&#231;&#227;o de calor. Leis da termodin&#226;mica; teoria cin&#233;tica dos gases.<br />Obs.: Recomenda-se que seja cursada previamente MA151 ou disciplina equivalente.', NULL, 0, 20, 5907, 1592, 6),
(2740, 'F 229', 'F√≠sica Experimental II', 2, 'G', 5, 0, '<p>Experi&ecirc;ncias de laborat&oacute;rio sobre: oscila&ccedil;&otilde;es, gravita&ccedil;&atilde;o, ondas em meios el&aacute;sticos, ondas sonoras, hidrost&aacute;tica e hidrodin&acirc;mica, viscosidade, temperatura, calorimetria e condu&ccedil;&atilde;o de calor, leis da termodin&acirc;mica e teoria cin&eacute;tica dos gases.</p>', NULL, 0, 20, 3834, 177, 4),
(2742, 'F 315', 'Mec√¢nica Geral I', 4, 'G', 5, 0, '<p>Revis&atilde;o de matrizes e c&aacute;lculo vetorial. Mec&acirc;nica Newtoniana. Oscila&ccedil;&otilde;es lineares. Oscila&ccedil;&otilde;es n&atilde;o lineares e Caos. Gravita&ccedil;&atilde;o. C&aacute;lculo variacional. Equa&ccedil;&otilde;es de Lagrange e de Hamilton.</p>', NULL, 0, 20, 3181, 897, 5),
(2743, 'F 320', 'Termodin√¢mica', 4, 'G', 5, 0, '<p>Sistemas termodin&acirc;micos, reversibilidade, termometria. Vari&aacute;veis e equa&ccedil;&otilde;es de estado, diagramas PVT. Trabalho e primeira lei da termodin&acirc;mica. Equivalente mec&acirc;nico de calor. Energia interna, entalpia, ciclo de Carnot. Mudan&ccedil;as de fase. Segunda lei da termodin&acirc;mica e entropia. Fun&ccedil;&otilde;es termodin&acirc;micas. Aplica&ccedil;&otilde;es pr&aacute;ticas de termodin&acirc;mica. Teoria cin&eacute;tica dos gases. Distribui&ccedil;&atilde;o de velocidades moleculares.</p>', NULL, 0, 20, 880, 251, 5),
(2744, 'F 328', 'F√≠sica Geral III', 4, 'G', 5, 0, 'Lei de Coulomb, Campo El&#233;trico, Lei de Gauss, Potencial El&#233;trico, Capacit&#226;ncia, Corrente e Resist&#234;ncia, For&#231;a Eletromotriz e Circuitos El&#233;tricos, Campo Magn&#233;tico, Lei de Amp&#232;re, Lei da Indu&#231;&#227;o de Faraday, Indut&#226;ncia, Propriedades Magn&#233;ticas da Mat&#233;ria, Oscila&#231;&#245;es Eletromagn&#233;ticas, Correntes Alternadas, Equa&#231;&#245;es de Maxwell.<br />Obs.: Recomenda-se que seja cursada previamente MA251 ou disciplina equivalente.', NULL, 0, 20, 12638, 4284, 7),
(2745, 'F 329', 'F√≠sica Experimental III', 2, 'G', 5, 0, '<p>Experi&ecirc;ncias de laborat&oacute;rio sobre: lei de Coulomb e campo el&eacute;trico, lei de Gauss, potencial el&eacute;trico, capacitores e diel&eacute;tricos, corrente, resist&ecirc;ncia e for&ccedil;a eletromotriz, circuitos e instrumentos de corrente cont&iacute;nua, campo magn&eacute;tico de uma corrente, for&ccedil;as magn&eacute;ticas sobre correntes, for&ccedil;a eletromotriz induzida e circuitos de corrente alternada.</p>', NULL, 0, 20, 7512, 702, 5),
(2746, 'F 415', 'Mec√¢nica Geral II', 4, 'G', 1, 0, 'For&#231;as centrais. Sistemas de part&#237;culas. Referenciais n&#227;o inerciais. Din&#226;mica de corpos r&#237;gidos. Oscila&#231;&#245;es acopladas. Meios cont&#237;nuos e ondas. Teoria especial da Relatividade.<br />Obs.: A autoriza&#231;&#227;o AA200 n&#227;o ser&#225; aplicada aos alunos dos cursos da F&#237;sica.', NULL, 0, 20, 496, 85, 5),
(2747, 'F 428', 'F√≠sica Geral IV', 4, 'G', 5, 0, 'Ondas Eletromagn&#233;ticas, &#211;ptica Geom&#233;trica, Interfer&#234;ncia, Difra&#231;&#227;o, Teoria da Relatividade, F&#237;sica Qu&#226;ntica, Modelos At&#244;micos, Condu&#231;&#227;o de Eletricidade em S&#243;lidos, F&#237;sica Nuclear, Quarks, L&#233;ptons, e o Big-Bang.<br />Obs.: Recomenda-se que seja cursada previamente MA351 ou disciplina equivalente.', NULL, 0, 20, 4764, 1049, 7),
(2748, 'F 429', 'F√≠sica Experimental IV', 2, 'G', 5, 0, '<p>Experi&ecirc;ncias de laborat&oacute;rio sobre: propriedades magn&eacute;ticas da mat&eacute;ria, correntes alternadas, ondas eletromagn&eacute;ticas, reflex&atilde;o e refra&ccedil;&atilde;o da luz, polariza&ccedil;&atilde;o, interfer&ecirc;ncia e difra&ccedil;&atilde;o da luz e introdu&ccedil;&atilde;o &agrave; f&iacute;sica at&ocirc;mica e nuclear.</p>', NULL, 0, 20, 2883, 268, 3),
(2750, 'F 502', 'Eletromagnetismo I', 4, 'G', 1, 0, '<p>Campos eletrost&aacute;ticos no v&aacute;cuo e nos materiais diel&eacute;tricos. Resolu&ccedil;&atilde;o das equa&ccedil;&otilde;es de Poisson e Laplace. Campos magn&eacute;ticos, correntes estacion&aacute;rias e materiais n&atilde;o magn&eacute;ticos. For&ccedil;a eletromotriz induzida e energia magn&eacute;tica. Materiais magn&eacute;ticos.</p>', NULL, 0, 20, 798, 250, 6),
(2759, 'F 602', 'Eletromagnetismo II', 4, 'G', 2, 0, '<p>Equa&ccedil;&otilde;es de Maxwell. Propaga&ccedil;&atilde;o de ondas eletromagn&eacute;ticas. Reflex&atilde;o. Refra&ccedil;&atilde;o. Guias de onda. Radia&ccedil;&atilde;o. Antenas.</p>', NULL, 0, 20, 409, 93, 4),
(2760, 'F 604', 'F√≠sica Estat√≠stica', 4, 'G', 1, 0, '<p>Introdu&ccedil;&atilde;o &agrave;s propriedades de sistemas macrosc&oacute;picos. Conceitos b&aacute;sicos de probabilidade. Intera&ccedil;&atilde;o t&eacute;rmica. Fator de Boltzmann. Rela&ccedil;&atilde;o entre conceitos at&ocirc;micos e medidas macrosc&oacute;picas &quot;Ensemble&quot; microcan&ocirc;nico. Distribui&ccedil;&atilde;o can&ocirc;nica na aproxima&ccedil;&atilde;o cl&aacute;ssica. Aplica&ccedil;&otilde;es. Teorema da equiparti&ccedil;&atilde;o da energia. Intera&ccedil;&atilde;o termodin&acirc;mica. Termodin&acirc;mica estat&iacute;stica. Intera&ccedil;&atilde;o entre sistemas com troca de part&iacute;culas: o &quot;Ensemble&quot; grande can&ocirc;nico. Estat&iacute;stica qu&acirc;ntica de gases ideais: estat&iacute;sticas de f&oacute;tons, estat&iacute;sticas de Fermi-Dirac e de Bose-Einstein. Teoria cin&eacute;tica e processos de transporte.</p>', NULL, 0, 20, 462, 87, 4),
(2764, 'F 640', 'M√©todos da F√≠sica Experimental II', 4, 'G', 2, 0, 'Introdu√ß√£o: teoria dos gases rarefeitos. Escoamento de gases. Bombas de v√°cuo. Descri√ß√£o quantitativa do bombeamento de sistemas de v√°cuo. Adsor√ß√£o, dessor√ß√£o e evapora√ß√£o de mol√©culas em v√°cuo. Medidores de press√£o. Acess√≥rios: armadilhas, anteparos, v√°lvulas, etc. Detec√ß√£o de vazamennto. Veda√ß√£o. Soldagem. Limpeza. M√©todos e m√°quinas produtoras de baixa temperatura. Liquefa√ß√£o de gases. Medi√ß√£o de temperatura. Componentes criog√™nicos. <br />Obs.: A autoriza√ß√£o AA200 n√£o ser√° aplicada aos alunos dos cursos de F√≠sica.', NULL, 0, 20, 333, 11, 2),
(2767, 'F 689', 'Mec√¢nica Qu√¢ntica I', 4, 'G', 2, 0, '<p>Introdu&ccedil;&atilde;o &agrave;s id&eacute;ias fundamentais da teoria qu&acirc;ntica. O aparato matem&aacute;tica da mec&acirc;nica qu&acirc;ntica de Schr&ouml;dinger. Formaliza&ccedil;&atilde;o da Mec&acirc;nica Qu&acirc;ntica enunciado-se os postulados. Spin 1/2 e sistemas de dois n&iacute;veis. O oscilador harm&ocirc;nico unidimensional. Momento angular.</p>', NULL, 0, 20, 557, 126, 4),
(2771, 'F 740', 'M√©todos da F√≠sica Experimental III', 4, 'G', 1, 0, 'Experimentos de F&#237;sica Moderna: Medidas de constantes fundamentais da F&#237;sica: Emiss&#227;o Termoi&#244;nica. Espectroscopia at&#244;mica e nuclear. Movimentos semicondutores. Resson&#226;ncia magn&#233;tica.<br />Obs.: A autoriza&#231;&#227;o AA200 n&#227;o ser&#225; aplicada aos alunos dos cursos de F&#237;sica.', NULL, 0, 20, 630, 22, 4),
(2776, 'F 789', 'Mec√¢nica Qu√¢ntica II', 4, 'G', 1, 0, '<p>For&ccedil;as centrais e o &aacute;tomo de Hidrog&ecirc;nio. Teoria de Espalhamento de uma part&iacute;cula por um potencial. Spinores na teoria qu&acirc;ntica n&atilde;o-relativ&iacute;stica. Adi&ccedil;&atilde;o de momentos angulares. Teoria de perturba&ccedil;&atilde;o independente do tempo. Estruturas fina e hiperfina do &aacute;tomo de hidrog&ecirc;nio. Teoria de perturba&ccedil;&atilde;o dependente do tempo. Part&iacute;culas id&ecirc;nticas.</p>', NULL, 0, 20, 447, 93, 5),
(2781, 'F 839', 'M√©todos da F√≠sica Experimental VI', 4, 'G', 2, 0, '&#211;tica geom&#233;trica, Propaga&#231;&#227;o, Natureza vetorial (rela&#231;&#245;es vetoriais, vetor de Poynting, polariza&#231;&#227;o, reflex&#227;o e refra&#231;&#227;o, ondas evanescentes), Interfer&#234;ncia e coer&#234;ncia (interfer&#244;metros, coer&#234;ncia, autocorrela&#231;&#227;o, espectro de pot&#234;ncia, pulsos), Difra&#231;&#227;o, Holografia (elementos, materiais, reconstru&#231;&#227;o de uma onda, capacidade e conte&#250;do de informa&#231;&#227;o). &#211;ptica de s&#243;lidos (diel&#233;tricos isotr&#243;picos, condutores, interfaces com &#237;ndices de refra&#231;&#227;o complexos, meios anisotr&#243;picos, cristais eletro-&#243;pticos, &#243;ptica n&#227;o linear.<br />Obs.: A autoriza&#231;&#227;o AA200 n&#227;o ser&#225; aplicada aos alunos dos cursos de F&#237;sica.', NULL, 0, 20, 327, 50, 2),
(2788, 'F 885', 'Part√≠culas Elementares e Campos', 4, 'G', 6, 0, '<p>Introdu&ccedil;&atilde;o hist&oacute;rica. Conte&uacute;do de part&iacute;culas elementares previstos no modelo padr&atilde;o. Cinem&aacute;tica relativ&iacute;stica. Intera&ccedil;&otilde;es fundamentais: b&oacute;sons intermedi&aacute;rios e v&eacute;rtices primitivos da QED, QCD e intera&ccedil;&otilde;es fracas. Teorias de Gauge. Unifica&ccedil;&atilde;o eletrofraca. O mecanismo de Higgs. O modelo padr&atilde;o.</p>', NULL, 0, 20, 39, 1, 1),
(2789, 'F 887', 'F√≠sica Nuclear', 4, 'G', 2, 0, '<p>O &aacute;tomo nuclear e o n&uacute;cleo at&ocirc;mico. O modelo de g&aacute;s de Fermi. O modelo de part&iacute;cula independente. Aplica&ccedil;&otilde;es do modelo de part&iacute;cula independente. N&uacute;cleos com mais que um nucleon fora de camadas fechadas. Supercondutividade nuclear. O modelo coletivo. O modelo unificado. Aplica&ccedil;&otilde;es do modelo unificado: vibra&ccedil;&otilde;es.</p>', NULL, 0, 20, 394, 27, 3),
(2790, 'F 888', 'F√≠sica do Estado S√≥lido', 4, 'G', 2, 0, '<p>O problema geral do s&oacute;lido e suas aproxima&ccedil;&otilde;es. Movimento de caro&ccedil;os e movimento de el&eacute;trons: vis&atilde;o puramente conceitual da aproxima&ccedil;&atilde;o adiab&aacute;tica Born-Oppenheimer. Revis&atilde;o de estat&iacute;stica qu&acirc;ntica: distribui&ccedil;&otilde;es de Fermi-Dirac, Bose-Einstein e aplica&ccedil;&otilde;es. Mol&eacute;culas: liga&ccedil;&otilde;es e espectros moleculares. Estrutura cristalina e rede rec&iacute;proca. Condutores, semicondutores, supercondutores. Propriedades magn&eacute;ticas.</p>', NULL, 0, 20, 342, 39, 3),
(2793, 'F 896', 'Monografia', 8, 'G', 2, 0, '<p>Esta disciplina consistir&aacute; de aulas em sala, enfatizando a organiza&ccedil;&atilde;o e o formalismo do desenvolvimento do trabalho cient&iacute;fico, incluindo t&eacute;cnicas de reda&ccedil;&atilde;o cient&iacute;fica, ferramentas de busca, refer&ecirc;ncias bibliogr&aacute;ficas, estruturas formais de divulga&ccedil;&atilde;o cient&iacute;fica, etc.. Na parte pr&aacute;tica, dever&aacute; ser desenvolvido um tema de pesquisa individualmente pelo aluno, com o formato de um trabalho de Inicia&ccedil;&atilde;o Cient&iacute;fica, sob a orienta&ccedil;&atilde;o de um professor ou pesquisador autorizado pela Comiss&atilde;o de Gradua&ccedil;&atilde;o. A Monografia ser&aacute; avaliada no final da disciplina.</p>', NULL, 0, 20, 398, 34, 2),
(2806, 'FA017', 'T√≥picos Especiais em Tecnologia P√≥s-Colheita', 2, 'G', 6, 0, '<p>Estudo de alguns produtos agr&iacute;colas que apresentam especificidades na fase de p&oacute;s-colheita. Aspectos da produ&ccedil;&atilde;o e da colheita que interferem na qualidade final. Caracter&iacute;sticas das opera&ccedil;&otilde;es de p&oacute;s-colheita.</p>', NULL, 0, 7, 151, 0, 1),
(2819, 'FA030', 'Estradas Vicinais', 2, 'G', 6, 0, '<p>Escolha do tra&ccedil;ado de uma estrada vicinal. Projeto geom&eacute;trico. Pavimentos econ&ocirc;micos.</p>', NULL, 0, 7, 439, 14, 2),
(2840, 'FA051', 'Gest√£o Ambiental no Agroneg√≥cio', 2, 'G', 6, 0, '<p>Agroneg&oacute;cio e meio ambiente: Sistemas de gest&atilde;o ambiental p&uacute;blicos e privados. Legisla&ccedil;&atilde;o ambiental. C&oacute;digo Florestal. Licenciamento ambiental: EIA/RIMA, Marketing ambiental. Certifica&ccedil;&atilde;o ambiental.</p>', NULL, 0, 7, 209, 11, 2),
(2848, 'FA059', 'Pr√°ticas de Hidr√°ulica Aplicadas √† Engenharia', 2, 'G', 6, 0, '<p style=\"text-align: justify;\">Introdu&ccedil;&atilde;o aos princ&iacute;pios b&aacute;sicos de medidas. Medidores de press&atilde;o. Medidores de vaz&atilde;o. Experi&ecirc;ncia de Reynolds. Demonstra&ccedil;&atilde;o do Teorema de Bernoulli. Perda de carga distribu&iacute;da e localizada. Curva caracter&iacute;stica de bombas. Escoamento em superf&iacute;cie livre. Determina&ccedil;&atilde;o de energia espec&iacute;fica em canais. C&aacute;lculo de ressalto hidr&aacute;ulico. Curva de remanso. M&eacute;todos de inje&ccedil;&atilde;o de produtos qu&iacute;micos.</p>', NULL, 0, 7, 126, 1, 0),
(2856, 'FA067', 'Fertilidade do Solo e Aduba√ß√£o', 2, 'G', 6, 0, '<p style=\"text-align: justify;\">Fertilidade de solos no Brasil. Princ&iacute;pios e conceitos de fertilidade do solo. Avalia&ccedil;&atilde;o da fertilidade do solo. Amostragem do solo para fins de recomenda&ccedil;&atilde;o de aduba&ccedil;&atilde;o e calagem. An&aacute;lises de solos e sua interpreta&ccedil;&atilde;o. Acidez e calagem. Macro e micronutrientes. Mat&eacute;ria org&acirc;nica. Recomenda&ccedil;&otilde;es de aduba&ccedil;&atilde;o e calagem. Aduba&ccedil;&atilde;o foliar.</p>', NULL, 0, 7, 441, 17, 2);
INSERT INTO `gde_disciplinas` (`id_disciplina`, `sigla`, `nome`, `creditos`, `nivel`, `periodicidade`, `parte`, `ementa`, `bibliografia`, `quinzenal`, `id_instituto`, `cursacoes`, `reprovacoes`, `max_reprovacoes`) VALUES
(2862, 'FA074', 'Tecnologia em Agricultura de Precis√£o', 2, 'G', 6, 0, '<p style=\"text-align:justify\">O conceito da agricultura de precis&atilde;o. Estado da arte das tecnologias em agricultura de precis&atilde;o. Monitoramento da produtividade das culturas e da variabilidade espacial de atributos de solo e planta. Sistemas de posicionamento global por sat&eacute;lites e sistemas de direcionamento de m&aacute;quinas agr&iacute;colas. Aplica&ccedil;&atilde;o localizada de insumos em taxas vari&aacute;veis e tomada de decis&otilde;es gerenciais.</p>', NULL, 0, 7, 182, 3, 1),
(2870, 'FA270', 'Metodologia Cient√≠fica e do Projeto', 2, 'G', 2, 0, '<p style=\"text-align: justify;\">O conhecimento, ci&ecirc;ncia e senso comum. O M&eacute;todo Cient&iacute;fico. A pesquisa cient&iacute;fica; problematiza&ccedil;&atilde;o; elabora&ccedil;&atilde;o de hip&oacute;teses; verifica&ccedil;&atilde;o. Metodologia do trabalho cient&iacute;fico. Metodologia de Projeto. Exemplo do desenvolvimento de um projeto de engenharia agr&iacute;cola. Efici&ecirc;ncias nas etapas do projeto. Fases e desenvolvimento do projeto.</p>', NULL, 0, 7, 497, 10, 1),
(2873, 'FA273', 'Desenho Civil Assistido por Computador', 2, 'G', 2, 0, '<p style=\"text-align: justify;\">Simbologia b&aacute;sica e normas t&eacute;cnicas para a elabora&ccedil;&atilde;o dos projetos de constru&ccedil;&atilde;o civil. Planta baixa, cortes, fachada, cobertura e implanta&ccedil;&atilde;o. Elementos arquitet&ocirc;nicos. Detalhamento das instala&ccedil;&otilde;es hidrossanit&aacute;ria e el&eacute;trica. Introdu&ccedil;&atilde;o ao projeto estrutural. Maquete eletr&ocirc;nica.</p>', NULL, 0, 7, 509, 17, 2),
(2874, 'FA370', 'Mec√¢nica dos Fluidos para Engenharia', 3, 'G', 1, 0, '<p style=\"text-align: justify;\">Introdu&ccedil;&atilde;o as principais propriedades f&iacute;sicas dos fluidos. Esfor&ccedil;os nos fluidos. Fluidost&aacute;tica. Equil&iacute;brio relativo. Manometria. Cinem&aacute;tica dos fluidos. Viscosidade. Equa&ccedil;&atilde;o da quantidade de movimento. Teorema de Bernoulli (conserva&ccedil;&atilde;o de energia). An&aacute;lise dimensional e semelhan&ccedil;a.</p>', NULL, 0, 7, 451, 65, 2),
(2877, 'FA373', 'Pedologia', 3, 'G', 1, 0, '<p style=\"text-align: justify;\">Caracteriza&ccedil;&atilde;o da crosta terrestre. Fundamentos de mineralogia, principais minerais e rochas. Intemperismo. O solo como recurso natural. Fatores e processos de forma&ccedil;&atilde;o do solo. O perfil de solo. Defini&ccedil;&atilde;o e nota&ccedil;&atilde;o de horizontes e camadas. Principais atributos morfol&oacute;gicos. Introdu&ccedil;&atilde;o &agrave; classifica&ccedil;&atilde;o de solos. Evolu&ccedil;&atilde;o da classifica&ccedil;&atilde;o de solos no Brasil. O sistema brasileiro de classifica&ccedil;&atilde;o de solos. Solos do Brasil e do Estado de S&atilde;o Paulo. Levantamento de solos. Bases para leitura de mapas de solos. Aplica&ccedil;&otilde;es da Pedagogia em Engenharia Agr&iacute;cola.</p>', NULL, 0, 7, 618, 33, 2),
(2878, 'FA374', 'C√°lculo Num√©rico', 4, 'G', 1, 0, '<p style=\"text-align: justify;\">Aritm&eacute;tica do ponto flutuante. Zeros de fun&ccedil;&otilde;es reais. Interpola&ccedil;&atilde;o: Integra&ccedil;&atilde;o num&eacute;rica. Resolu&ccedil;&atilde;o de sistemas: lineares, n&atilde;o lineares e com restri&ccedil;&otilde;es. Ajuste de dados e curvas, tratamento num&eacute;rico de equa&ccedil;&otilde;es diferenciais.</p>', NULL, 0, 7, 247, 6, 2),
(2879, 'FA379', 'Introdu√ß√£o √† Termodin√¢mica', 2, 'G', 1, 0, '<p style=\"text-align: justify;\">Hist&oacute;ria da termodin&acirc;mica. Energia e a engenharia agr&iacute;cola. Conceitos b&aacute;sicos. Propriedades de subst&acirc;ncias puras. Tabelas de vapor. Equa&ccedil;&otilde;es do estado. Trabalho e calor. Primeira Lei. Balan&ccedil;os de energia, efici&ecirc;ncias de Primeira Lei. Segunda Lei. Conceitos de exergia e irreversibilidade.</p>', NULL, 0, 7, 488, 111, 2),
(2880, 'FA425', 'Instrumenta√ß√£o B√°sica', 4, 'G', 2, 0, '<p style=\"text-align: justify;\">Conceitos b&aacute;sicos de instrumenta&ccedil;&atilde;o. Simbologia. Caracter&iacute;sticas est&aacute;ticas de instrumentos. Calibra&ccedil;&atilde;o. Sensores. Condicionamento e aquisi&ccedil;&atilde;o de sinais. V&aacute;lvulas e atuadores.</p>', NULL, 0, 7, 256, 1, 1),
(2884, 'FA473', 'Sistemas de Produ√ß√£o', 5, 'G', 2, 0, '<p style=\"text-align: justify;\">Roteiros e equipamentos para a produ&ccedil;&atilde;o vegetal. Sistemas de cultivo de vegetais. Equipamentos e instala&ccedil;&otilde;es para produ&ccedil;&atilde;o animal. Sistemas de produ&ccedil;&atilde;o animal.</p>', NULL, 0, 7, 532, 9, 1),
(2888, 'FA479', 'Termodin√¢mica Aplicada', 2, 'G', 2, 0, '<p>Introdu&ccedil;&atilde;o aos ciclos de pot&ecirc;ncia. Introdu&ccedil;&atilde;o aos ciclos de refrigera&ccedil;&atilde;o. Bombas de calor. Misturas gasosas. Psicrometria. Combust&iacute;veis e rea&ccedil;&otilde;es qu&iacute;micas.</p>', NULL, 0, 7, 339, 36, 1),
(2889, 'FA481', 'Caracter√≠sticas e Propriedades do Solo', 4, 'G', 2, 0, '<p style=\"text-align: justify;\">O solo como um sistema s&oacute;lido, poroso, heterog&ecirc;neo e anisotr&oacute;pico. Composi&ccedil;&atilde;o volum&eacute;trica do solo. Caracteriza&ccedil;&atilde;o e m&eacute;todos de determina&ccedil;&atilde;o de atributos f&iacute;sicos, qu&iacute;micos e biol&oacute;gicos do solo. Granulometria e textura do solo. Estrutura e agrega&ccedil;&atilde;o do solo. Cor do solo. Porosidade do solo. Ar do solo. Regime t&eacute;rmico do solo. Densidade do solo e das part&iacute;culas. Consist&ecirc;ncia do solo. &Aacute;gua do solo. Atributos qu&iacute;micos e de fertilidade do solo. Mat&eacute;ria org&acirc;nica do solo. Organismos do solo.</p>', NULL, 0, 7, 515, 20, 2),
(2890, 'FA503', 'Meteorologia Agr√≠cola', 2, 'G', 1, 0, '<p style=\"text-align: justify;\">Meteorologia, climatologia, atmosfera terrestre, radia&ccedil;&atilde;o solar, ciclo hidrol&oacute;gico, fotoss&iacute;ntese, posto meteorol&oacute;gico, zoneamento agr&iacute;cola, planejamento das atividades agr&iacute;colas.</p>', NULL, 0, 7, 223, 0, 1),
(2899, 'FA576', 'Propriedades Mec√¢nicas de Materiais Biol√≥gicos', 2, 'G', 1, 0, '<p style=\"text-align:justify\">Propriedades mec&acirc;nicas de produtos agr&iacute;colas. Rela&ccedil;&otilde;es tens&atilde;o-deforma&ccedil;&atilde;o. Lei de Hooke generalizada. Elasticidade e Viscoelasticidade linear. Teorias de ruptura. &Iacute;ndices de firmeza. Variabilidade de medidas em produtos agr&iacute;colas. Efeitos da vibra&ccedil;&atilde;o.</p>', NULL, 0, 7, 236, 5, 1),
(2903, 'FA622', 'Sistema Solo-Planta-Atmosfera', 2, 'G', 2, 0, '<p style=\"text-align: justify;\">Rela&ccedil;&atilde;o solo-planta-atmosfera. Din&acirc;mica na atmosfera. Radia&ccedil;&atilde;o solar. Efeito da temperatura no desenvolvimento dos vegetais. &Aacute;gua no sistema vegetal. Balan&ccedil;o de energia, evapora&ccedil;&atilde;o e transpira&ccedil;&atilde;o vegetal. Mecanismo de controle de perda de &aacute;gua nos vegetais: controle estom&aacute;tico. Movimenta&ccedil;&atilde;o da &aacute;gua no solo. Absor&ccedil;&atilde;o da &aacute;gua pelas ra&iacute;zes. Evolu&ccedil;&atilde;o dos mecanismos da toler&acirc;ncia das esp&eacute;cies vegetais &agrave; satura&ccedil;&atilde;o h&iacute;drica e ao d&eacute;ficit h&iacute;drico no solo. Balan&ccedil;o h&iacute;drico. Balan&ccedil;o hidrol&oacute;gico. Modelagem e espacializa&ccedil;&atilde;o das rela&ccedil;&otilde;es solo-planta-atmosfera.</p>', NULL, 0, 7, 206, 5, 0),
(2904, 'FA665', 'Geotecnologias I', 3, 'G', 2, 0, '<p>Introdu&ccedil;&atilde;o ao geoprocessamento. Cartografia b&aacute;sica. Fotogrametria e fotointerpreta&ccedil;&atilde;o. Sensoriamento remoto. Sistemas de informa&ccedil;&otilde;es geogr&aacute;ficas.</p>', NULL, 0, 7, 296, 26, 0),
(2905, 'FA670', 'Elementos de M√°quinas', 2, 'G', 2, 0, '<p>Resist&ecirc;ncia dos materiais &agrave; fadiga. Eixos e &aacute;rvores. Chavetas. Elementos de uni&atilde;o. Molas. Toler&acirc;ncia e Ajustes.</p>', NULL, 0, 7, 233, 2, 0),
(2913, 'FA680', 'Rela√ß√£o Trator-Implemento', 2, 'G', 2, 0, '<p style=\"text-align: justify;\">Princ&iacute;pios de distribui&ccedil;&atilde;o de tens&otilde;es no solo. Determina&ccedil;&atilde;o da rea&ccedil;&atilde;o do solo devido a a&ccedil;&atilde;o de implementos de preparo. Sistemas de preparo do solo: plantio convencional, plantio reduzido, plantio ou semeadura direta. For&ccedil;as atuantes em implementos agr&iacute;colas. Acoplamento do implemento ao trator. Mec&acirc;nica da rela&ccedil;&atilde;o ve&iacute;culo-solo. Compacta&ccedil;&atilde;o de solos sob a a&ccedil;&atilde;o de m&aacute;quinas e implementos agr&iacute;colas, causas e efeitos. Desempenho de pneus e rodas, resist&ecirc;ncia ao rolamento, capacidade de carga de um solo, patinagem, desempenho conjunto trator-implemento.</p>', NULL, 0, 7, 211, 23, 0),
(2914, 'FA682', 'Modelagem Estrutural Aplicada', 2, 'G', 2, 0, '<p>Princ&iacute;pios do projeto estrutural. T&oacute;picos de elasticidade aplicada. M&eacute;todos dos deslocamentos. Introdu&ccedil;&atilde;o ao m&eacute;todo dos elementos finitos. Utiliza&ccedil;&atilde;o de programas computacionais. Simula&ccedil;&atilde;o do comportamento estrutural de m&aacute;quinas e estruturas agr&iacute;colas.</p>', NULL, 0, 7, 427, 27, 2),
(2915, 'FA720', 'Fundamentos de Economia', 2, 'G', 1, 0, '<p style=\"text-align: justify;\">Introdu&ccedil;&atilde;o &agrave; macroeconomia (medidas da atividade econ&ocirc;mica: produto, renda, consumo, poupan&ccedil;a, investimento, exporta&ccedil;&otilde;es e importa&ccedil;&otilde;es). Popula&ccedil;&atilde;o, emprego e renda: mercado de trabalho, desigualdades sociais e econ&ocirc;micas. Import&acirc;ncia e papel da agricultura no desenvolvimento econ&ocirc;mico e social. Mercados e transa&ccedil;&otilde;es. Economia informal.</p>', NULL, 0, 7, 305, 11, 0),
(2916, 'FA721', 'Engenharia Econ√¥mica', 2, 'G', 1, 0, '<p>Matem&aacute;tica financeira. Custos. An&aacute;lise de investimentos. No&ccedil;&otilde;es de Contabilidade.</p>', NULL, 0, 7, 193, 4, 0),
(2917, 'FA733', 'Fundamentos de Microbiologia e Qualidade de √Ågua', 2, 'G', 1, 0, '<p style=\"text-align:justify\">Conceitua&ccedil;&atilde;o b&aacute;sica sobre microbiologia aplicada &agrave; p&oacute;s-colheita de produtos agr&iacute;colas e ao saneamento ambiental. Conhecimentos de fundamentos de hidrobiologia. Conhecimentos fundamentais de qu&iacute;mica da &aacute;gua.</p>', NULL, 0, 7, 306, 4, 0),
(2926, 'FA778', 'Constru√ß√µes Rurais para a Produ√ß√£o Animal', 2, 'G', 1, 0, '<p style=\"text-align: justify;\">Instala&ccedil;&otilde;es e equipamentos para a produ&ccedil;&atilde;o animal: aves, su&iacute;nos, bovinos de leite e corte, ovinos e caprinos, equinos, coelhos e outras instala&ccedil;&otilde;es.</p>', NULL, 0, 7, 268, 0, 0),
(2927, 'FA779', 'Tecnologia de Resfriamento para Produtos Hort√≠colas', 2, 'G', 1, 0, '<p style=\"text-align:justify\">A refrigera&ccedil;&atilde;o e a conserva&ccedil;&atilde;o de produtos hort&iacute;colas. A Cadeia do Frio. Sistemas de refrigera&ccedil;&atilde;o e elementos que o comp&otilde;em. C&aacute;lculo de carga t&eacute;rmica em c&acirc;maras refrigeradas. C&acirc;maras de armazenamento. Dimensionamento de c&acirc;maras. Sele&ccedil;&atilde;o de equipamentos e acess&oacute;rios. Sistemas de resfriamento r&aacute;pido com ar for&ccedil;ado e com &aacute;gua. Dimensionamento. Transporte frigor&iacute;fico de frutas e hortali&ccedil;as. Tempo de resfriamento, determina&ccedil;&atilde;o te&oacute;rica e experimental. Custos de resfriamento. Sele&ccedil;&atilde;o de sistemas. Viabilidade econ&ocirc;mica.</p>', NULL, 0, 7, 176, 0, 0),
(2928, 'FA780', 'Instala√ß√µes El√©tricas para Sistemas Agroindustriais', 4, 'G', 1, 0, '<p style=\"text-align:justify\">No&ccedil;&otilde;es b&aacute;sicas sobre gera&ccedil;&atilde;o, transmiss&atilde;o e distribui&ccedil;&atilde;o de energia el&eacute;trica. Linhas de distribui&ccedil;&atilde;o e ramais rurais. Instala&ccedil;&otilde;es el&eacute;tricas em baixa tens&atilde;o. Sinaliza&ccedil;&atilde;o, comando e prote&ccedil;&atilde;o de circuitos el&eacute;tricos em baixa tens&atilde;o. Instrumentos de medidas el&eacute;tricas. Sistemas de medi&ccedil;&atilde;o e modalidades tarif&aacute;rias de energia el&eacute;trica.</p>', NULL, 0, 7, 245, 27, 0),
(2930, 'FA786', 'Hidrologia Ci√™ncia e Aplica√ß√£o', 2, 'G', 1, 0, '<p>Precipita&ccedil;&atilde;o, infiltra&ccedil;&atilde;o e evapotranspira&ccedil;&atilde;o em bacias hidrogr&aacute;ficas.</p>', NULL, 0, 7, 151, 0, 0),
(2941, 'FA879', 'Tecnologia de Processos P√≥s-Colheita II', 4, 'G', 2, 0, '<p style=\"text-align:justify\">Altera&ccedil;&atilde;o da qualidade na secagem. Psicrometria aplicada &agrave; secagem. Teoria de movimenta&ccedil;&atilde;o de ar. Princ&iacute;pios de secagem. Modelos de secagem em leito fixo. Cin&eacute;tica de secagem. Modelo diferencial. Sistemas de Secagem e Secadores. Simula&ccedil;&atilde;o de secagem. Pr&aacute;tica de secagem de gr&atilde;os. Instala&ccedil;&otilde;es e custos de secagem.</p>', NULL, 0, 7, 182, 26, 0),
(2954, 'FM003', 'Semin√°rios sobre a Profiss√£o', 2, 'G', 1, 0, '<p>Palestras sobre temas de ci&ecirc;ncias f&iacute;sicas e matem&aacute;ticas e de suas interfaces com outras ci&ecirc;ncias, visando o direcionamento da forma&ccedil;&atilde;o acad&ecirc;mica dos alunos ingressantes.</p>', '', 0, 20, 2108, 27, 2),
(3272, 'GM861', 'Mineralogia (Qu√≠mica)', 4, 'G', 1, 0, '<p>Geoqu&iacute;mica de crosta terrestre; revis&atilde;o de cristaloqu&iacute;mica, sistemas cristalinos e simetria; tipos de estruturas cristalinas, c&aacute;lculo de s&iacute;tios de ocupa&ccedil;&atilde;o; propriedades e identifica&ccedil;&atilde;o macrosc&oacute;pica de minerais; identifica&ccedil;&atilde;o de minerais por difratometria de raio-X; processos de forma&ccedil;&atilde;o de rochas e f&iacute;sico-qu&iacute;mica da cristaliza&ccedil;&atilde;o magm&aacute;tica; identifica&ccedil;&atilde;o macrosc&oacute;pica das rochas; usos dos minerais na ind&uacute;stria; din&acirc;mica do planeta: interior da terra e tect&ocirc;nica de placas.</p>', NULL, 0, 21, 957, 12, 2),
(3294, 'GT001', 'Ci√™ncia, Tecnologia e Sociedade', 3, 'G', 5, 0, '<p>A disciplina visa contribuir para a forma&ccedil;&atilde;o b&aacute;sica dos alunos de gradua&ccedil;&atilde;o dos v&aacute;rios cursos da Unicamp, atrav&eacute;s da an&aacute;lise das implica&ccedil;&otilde;es sociais e pol&iacute;ticas do desenvolvimento tecnol&oacute;gico nas sociedades contempor&acirc;neas, bem como seus determinantes econ&ocirc;micos gerais, com &ecirc;nfase nas especificidades estruturais do Brasil.</p>', NULL, 0, 21, 2699, 141, 3),
(3376, 'HG843', 'T√≥picos Especiais de Hist√≥ria da Filosofia Contempor√¢nea V', 6, 'G', 6, 0, '<p>O curso se prop&otilde;e a desenvolver t&oacute;picos em hist&oacute;ria da filosofia contempor&acirc;nea, a partir de textos pertinentes, de acordo com as pesquisas em andamento no departamento de Filosofia.</p>', NULL, 0, 19, 121, 0, 1),
(3681, 'HZ104', 'Est√°gio Supervisionado em Ci√™ncias Sociais II', 8, 'G', 2, 0, '<p>A disciplina tem por objetivo desenvolver habilidades no ensino de Ci&ecirc;ncias Sociais, atrav&eacute;s da pr&aacute;tica de atividades de ensino, tanto no sistema oficial de ensino como em espa&ccedil;os n&atilde;o formais, quando autorizados pela Comiss&atilde;o de Gradua&ccedil;&atilde;o em Ci&ecirc;ncias Sociais, e da reflex&atilde;o sobre essas experi&ecirc;ncias, sob orienta&ccedil;&atilde;o de docente respons&aacute;vel pela disciplina.</p>', NULL, 0, 19, 357, 7, 1),
(3682, 'HZ140', 'Partidos Pol√≠ticos', 4, 'G', 2, 0, '<p>Esse curso percorre, na sua primeira parte, os tr&ecirc;s mais importantes enfoques te&oacute;ricos sobre partidos pol&iacute;ticos - o marxista, o organizacional e institucional. Na segunda parte, trata de sistemas partid&aacute;rios, dando enfoque ao funcionamento dos partidos em sistemas competitivos e n&atilde;o competitivos.</p>', NULL, 0, 19, 189, 4, 1),
(3694, 'HZ155', 'T√≥picos Especiais em Sociologia XI', 4, 'G', 6, 0, '<p>Esta disciplina ter&aacute; seu programa definido em fun&ccedil;&atilde;o do andamento das pesquisas que est&atilde;o sendo realizadas no departamento de Sociologia.</p>', NULL, 0, 19, 152, 1, 1),
(3695, 'HZ156', 'T√≥picos Especiais em Sociologia XII', 4, 'G', 6, 0, '<p>Esta disciplina ter&aacute; seu programa definido em fun&ccedil;&atilde;o do andamento das pesquisas que est&atilde;o sendo realizadas no departamento de Sociologia.</p>', NULL, 0, 19, 106, 1, 1),
(3717, 'HZ254', 'T√≥picos Especiais em Sociologia II', 4, 'G', 6, 0, '<p>Este curso ter&aacute; seu programa definido em fun&ccedil;&atilde;o do andamento das pesquisas que est&atilde;o sendo realizadas no Departamento de Sociologia.</p>', NULL, 0, 19, 158, 0, 1),
(3730, 'HZ291', 'T√≥picos Especiais de Humanidades I', 2, 'G', 1, 0, 'O curso √© dedicado a uma introdu√ß√£o das rela√ß√µes entre ci√™ncia, tecnologia e a sociedade contempor√¢nea. Ser√° dada √™nfase especial ao caso brasileiro, tentando mostrar como se concretizam essas rela√ß√µes num contexto espec√≠fico. A abordagem ser√° interdisciplinar, atrav√©s de uma contribui√ß√£o da Antropologia, da Ci√™ncia Pol√≠tica, da Hist√≥ria e da Sociologia. <br />Obs.: Sendo uma disciplina reservada aos cursos de Engenharia, nos quais consta como eletiva em seus curr√≠culos, os alunos de Humanidades, Artes e do Curso de Filosofia n√£o poder√£o cursar esta disciplina.', NULL, 0, 19, 2514, 45, 2),
(3752, 'HZ447', 'Pol√≠tica IV - Tradi√ß√µes do Pensamento Pol√≠tico', 5, 'G', 2, 0, '<p>A disciplina trata de quatro tradi&ccedil;&otilde;es do pensamento pol&iacute;tico moderno e contempor&acirc;neo: o absolutismo mon&aacute;rquico, o liberalismo, o republicanismo e o socialismo. A disciplina visa propiciar tanto a forma&ccedil;&atilde;o nos autores fundamentais do pensamento pol&iacute;tico moderno, quanto a introdu&ccedil;&atilde;o aos debates atuais em teoria pol&iacute;tica, possibilitando aos estudantes uma inicia&ccedil;&atilde;o &agrave; pesquisa nessa &aacute;rea.</p>', NULL, 0, 19, 346, 17, 1),
(3756, 'HZ456', ' Estrutura e Estratifica√ß√£o Social', 6, 'G', NULL, 0, 'An√°lise das teorias de estratifica√ß√£o e estrutura social. Discuss√£o das diferentes conceitua√ß√µes de classe, estamento e castas sociais, mobilidade e conflito na sociedade industrial moderna. O problema de ¬ì classe m√©dia¬î.', NULL, 0, 19, 399, 5, 2),
(3769, 'HZ546', 'Pol√≠tica V - Teoria e Pesquisa em Ci√™ncia Pol√≠tica', 6, 'G', 1, 0, '<p>Este curso tem como supostos os desdobramentos da rela&ccedil;&atilde;o entre teoria e pesquisa, a afirma&ccedil;&atilde;o de que teoria e empiria n&atilde;o s&atilde;o dissociadas, e a id&eacute;ia de que a escolha te&oacute;rica est&aacute; associada &agrave; escolha de m&eacute;todos para compreens&atilde;o do objetivo de estudo selecionado. Apresenta&ccedil;&atilde;o de abordagens da Ci&ecirc;ncia Pol&iacute;tica, por exemplo: correntes do institucionalismo, escolha racional, marxismo, pluralismo, cultura pol&iacute;tica, etc. Apresenta&ccedil;&atilde;o de m&eacute;todos associados &agrave; pesquisa qualitativa e quantitativa, coleta de dados, processamento e an&aacute;lise.</p>', NULL, 0, 19, 214, 12, 0),
(3771, 'HZ555', 'Pensamento Social do Brasil', 5, 'G', 1, 0, '<p>O curso tratar&aacute; da contribui&ccedil;&atilde;o dos autores de diferentes correntes de pensamento no Brasil. Ser&atilde;o examinados os processos de sistematiza&ccedil;&atilde;o e institucionaliza&ccedil;&atilde;o da Sociologia no Brasil, Ci&ecirc;ncias Sociais e Desenvolvimento, Ci&ecirc;ncias Sociais e Depend&ecirc;ncia. Ser&atilde;o analisados v&aacute;rios processos: anos 30 (enfrentamentos te&oacute;ricos resultantes da nova configura&ccedil;&atilde;o pol&iacute;tica, social, econ&ocirc;mica); anos 60 (debates sobre desenvolvimento e o papel do ISEB; a escola paulista e a articula&ccedil;&atilde;o das teses sobre cidadania / industrializa&ccedil;&atilde;o /depend&ecirc;ncia).</p>', NULL, 0, 19, 721, 17, 2),
(3792, 'HZ657', 'Sociologia Contempor√¢nea I', 5, 'G', 2, 0, '<p>Trata-se de um primeiro momento do curso em que se pretende passar ao aluno o conhecimento: a) da continuidade dos temas cl&aacute;ssicos na obra dos autores contempor&acirc;neos; b) de temas novos, que emergem no debate atual.</p>', NULL, 0, 19, 672, 13, 3),
(3885, 'LA111', 'Japon√™s I', 4, 'G', 6, 0, '<p>Uso da l&iacute;ngua japonesa em situa&ccedil;&otilde;es espec&iacute;ficas do cotidiano: cumprimentar; informa&ccedil;&atilde;o sobre datas, hor&aacute;rios, pre&ccedil;os e dados pessoais; descrever objetos e locais; relatar atividades rotineiras.</p>', NULL, 0, 1, 468, 1, 2),
(3886, 'LA112', 'Ingl√™s I', 4, 'G', 5, 0, '<p>Introdu&ccedil;&atilde;o &agrave;s habilidades de compreens&atilde;o e produ&ccedil;&atilde;o de textos orais, escritos e multimodais em ingl&ecirc;s, voltando-se a a&ccedil;&otilde;es do cotidiano, vinculadas principalmente aos prop&oacute;sitos comunicativos de descri&ccedil;&atilde;o, apresenta&ccedil;&atilde;o pessoal, express&atilde;o de opini&atilde;o e relato de h&aacute;bitos e experi&ecirc;ncias rotineiras no presente, visando a aprimorar a forma&ccedil;&atilde;o acad&ecirc;mica/profissional do aluno e a promover reflex&atilde;o sobre o funcionamento da l&iacute;ngua inglesa, sensibilizando para aspectos culturais pertinentes.</p>', NULL, 0, 1, 825, 6, 1),
(3888, 'LA114', 'Alem√£o I', 4, 'G', 5, 0, '<p>Introdu&ccedil;&atilde;o ao alem&atilde;o como l&iacute;ngua estrangeira (n&iacute;vel A1.1 no Quadro Comum Europeu, dispon&iacute;vel no s&iacute;tio eletr&ocirc;nico do CEL). Compreens&atilde;o e express&atilde;o oral/escrita, &ecirc;nfase na compreens&atilde;o. Fomento da autonomia e consci&ecirc;ncia lingu&iacute;stica. Estruturas fundamentais da l&iacute;ngua e textos altamente convencionalizados. Uso integrado de tecnologias digitais, inclusive na avalia&ccedil;&atilde;o. Trabalho aut&ocirc;nomo, individual e/ou em grupo, via ambiente virtual.</p>', NULL, 0, 1, 1078, 12, 2),
(3892, 'LA118', 'Italiano I', 4, 'G', 5, 0, '<p>Produ&ccedil;&atilde;o de diversos g&ecirc;neros discursivos orais e escritos da l&iacute;ngua italiana prioritariamente na esfera do cotidiano, com destaque para f&oacute;rum de discuss&atilde;o, blog, e-mail. Express&otilde;es de uso frequente em &acirc;mbitos fundamentais da vida cotidiana em uma universidade italiana t&iacute;pica. Panorama da hist&oacute;ria da l&iacute;ngua italiana.</p>', NULL, 0, 1, 907, 3, 1),
(3893, 'LA119', 'Espanhol I', 4, 'G', 5, 0, '<p>Desenvolvimento da compet&ecirc;ncia comunicativa em espanhol em n&iacute;vel de usu&aacute;rio b&aacute;sico I, correspondente ao n&iacute;vel A1 do Marco Comum Europeu de Refer&ecirc;ncia.</p>', NULL, 0, 1, 922, 2, 1),
(3895, 'LA122', 'Ingl√™s Instrumental I', 4, 'G', 5, 0, '<p>Leitura de textos em ingl&ecirc;s, visando ao desenvolvimento de estrat&eacute;gias globais de leitura e de an&aacute;lise lingu&iacute;stica, tendo como base g&ecirc;neros textuais da esfera acad&ecirc;mica, jornal&iacute;stica e de divulga&ccedil;&atilde;o cient&iacute;fica, visando a aprimorar a forma&ccedil;&atilde;o acad&ecirc;mica/profissional do aluno e a promover seu pensamento cr&iacute;tico a partir das realidades s&oacute;cio-culturais expressas nos textos.</p>', NULL, 0, 1, 1510, 36, 2),
(3906, 'LA211', 'Japon√™s II', 4, 'G', 6, 0, '<p>Uso da l&iacute;ngua em situa&ccedil;&otilde;es espec&iacute;ficas do cotidiano: narrar fatos e experi&ecirc;ncias, descrever qualidades de pessoas e objetos, pedir e oferecer ajuda, convidar algu&eacute;m/recusar um convite.</p>', NULL, 0, 1, 427, 1, 1),
(3907, 'LA212', 'Ingl√™s II', 4, 'G', 5, 0, '<p>Desenvolvimento de habilidades de compreens&atilde;o e produ&ccedil;&atilde;o de textos orais, escritos e multimodais em ingl&ecirc;s, voltando-se a pr&aacute;ticas do cotidiano, vinculadas principalmente aos prop&oacute;sitos comunicativos de descri&ccedil;&atilde;o de lugares e objetos, relatos de experi&ecirc;ncia no passado e de a&ccedil;&otilde;es em progresso no presente, compara&ccedil;&atilde;o, previs&atilde;o e planejamento de atos futuros, instru&ccedil;&atilde;o e relato de h&aacute;bitos e experi&ecirc;ncias ligadas ao campo do entretenimento e da literatura, visando a aprimorar a forma&ccedil;&atilde;o acad&ecirc;mica/profissional do aluno e a promover reflex&atilde;o sobre o funcionamento da l&iacute;ngua inglesa, sensibilizando para aspectos culturais pertinentes.</p>', NULL, 0, 1, 956, 11, 2),
(3908, 'LA213', 'Franc√™s II', 4, 'G', 5, 0, '<p>Ensino de franc&ecirc;s como l&iacute;ngua estrangeira em n&iacute;vel A1 do Quadro Comum Europeu de Refer&ecirc;ncia para L&iacute;nguas (dispon&iacute;vel no sitio do CEL), considerando-se a oralidade e a escrita, com &ecirc;nfase na compreens&atilde;o. Sensibiliza&ccedil;&atilde;o &agrave; consci&ecirc;ncia lingu&iacute;stico-discursiva enfocando-se elementos de interculturalidade e pr&aacute;ticas de l&iacute;ngua francesa em contextos variados. Inicia&ccedil;&atilde;o aos recursos expressivos da l&iacute;ngua atrav&eacute;s da utiliza&ccedil;&atilde;o de textos orais e escritos com predomin&acirc;ncia informativa e introdu&ccedil;&atilde;o &agrave; narrativa.</p>', NULL, 0, 1, 1547, 55, 4),
(3909, 'LA214', 'Alem√£o II', 4, 'G', 5, 0, '<p>Alem&atilde;o como l&iacute;ngua estrangeira, n&iacute;vel b&aacute;sico (A1.2 no Quadro Comum Europeu, dispon&iacute;vel no s&iacute;tio eletr&ocirc;nico do CEL). Compreens&atilde;o e express&atilde;o oral/escrita, &ecirc;nfase na compreens&atilde;o. Fomento da autonomia e consci&ecirc;ncia lingu&iacute;stica. Estruturas b&aacute;sicas da l&iacute;ngua e textos simples. Uso integrado de tecnologias digitais, inclusive na avalia&ccedil;&atilde;o. Trabalho aut&ocirc;nomo, individual e/ou em grupo, via ambiente virtual.</p>', NULL, 0, 1, 795, 13, 3),
(3913, 'LA218', 'Italiano II', 4, 'G', 5, 0, '<p>Produ&ccedil;&atilde;o de diversos g&ecirc;neros discursivos orais e escritos da l&iacute;ngua italiana prioritariamente na esfera do cotidiano (com destaque para g&ecirc;neros como blog, e-mail, carta pessoal e di&aacute;rio). Fun&ccedil;&otilde;es comunicativas b&aacute;sicas tais como perguntar sobre ou narrar eventos ocorridos no passado ou que ocorrer&atilde;o no futuro, falar sobre planos e comparar pessoas, locais e objetos.</p>', NULL, 0, 1, 542, 5, 2),
(3914, 'LA219', 'Espanhol II', 4, 'G', 5, 0, '<p>Desenvolvimento concomitante da compreens&atilde;o e express&atilde;o discursiva oral e escrita em espanhol como l&iacute;ngua estrangeira no n&iacute;vel lingu&iacute;stico usu&aacute;rio elementar 2. N&iacute;vel de aprendizagem compat&iacute;vel ao A2 do Marco Comum Europeu de Refer&ecirc;ncia para as l&iacute;nguas. Uso de estruturas da l&iacute;ngua espanhola e tipologias textuais de complexidade regular. Compreens&atilde;o de express&otilde;es frequentes relacionadas com &aacute;reas de prioridade imediata. Troca de informa&ccedil;&atilde;o simples e direta sobre assuntos de &acirc;mbito familiar e de rotina quotidiana. Descri&ccedil;&atilde;o simples do campo de forma&ccedil;&atilde;o acad&ecirc;mica e do meio circundante e refer&ecirc;ncia a assuntos relacionados com necessidades imediatas.</p>', NULL, 0, 1, 678, 9, 2),
(3926, 'LA311', 'Japon√™s III', 4, 'G', 6, 0, '<p>Uso da l&iacute;ngua em situa&ccedil;&otilde;es espec&iacute;ficas do cotidiano: narrar atividades rotineiras; expressar o aspecto progressivo; dar instru&ccedil;&otilde;es; pedir/dar/negar permiss&atilde;o; proibir, expressar obriga&ccedil;&atilde;o e voli&ccedil;&atilde;o; falar sobre prefer&ecirc;ncias e habilidades.</p>', NULL, 0, 1, 375, 2, 1),
(3927, 'LA312', 'Ingl√™s III', 4, 'G', 5, 0, '<p>Expans&atilde;o das habilidades de compreens&atilde;o e produ&ccedil;&atilde;o de textos orais, escritos e multimodais em ingl&ecirc;s, voltando-se a pr&aacute;ticas do cotidiano e a situa&ccedil;&otilde;es mais formais, vinculadas principalmente aos prop&oacute;sitos comunicativos relacionados &agrave; descri&ccedil;&atilde;o de pessoas, objetos e lugares, relatos de experi&ecirc;ncias no passado e de planos futuros, promessas, compara&ccedil;&otilde;es e informa&ccedil;&otilde;es sobre habilidades e decis&otilde;es n&atilde;o planejadas, visando a aprimorar a forma&ccedil;&atilde;o acad&ecirc;mica/profissional do aluno e a promover reflex&atilde;o sobre o funcionamento da l&iacute;ngua inglesa, sensibilizando para aspectos culturais pertinentes.</p>', NULL, 0, 1, 1047, 9, 2),
(3928, 'LA313', 'Franc√™s III', 4, 'G', 5, 0, '<p>Ensino de franc&ecirc;s como l&iacute;ngua estrangeira em n&iacute;vel A2 do Quadro Comum Europeu de Refer&ecirc;ncia para L&iacute;nguas (dispon&iacute;vel no sitio eletr&ocirc;nico do CEL), considerando-se a oralidade e a escrita, com &ecirc;nfase na compreens&atilde;o. Desenvolvimento da consci&ecirc;ncia lingu&iacute;stico-discursiva enfocando-se elementos de interculturalidade e pr&aacute;ticas de l&iacute;ngua francesa em contexto universit&aacute;rio. Uso de recursos expressivos da l&iacute;ngua atrav&eacute;s de textos orais e escritos com predomin&acirc;ncia informativa, narrativa e inicia&ccedil;&atilde;o &agrave; argumenta&ccedil;&atilde;o.</p>', NULL, 0, 1, 1041, 7, 2),
(3929, 'LA314', 'Alem√£o III', 4, 'G', 5, 0, '<p>Alem&atilde;o como l&iacute;ngua estrangeira, n&iacute;vel b&aacute;sico (A2.1 no Quadro Comum Europeu, dispon&iacute;vel no s&iacute;tio eletr&ocirc;nico do CEL). Compreens&atilde;o e express&atilde;o oral/escrita, &ecirc;nfase na compreens&atilde;o. Fomento da autonomia e consci&ecirc;ncia lingu&iacute;stica. Estruturas b&aacute;sicas da l&iacute;ngua e textos com alguma complexidade. Uso integrado de tecnologias digitais, inclusive na avalia&ccedil;&atilde;o. Trabalho aut&ocirc;nomo, individual e/ou em grupo, via ambiente virtual.</p>', NULL, 0, 1, 541, 13, 1),
(3941, 'LA411', 'Japon√™s IV', 4, 'G', 6, 0, '<p>Uso da l&iacute;ngua formal em situa&ccedil;&otilde;es espec&iacute;ficas do cotidiano: fazer compara&ccedil;&otilde;es, descrever habilidades, descrever experi&ecirc;ncias, justificar, pedir e dar sugest&atilde;o, aconselhar.</p>', NULL, 0, 1, 314, 0, 1),
(3942, 'LA412', 'Ingl√™s IV', 4, 'G', 5, 0, '<p>Aprimoramento das habilidades de compreens&atilde;o e produ&ccedil;&atilde;o de textos orais, escritos e multimodais em ingl&ecirc;s, voltando-se a pr&aacute;ticas do cotidiano e a situa&ccedil;&otilde;es mais formais, vinculadas principalmente aos prop&oacute;sitos comunicativos relacionados &agrave; formula&ccedil;&atilde;o de hip&oacute;teses descri&ccedil;&otilde;es e compara&ccedil;&otilde;es, a relatos de experi&ecirc;ncias e h&aacute;bitos no passado, &agrave; a&ccedil;&atilde;o de dar conselhos e estabelecer obriga&ccedil;&otilde;es e necessidades, bem como de reportar discursos dos outros, visando a aprimorar a forma&ccedil;&atilde;o acad&ecirc;mica/profissional do aluno e a promover reflex&atilde;o sobre o funcionamento da l&iacute;ngua inglesa, sensibilizando para aspectos culturais pertinentes.</p>', NULL, 0, 1, 1005, 8, 2),
(3944, 'LA414', 'Alem√£o IV', 4, 'G', 5, 0, '<p>Alem&atilde;o como l&iacute;ngua estrangeira, n&iacute;vel b&aacute;sico m&eacute;dio (A2.2 no Quadro Comum Europeu, dispon&iacute;vel no s&iacute;tio eletr&ocirc;nico do CEL). Compreens&atilde;o e express&atilde;o oral/escrita, &ecirc;nfase na compreens&atilde;o. Fomento da autonomia e consci&ecirc;ncia lingu&iacute;stica. Estruturas e tipos de texto com maior grau de elabora&ccedil;&atilde;o. Uso integrado de tecnologias digitais, inclusive na avalia&ccedil;&atilde;o. Trabalho aut&ocirc;nomo, individual e/ou em grupo, via ambiente virtual.</p>', NULL, 0, 1, 423, 7, 2),
(3953, 'LA511', 'Japon√™s V', 4, 'G', 6, 0, '<p>Uso da linguagem formal e informal em situa&ccedil;&otilde;es espec&iacute;ficas do cotidiano: aconselhar, expressar possibilidades, capacidades, suposi&ccedil;&otilde;es, avalia&ccedil;&otilde;es, d&uacute;vida, pedido e obrigatoriedade com detalhes circunstanciais.</p>', NULL, 0, 1, 232, 0, 1),
(3954, 'LA512', 'Ingl√™s V', 4, 'G', 6, 0, '<p>Amplia&ccedil;&atilde;o das habilidades de compreens&atilde;o e produ&ccedil;&atilde;o de textos orais, escritos e multimodais em ingl&ecirc;s, por meio de pr&aacute;ticas comunicativas do cotidiano e em atividades sociais mais formais, que exijam conhecimento de fun&ccedil;&otilde;es e aspectos lingu&iacute;sticos mais complexos, tais como desenvolver uma narrativa, participar de um debate e de uma mesa redonda sobre temas diversos, falar sobre eventos hist&oacute;ricos, relatar pesquisas, visando &agrave; forma&ccedil;&atilde;o e atua&ccedil;&atilde;o acad&ecirc;mica/profissional do aluno e sensibilizando para aspectos culturais pertinentes.</p>', NULL, 0, 1, 763, 6, 2),
(3967, 'LA611', 'Japon√™s VI', 4, 'G', 6, 0, '<p>Uso da linguagem formal e informal em situa&ccedil;&otilde;es espec&iacute;ficas do cotidiano: expressar sentimentos, d&uacute;vidas, situa&ccedil;&otilde;es hipot&eacute;ticas, planos e necessidades.</p>', NULL, 0, 1, 173, 1, 2),
(3968, 'LA612', 'Ingl√™s VI', 4, 'G', 6, 0, '<p>Consolida&ccedil;&atilde;o das habilidades de compreens&atilde;o e produ&ccedil;&atilde;o de textos orais, escritos e multimodais em ingl&ecirc;s, por meio de pr&aacute;ticas comunicativas do cotidiano e em atividades sociais mais formais, que exijam conhecimento de fun&ccedil;&otilde;es e aspectos lingu&iacute;sticos complexos, tais como elaborar textos acad&ecirc;micos escritos de g&ecirc;neros diversos, argumentar em debates, desenvolver narrativas, desenvolver hip&oacute;teses, entre outros, visando &agrave; forma&ccedil;&atilde;o e atua&ccedil;&atilde;o acad&ecirc;mica/profissional do aluno e sensibilizando para aspectos culturais pertinentes.</p>', NULL, 0, 1, 543, 4, 1),
(4070, 'MA044', 'Matem√°tica IV', 4, 'G', 5, 0, '<p>N&uacute;meros complexos. Fun&ccedil;&otilde;es de vari&aacute;vel complexa. Equa&ccedil;&otilde;es de Cauchy-Riemann. Integral de linha. Sequ&ecirc;ncias e s&eacute;ries de n&uacute;meros complexos. S&eacute;ries de pot&ecirc;ncias. Teorema dos res&iacute;duos. Transforma&ccedil;&otilde;es conformes.</p>', NULL, 0, 22, 1979, 495, 5),
(4073, 'MA109', 'Matem√°tica B√°sica', 4, 'G', 1, 0, '<p>Estudo elementar de fun&ccedil;&otilde;es reais: gr&aacute;ficos, opera&ccedil;&otilde;es com fun&ccedil;&otilde;es, tipos de fun&ccedil;&otilde;es. Fun&ccedil;&otilde;es trigonom&eacute;tricas: defini&ccedil;&otilde;es, gr&aacute;ficos, fun&ccedil;&otilde;es trigonom&eacute;tricas inversas. Fun&ccedil;&atilde;o exponencial e fun&ccedil;&atilde;o logar&iacute;tmica. Polin&ocirc;mios: ra&iacute;zes, regra de sinais. Progress&otilde;es.</p>', NULL, 0, 22, 591, 98, 3),
(4075, 'MA111', 'C√°lculo I', 6, 'G', 5, 0, '<p>Intervalos e desigualdades. Fun&ccedil;&otilde;es. Limites. Continuidade. Derivada e diferencial. Integral. T&eacute;cnicas de integra&ccedil;&atilde;o.</p>', NULL, 0, 22, 17507, 4966, 6),
(4077, 'MA141', 'Geometria Anal√≠tica e Vetores', 4, 'G', 5, 0, '<p>Sistemas lineares. Vetores, opera&ccedil;&otilde;es. Bases, sistemas de coordenadas. Dist&acirc;ncia, norma e &acirc;ngulo. Produtos escalar e vetorial. Retas no plano e no espa&ccedil;o. Planos. Posi&ccedil;&otilde;es relativas, interse&ccedil;&otilde;es, dist&acirc;ncias e &acirc;ngulos. C&iacute;rculo e esfera. Coordenadas polares, cil&iacute;ndricas e esf&eacute;ricas. Se&ccedil;&otilde;es c&ocirc;nicas, classifica&ccedil;&atilde;o. Introdu&ccedil;&atilde;o &agrave;s qu&aacute;dricas.</p>', NULL, 0, 22, 16183, 4266, 7),
(4078, 'MA148', 'Fundamentos da Matem√°tica', 4, 'G', 1, 0, '<p>Visa apresentar um primeiro contato com o rigor matem&aacute;tico, ensinar os alunos a demonstrar proposi&ccedil;&otilde;es simples, de modo rigoroso e coerentemente redigido, a partir de conceitos desenvolvidos no ensino m&eacute;dio. Devem ser introduzidas apenas no&ccedil;&otilde;es b&aacute;sicas de l&oacute;gica e conjuntos, al&eacute;m de princ&iacute;pio de indu&ccedil;&atilde;o, conjuntos de n&uacute;meros (naturais, inteiros, racionais, reais e complexos), sequ&ecirc;ncias reais e no&ccedil;&otilde;es b&aacute;sicas de combinat&oacute;ria.</p>', NULL, 0, 22, 715, 106, 3),
(4082, 'MA211', 'C√°lculo II', 6, 'G', 5, 0, '<p>Fun&ccedil;&otilde;es de v&aacute;rias vari&aacute;veis reais. F&oacute;rmula de Taylor. M&aacute;ximos e m&iacute;nimos. Integrais m&uacute;ltiplas. Integrais de linha. Teorema da diverg&ecirc;ncia. Teorema de Stokes.</p>', NULL, 0, 22, 13953, 3961, 7),
(4090, 'MA311', 'C√°lculo III', 6, 'G', 5, 0, '<p>S&eacute;ries num&eacute;ricas e s&eacute;ries de fun&ccedil;&otilde;es. Equa&ccedil;&otilde;es diferenciais ordin&aacute;rias. Transformadas de Laplace. Sistemas de equa&ccedil;&otilde;es de primeira ordem. Equa&ccedil;&otilde;es diferenciais parciais e s&eacute;ries de Fourier.</p>', NULL, 0, 22, 13515, 4555, 6),
(4091, 'MA327', '√Ålgebra Linear', 4, 'G', 5, 0, '<p>Espa&ccedil;os vetoriais reais. Subespa&ccedil;os. Base e dimens&atilde;o. Transforma&ccedil;&otilde;es lineares e matrizes. N&uacute;cleo e imagem. Proje&ccedil;&otilde;es. Autovalores e autovetores. Produto interno. Matrizes reais especiais. Diagonaliza&ccedil;&atilde;o.</p>', NULL, 0, 22, 7938, 2706, 7),
(4106, 'MA520', 'Geometria Plana e Desenho Geom√©trico', 4, 'G', 1, 0, '<p>Tratamento axiom&aacute;tico da geometria euclidiana plana. Introdu&ccedil;&atilde;o &agrave;s geometrias n&atilde;o euclidianas. Isometrias no plano. Desenho geom&eacute;trico. T&oacute;picos da hist&oacute;ria da geometria.</p>', NULL, 0, 22, 786, 136, 4),
(4140, 'MC001', 'Tecnologias da Informa√ß√£o', 4, 'G', 5, 0, '<p>Organiza&ccedil;&otilde;es de dados, organiza&ccedil;&otilde;es de computadores, estruturas de programas, fundamentos de bancos de dados, no&ccedil;&otilde;es de redes, internet, interface ser humano-computadores, impacto social da computa&ccedil;&atilde;o.</p>', NULL, 0, 16, 853, 28, 1),
(4141, 'MC009', 'Computa√ß√£o e Sociedade', 2, 'G', 2, 0, '<p>Problemas &eacute;ticos originados pelo uso da Tecnologia de Informa&ccedil;&atilde;o. Oportunidades multidisciplinares do uso da computa&ccedil;&atilde;o - pesquisa, desenvolvimento e empregabilidade. Tend&ecirc;ncias de mercado e globaliza&ccedil;&atilde;o - projetos cooperativos, quest&otilde;es de g&ecirc;nero, trabalho &agrave; dist&acirc;ncia. Computa&ccedil;&atilde;o e a Unicamp - necessidades e oportunidades. Aspectos da pol&iacute;tica de inform&aacute;tica no Brasil e no mundo.</p>', NULL, 0, 16, 638, 6, 1),
(4142, 'MC011', 'Laborat√≥rio de Compiladores', 3, 'G', 1, 0, 'Desenvolvimento do projeto e implementa√ß√£o de um compilador para uma linguagem de alto n√≠vel t√≠pica.', NULL, 0, 16, 323, 9, 3),
