(4147, 'MC030', 'Projeto Final de Gradua√ß√£o', 12, 'G', 5, 0, '<p>Projeto te&oacute;rico ou pr&aacute;tico orientado por um ou mais docentes do Instituto de Computa&ccedil;&atilde;o, acompanhado por monografia redigida pelo aluno.</p>', NULL, 0, 16, 122, 4, 1),
(4149, 'MC039', 'Semin√°rios sobre Computa√ß√£o e Tecnologia', 2, 'G', 6, 0, '<p>Semin&aacute;rios e palestras sobre t&oacute;picos de Computa&ccedil;&atilde;o e Tecnologia.</p>', NULL, 0, 16, 617, 6, 2),
(4150, 'MC040', 'Est√°gio de Inicia√ß√£o Cient√≠fica I', 12, 'G', 6, 0, '<p>Projeto de Inicia&ccedil;&atilde;o Cient&iacute;fica na &aacute;rea de Computa&ccedil;&atilde;o, supervisionado ou orientado por um docente do Instituto de Computa&ccedil;&atilde;o.</p>', NULL, 0, 16, 197, 0, 1),
(4151, 'MC041', 'Est√°gio de Inicia√ß√£o Cient√≠fica II', 12, 'G', 6, 0, '<p>Projeto de Inicia&ccedil;&atilde;o Cient&iacute;fica na &aacute;rea de Computa&ccedil;&atilde;o, supervisionado ou orientado por um docente do Instituto de Computa&ccedil;&atilde;o.</p>', NULL, 0, 16, 69, 0, 1),
(4152, 'MC050', 'Monitoria', 8, 'G', 6, 0, '<p>Apoio &agrave; doc&ecirc;ncia abrangendo atividades como aux&iacute;lio ao professor em aulas pr&aacute;ticas, corre&ccedil;&atilde;o de listas de exerc&iacute;cios e plant&atilde;o de d&uacute;vidas.</p>', NULL, 0, 16, 67, 0, 1),
(4153, 'MC102', 'Algoritmos e Programa√ß√£o de Computadores', 6, 'G', 5, 0, '<p>Conceitos b&aacute;sicos de organiza&ccedil;&atilde;o de computadores. Constru&ccedil;&atilde;o de algoritmos e sua representa&ccedil;&atilde;o em pseudoc&oacute;digo e linguagens de alto n&iacute;vel. Desenvolvimento sistem&aacute;tico e implementa&ccedil;&atilde;o de programas. Estrutura&ccedil;&atilde;o, depura&ccedil;&atilde;o, testes e documenta&ccedil;&atilde;o de programas. Resolu&ccedil;&atilde;o de problemas.</p>', NULL, 0, 16, 11693, 2188, 5),
(4156, 'MC202', 'Estruturas de Dados', 6, 'G', 5, 0, '<p>Estruturas b&aacute;sicas para representa&ccedil;&atilde;o de informa&ccedil;&otilde;es: listas, &aacute;rvores, grafos e suas generaliza&ccedil;&otilde;es. Algoritmos para constru&ccedil;&atilde;o, consulta e manipula&ccedil;&atilde;o de tais estruturas. Desenvolvimento, implementa&ccedil;&atilde;o e testes de programas usando tais estruturas em aplica&ccedil;&otilde;es espec&iacute;ficas.</p>', NULL, 0, 16, 2889, 663, 5),
(4159, 'MC326', 'Estruturas de Arquivos', 4, 'G', 1, 0, 'Dispositivos de armazenamento de dados. Organiza√ß√£o de arquivos e tipos de acesso. Opera√ß√µes b√°sicas sobre arquivos. Indexa√ß√£o e listas invertidas. Estruturas eficientes de busca: √°rvores B e varia√ß√µes, espalhamento.', NULL, 0, 16, 657, 66, 4),
(4160, 'MC336', 'Paradigmas de Programa√ß√£o', 4, 'G', 5, 0, 'Vis√£o comparativa de paradigmas de programa√ß√£o. Programa√ß√£o funcional, l√≥gica e orientada a objetos.', NULL, 0, 16, 1115, 190, 4),
(4161, 'MC348', 'Fundamentos Matem√°ticos da Computa√ß√£o', 4, 'G', 5, 0, 'Conceitos b√°sicos de matem√°tica discreta e de l√≥gica para computa√ß√£o. T√©cnicas de provas, indu√ß√£o matem√°tica. Rela√ß√µes e conceitos de teoria de grafos.', NULL, 0, 16, 900, 287, 5),
(4162, 'MC404', 'Organiza√ß√£o B√°sica de Computadores e Linguagem de Montagem', 4, 'G', 5, 0, '<p style=\"text-align: justify;\">Introdu&ccedil;&atilde;o &agrave; organiza&ccedil;&atilde;o de computadores e representa&ccedil;&atilde;o de informa&ccedil;&atilde;o na mem&oacute;ria. Estudo do conjunto de instru&ccedil;&otilde;es de processadores relevantes. Desenvolvimento, implementa&ccedil;&atilde;o e testes de programas usando linguagens de montagem. Espa&ccedil;o de endere&ccedil;amento f&iacute;sico e mapeamento de endere&ccedil;os para mem&oacute;ria e perif&eacute;ricos. Programa&ccedil;&atilde;o de dispositivos de entrada e sa&iacute;da. Tratamento de interrup&ccedil;&otilde;es.</p>', NULL, 0, 16, 2098, 464, 5),
(4163, 'MC426', 'Engenharia de Software', 4, 'G', 5, 0, '<p style=\"text-align: justify;\">Modelos de processo de desenvolvimento de software. Engenharia de requisitos. Modelos de an&aacute;lise e projeto de sistemas de software. Arquitetura de software e padr&otilde;es arquiteturais. Padr&otilde;es de projeto.</p>', NULL, 0, 16, 511, 23, 2),
(4165, 'MC436', 'Introdu√ß√£o √† Engenharia de Software', 6, 'G', 5, 0, 'Paradigmas de Engenharia de Software. Levantamento de requisitos. T&#233;cnicas e ferramentas de especifica&#231;&#227;o de requisitos do usu&#225;rio e do sistema  computacional. M&#233;todos de an&#225;lise e projeto de sistemas de informa&#231;&#227;o. Implementa&#231;&#227;o de sistemas de informa&#231;&#227;o. Aplica&#231;&#227;o de t&#233;cnicas de Engenharia de Software para o desenvolvimento de um estudo de caso pr&#225;tico.', NULL, 0, 16, 606, 17, 3),
(4167, 'MC448', 'Projeto e An√°lise de Algoritmos I', 4, 'G', 5, 0, 'T√©cnicas de projeto e an√°lise de algoritmos. Algoritmos de ordena√ß√£o e algoritmos b√°sicos para problemas em grafos.', NULL, 0, 16, 1032, 359, 7),
(4168, 'MC504', 'Sistemas Operacionais', 4, 'G', 5, 0, '<p style=\"text-align: justify;\">Conceito de processos: concorr&ecirc;ncias, regi&otilde;es cr&iacute;ticas, escalonamento. Conceitos de espa&ccedil;os de endere&ccedil;amento e de gerenciamento de mem&oacute;ria virtual, pagina&ccedil;&atilde;o, segmenta&ccedil;&atilde;o. Sistemas de arquivos: hierarquia, prote&ccedil;&atilde;o, organiza&ccedil;&atilde;o, seguran&ccedil;a. Gerenciamento de Entrada/Sa&iacute;da. Estudos de caso.</p>', NULL, 0, 16, 417, 39, 0),
(4171, 'MC514', 'Sistemas Operacionais: Teoria e Pr√°tica', 6, 'G', 5, 0, 'Conceitos de processos: concorr√™ncia, regi√µes cr√≠ticas, escalonamento. Conceitos de espa√ßos de endere√ßamento e de gerenciamento de mem√≥ria, mem√≥ria virtual, pagina√ß√£o, segmenta√ß√£o. Sistemas de arquivos: Hierarquia, prote√ß√£o, organiza√ß√£o, seguran√ßa. Gerenciamento de entrada/sa√≠da. Estudo de casos. Projeto e implementa√ß√£o de um prot√≥tipo de sistema operacional enfocando aspectos b√°sicos como multiprograma√ß√£o, ger√™ncia de perif√©ricos, ger√™ncia de arquivos.', NULL, 0, 16, 573, 65, 3),
(4173, 'MC526', 'Bancos de Dados', 4, 'G', 5, 0, 'Modelagem de dados: modelos conceituais, modelo E-R e suas varia√ß√µes. O modelo relacional: normaliza√ß√£o e manuten√ß√£o da integridade. Linguagens: c√°lculo e √°lgebra relacional. Arquitetura de sistemas de bancos de dados. Mecanismos de prote√ß√£o. Recupera√ß√£o. Seguran√ßa. Controle de concorr√™ncia. No√ß√µes de bancos de dados distribu√≠dos.', NULL, 0, 16, 160, 15, 2),
(4175, 'MC536', 'Bancos de Dados: Teoria e Pr√°tica', 6, 'G', 5, 0, '<p style=\"text-align: justify;\">Arquiteturas de sistemas de gerenciamento de bancos de dados. Modelagem de dados: modelos conceituais e l&oacute;gicos, incluindo o modelo relacional e normaliza&ccedil;&atilde;o. &Aacute;lgebra relacional. Linguagens de defini&ccedil;&atilde;o e de manipula&ccedil;&atilde;o de dados. Otimiza&ccedil;&atilde;o de consultas. Mecanismos de prote&ccedil;&atilde;o, recupera&ccedil;&atilde;o e seguran&ccedil;a. Controle de concorr&ecirc;ncia. Bancos de dados n&atilde;o relacionais. Projeto e desenvolvimento de ferramentas e t&eacute;cnicas utilizadas na solu&ccedil;&atilde;o de problemas de sistemas de informa&ccedil;&atilde;o, utilizando bancos de dados. Modelagem, especifica&ccedil;&atilde;o, projeto e implementa&ccedil;&atilde;o de aplica&ccedil;&otilde;es em sistemas de informa&ccedil;&atilde;o.</p>', NULL, 0, 16, 1067, 120, 3),
(4178, 'MC542', 'Organiza√ß√£o de Computadores: Teoria e Pr√°tica', 6, 'G', 2, 0, 'Teoria: No&#231;&#245;es b&#225;sicas sobre circuitos l&#243;gicos. Mem&#243;rias, unidades centrais de processamento. Endere&#231;amento, barramento interrup&#231;&#227;o, comunica&#231;&#245;es, interfaces e perif&#233;ricos. Computadores t&#237;picos. Pr&#225;tica: Metodologia de projeto digital. T&#233;cnicas de projeto usando l&#243;gica program&#225;vel. Caracter&#237;sticas el&#233;tricas de circuitos digitais. Conceitos da Linguagem VHDL. Projeto e implementa&#231;&#227;o de l&#243;gica combinacional (decodificadores, seletores, etc). Projeto e implementa&#231;&#227;o de l&#243;gica sequencial (Flip-flops, Contadores, etc). Circuitos aritm&#233;ticos. Mem&#243;rias. Projeto e implementa&#231;&#227;o de uma CPU.', NULL, 0, 16, 268, 72, 3),
(4179, 'MC548', 'Projeto e An√°lise de Algoritmos II', 4, 'G', 5, 0, 'Redu√ß√£o entre problemas. Complexidade computacional. Classes de problemas. Problemas NP-completos. Tratamento de Problemas NP-dif√≠ceis', NULL, 0, 16, 785, 235, 5),
(4181, 'MC602', 'Circuitos L√≥gicos e Organiza√ß√£o de Computadores', 4, 'G', 2, 0, '<p style=\"text-align: justify;\">Introdu&ccedil;&atilde;o aos conceitos b&aacute;sicos de projeto l&oacute;gico. Portas l&oacute;gicas. Minimiza&ccedil;&atilde;o de fun&ccedil;&otilde;es l&oacute;gicas. Mapas de Karnaugh. Circuitos combinacionais t&iacute;picos. Tecnologia de implementa&ccedil;&atilde;o. Elementos de mem&oacute;ria: Latch, Flip-Flops, contadores. S&iacute;ntese de circuitos sequenciais s&iacute;ncronos e m&aacute;quinas de estado. Organiza&ccedil;&atilde;o e hierarquia de mem&oacute;rias. Processador b&aacute;sico. &nbsp;Introdu&ccedil;&atilde;o &agrave; descri&ccedil;&atilde;o, s&iacute;ntese e simula&ccedil;&atilde;o de circuitos digitais com VHDL.</p>', NULL, 0, 16, 278, 40, 0),
(4184, 'MC613', 'Laborat√≥rio de Circuitos Digitais', 4, 'G', 1, 0, '<p style=\"text-align: justify;\">Metodologia de projeto digital. T&eacute;cnicas de projeto usando l&oacute;gica program&aacute;vel. Caracter&iacute;sticas el&eacute;tricas de circuitos digitais. Projeto e implementa&ccedil;&atilde;o de l&oacute;gica combinacional: decodificadores e seletores. Flip-flops. Contadores. Circuitos aritm&eacute;ticos. Mem&oacute;rias. Projeto e implementa&ccedil;&atilde;o de l&oacute;gica seq&uuml;encial. M&aacute;quinas de estados. Via de dados. Introdu&ccedil;&atilde;o a VHDL.</p>', NULL, 0, 16, 521, 18, 2),
(4185, 'MC626', 'An√°lise e Projeto de Sistema de Informa√ß√£o', 4, 'G', 5, 0, '<p style=\"text-align: justify;\">Verifica&ccedil;&atilde;o e Valida&ccedil;&atilde;o: conceitos e t&eacute;cnicas. T&eacute;cnicas Est&aacute;ticas. Testes: objetivos e terminologia. T&eacute;cnicas caixa branca e caixa preta. Escopo de testes. Testes de requisitos de qualidade. Execu&ccedil;&atilde;o de testes. Relato e rastreamento de problemas. Aspectos de gerenciamento.</p>', NULL, 0, 16, 155, 1, 0),
(4187, 'MC636', 'Verifica√ß√£o e Valida√ß√£o de Software', 6, 'G', 2, 0, 'Atividades da garantia de qualidade de software (SQA). T√©cnicas de valida√ß√£o e verifica√ß√£o (VeV). NUISCO e teste de software. Manuten√ß√£o e documenta√ß√£o de software. Aplica√ß√£o de t√©cnicas de valida√ß√£o, verifica√ß√£o e testes de software.', NULL, 0, 16, 278, 7, 2);
