(4189, 'MC668', 'Bioinform√°tica', 4, 'G', 5, 0, '<p>Algoritmos para compara&ccedil;&atilde;o de sequ&ecirc;ncias biol&oacute;gicas. T&eacute;cnicas e algoritmos para an&aacute;lise de sequ&ecirc;ncias biol&oacute;gicas. Bioinform&aacute;tica para projetos genoma. Problemas diversos em biologia computacional.</p>', NULL, 0, 16, 66, 1, 1),
(4194, 'MC714', 'Sistemas Distribu√≠dos', 4, 'G', 5, 0, '<p>Sistemas Distribu&iacute;dos. Comunica&ccedil;&atilde;o entre processos. Sistemas de arquivos distribu&iacute;dos. Nomes. Tempo e Coordena&ccedil;&atilde;o. Replica&ccedil;&atilde;o. Seguran&ccedil;a.</p>', NULL, 0, 16, 677, 77, 3),
(4195, 'MC715', 'Laborat√≥rio de Sistemas Distribu√≠dos', 3, 'G', 1, 0, '<p>Projeto e implementa&ccedil;&atilde;o de um sistema distribu&iacute;do envolvendo conceitos como: comunica&ccedil;&atilde;o entre processos, mensagens, comunica&ccedil;&atilde;o em grupos e comunica&ccedil;&atilde;o cliente-servidor.</p>', NULL, 0, 16, 226, 5, 2),
(4196, 'MC722', 'Projeto de Sistemas Computacionais', 4, 'G', 5, 0, 'Uma introdu√ß√£o √† arquitetura e organiza√ß√£o de computadores. Tecnologias e perspectiva hist√≥rica. Medidas de desempenho. Conjunto de instru√ß√µes. Mem√≥ria. Unidades de aritm√©tica e l√≥gica. Projeto b√°sico de um processador. Pipeline. Hierarquia da mem√≥ria: cache e mem√≥ria virtual. Dispositivos de I/O.', NULL, 0, 16, 1023, 188, 3),
(4197, 'MC723', 'Laborat√≥rio de Projetos de Sistemas Computacionais', 2, 'G', 5, 0, 'Metodologia de projeto de sistemas. T√©cnicas de projeto usando linguagens de descri√ß√£o de sistemas e hardware. Padr√µes de interconex√£o de hardware. Barramentos, processadores. Linguagens de descri√ß√£o de arquiteturas. Cria√ß√£o de modelos execut√°veis de sistemas.', NULL, 0, 16, 434, 19, 2),
(4200, 'MC747', 'Projeto de Engenharia de Software', 4, 'G', 5, 0, '<p>Uso combinado de ferramentas de desevolvimento valida&ccedil;&atilde;o e verifica&ccedil;&atilde;o (VeV) para a constru&ccedil;&atilde;o de um sistema de informa&ccedil;&atilde;o.</p>', NULL, 0, 16, 292, 1, 1),
(4201, 'MC750', 'Constru√ß√£o de Interfaces Homem-Computador', 4, 'G', 5, 0, '<p style=\"text-align: justify;\">Introdu&ccedil;&atilde;o a Interfaces Humano-Computador (IHC). Aspectos humanos. Aspectos tecnol&oacute;gicos. Processos, m&eacute;todos e t&eacute;cnicas de pesquisa, design e avalia&ccedil;&atilde;o. Ferramentas de suporte. Concep&ccedil;&atilde;o, modelagem e prototipa&ccedil;&atilde;o de solu&ccedil;&otilde;es em interfaces de usu&aacute;rio.</p>', NULL, 0, 16, 994, 37, 3),
(4203, 'MC822', 'Teleprocessamento e Redes', 4, 'G', 5, 0, 'No√ß√µes b√°sicas de teleprocessamento: tipos de enlace, c√≥digos, modos e meios de transmiss√£o. Redes de computadores: locais, metropolitanas e de longa dist√¢ncia. Terminologia e aplica√ß√µes, topologias, modelos de arquitetura (RM-OSI/ISO e TCP/IP) e protocolos. Interconex√£o de redes. N√≠vel de transporte.', NULL, 0, 16, 914, 153, 4),
(4204, 'MC823', 'Laborat√≥rio de Teleprocessamento e Redes', 2, 'G', 5, 0, 'Programa√ß√£o utilizando diferentes tecnologias de comunica√ß√£o: sockets, TCP e UDP, e chamada de m√©todo remoto.', NULL, 0, 16, 595, 32, 3),
(4213, 'MC878', 'Teoria e Aplica√ß√µes de Grafos', 4, 'G', 6, 0, '<p>Fundamentos da teoria de grafos. Modelagem de problemas usando grafos. Algoritmos para problemas em grafos.</p>', NULL, 0, 16, 68, 2, 1),
