(4217, 'MC900', 'T√≥picos Especiais em Linguagem de Programa√ß√£o', 4, 'G', 6, 0, '<p>Estudo de problemas especiais em linguagens de programa&ccedil;&atilde;o. A ementa desta disciplina ser&aacute; definida por ocasi&atilde;o de seu oferecimento.</p>', NULL, 0, 16, 36, 0, 1),
(4218, 'MC906', 'Introdu√ß√£o √† Intelig√™ncia Artificial', 4, 'G', 5, 0, '<p>Estudo introdut&oacute;rio dos fundamentos e aplica&ccedil;&otilde;es de Intelig&ecirc;ncia Artificial. Hist&oacute;rico e princ&iacute;pios de IA. Resolu&ccedil;&atilde;o de problemas. Representa&ccedil;&atilde;o de conhecimento. Aplica&ccedil;&otilde;es.</p>', NULL, 0, 16, 735, 72, 6),
(4219, 'MC908', 'T√≥picos Especiais em Teoria da Computa√ß√£o', 4, 'G', 6, 0, '<p>Estudo de problemas especiais em teoria da computa&ccedil;&atilde;o. A ementa desta disciplina ser&aacute; definida por ocasi&atilde;o de seu oferecimento.</p>', NULL, 0, 16, 25, 0, 1),
(4220, 'MC910', 'Constru√ß√£o de Compiladores', 4, 'G', 2, 0, 'M√©todos de an√°lise sint√°tica. Sistemas de execu√ß√£o. Gera√ß√£o e otimiza√ß√£o de c√≥digos objeto. Recupera√ß√£o de erros.', NULL, 0, 16, 487, 66, 3),
(4222, 'MC914', 'T√≥picos em Sistemas Operacionais I', 4, 'G', 6, 0, '<p>Estudos de t&oacute;picos avan&ccedil;ados em sistemas operacionais.</p>', NULL, 0, 16, 19, 0, 1),
(4224, 'MC919', 'T√≥picos Especiais em Processamento Gr√°fico', 4, 'G', 6, 0, '<p>Estudo de problemas especiais em processamento gr&aacute;fico. A ementa desta disciplina ser&aacute; definida por ocasi&atilde;o de seu oferecimento.</p>', NULL, 0, 16, 137, 6, 2),
(4225, 'MC920', 'Introdu√ß√£o ao Processamento de Imagem Digital', 4, 'G', 1, 0, '<p>Fundamentos de imagem digital. Transforma&ccedil;&otilde;es geom&eacute;tricas. Transforma&ccedil;&otilde;es Radiom&eacute;tricas. Filtragem no dom&iacute;nio espacial. Filtragem no dom&iacute;nio da frequ&ecirc;ncia. T&eacute;cnicas de restaura&ccedil;&atilde;o. Introdu&ccedil;&atilde;o a segmenta&ccedil;&atilde;o. Introdu&ccedil;&atilde;o a morfologia matem&aacute;tica.</p>', NULL, 0, 16, 253, 6, 1),
(4226, 'MC922', 'Princ√≠pios de Projeto VLSI', 4, 'G', 6, 0, '<p>Introdu&ccedil;&atilde;o ao projeto e an&aacute;lise de estruturas VLSI; ferramentas de desenvolvimento.</p>', NULL, 0, 16, 41, 0, 1),
(4230, 'MC930', 'Computa√ß√£o Gr√°fica', 4, 'G', 2, 0, 'Conceitos b√°sicos. Algoritmos de primitivas gr√°ficas. Representa√ß√£o e estrutura√ß√£o de informa√ß√£o gr√°fica. Descri√ß√£o, constru√ß√£o e utiliza√ß√£o de um n√∫cleo de um sistema gr√°fico. Aplica√ß√µes.', NULL, 0, 16, 332, 16, 2),
(4231, 'MC931', 'T√≥picos Especiais em Ci√™ncia da Computa√ß√£o', 4, 'G', 6, 0, '<p>Estudo de problemas especiais em Ci&ecirc;ncia da Computa&ccedil;&atilde;o. A ementa desta disciplina ser&aacute; definida por ocasi&atilde;o de seu oferecimento.</p>', NULL, 0, 16, 34, 0, 0),
(4233, 'MC933', 'T√≥picos Especiais em Ci√™ncia da Computa√ß√£o', 4, 'G', 6, 0, '<p>Estudo de problemas especiais em Ci&ecirc;ncia da Computa&ccedil;&atilde;o. A ementa desta disciplina ser&aacute; definida por ocasi&atilde;o de seu oferecimento.</p>', NULL, 0, 16, 27, 0, 0),
(4236, 'MC936', 'T√≥picos em Sistemas de Informa√ß√£o', 4, 'G', 6, 0, '<p>Estudo te&oacute;rico e aplica&ccedil;&otilde;es especiais na &aacute;rea de sistemas de informa&ccedil;&atilde;o. A ementa desta disciplina ser&aacute; definida por ocasi&atilde;o de seu oferecimento.</p>', NULL, 0, 16, 24, 0, 1),
(4238, 'MC940', 'Processamento e An√°lise de Imagens', 4, 'G', 5, 0, '<p>Segmenta&ccedil;&atilde;o de imagens.&nbsp;Transforma&ccedil;&otilde;es morfol&oacute;gicas.&nbsp;Representa&ccedil;&atilde;o.&nbsp;Descri&ccedil;&atilde;o.&nbsp;Extra&ccedil;&atilde;o de caracter&iacute;sticas.&nbsp;Classifica&ccedil;&atilde;o supervisionada.&nbsp;Classifica&ccedil;&atilde;o n&atilde;o supervisionada.</p>', NULL, 0, 16, 110, 0, 1),
(4241, 'MC948', 'Geometria Computacional', 4, 'G', 6, 0, '<p style=\"text-align:justify\">Projeto e an&aacute;lise de algoritmos para problemas em geometria computacional,&nbsp;incluindo problemas de envolt&oacute;ria convexa, caminho m&iacute;nimo, busca geom&eacute;trica, proximidade&nbsp;e interse&ccedil;&otilde;es geom&eacute;tricas. Quest&otilde;es de an&aacute;lise de complexidade, quotas inferiores e&nbsp;superiores, e modelos computacionais. Aplica&ccedil;&otilde;es &agrave; computa&ccedil;&atilde;o gr&aacute;fica, planejamento de&nbsp;movimento, casamento de padr&otilde;es, etc.</p>', NULL, 0, 16, 25, 0, 1),
(4242, 'MC949', 'Vis√£o Computacional', 4, 'G', 6, 0, '<p>Conceitos b&aacute;sicos de processamento de imagens, correspond&ecirc;ncias e arestas, &aacute;lgebra linear e coordenadas homog&ecirc;neas, representa&ccedil;&otilde;es de rota&ccedil;&otilde;es. Proje&ccedil;&otilde;es ortogr&aacute;ficas, perspectiva e afim. C&acirc;meras e suas calibra&ccedil;&otilde;es. Matriz essencial, matriz fundamental, homografia, RANSAC. Fatoriza&ccedil;&atilde;o r&iacute;gida e n&atilde;o r&iacute;gida. Rastreamento, filtro de Kalman e de part&iacute;culas. Localiza&ccedil;&atilde;o e reconhecimento de objetos.</p>', NULL, 0, 16, 36, 1, 0),
(4243, 'MC950', 'Recupera√ß√£o de Imagens por Conte√∫do', 4, 'G', 6, 0, '<p style=\"text-align:justify\">Introdu&ccedil;&atilde;o &agrave; recupera&ccedil;&atilde;o de informa&ccedil;&atilde;o (modelos de recupera&ccedil;&atilde;o, avalia&ccedil;&atilde;o).&nbsp;Bancos de dados de imagem (linguagens de consulta, processamento de consultas,&nbsp;estruturas de indexa&ccedil;&atilde;o). Recupera&ccedil;&atilde;o de imagem por conte&uacute;do (descri&ccedil;&atilde;o de imagem,&nbsp;busca por similaridade, relevance feedback). Aplica&ccedil;&otilde;es.</p>', NULL, 0, 16, 4, 0, 1),
(4247, 'MC959', 'T√≥picos em Intelig√™ncia Artificial I', 4, 'G', 6, 0, '<p>Estudos de t&oacute;picos avan&ccedil;ados em intelig&ecirc;ncia artificial.</p>', NULL, 0, 16, 44, 0, 0),
(4248, 'MC962', 'Projeto de Redes Multim√≠dia', 4, 'G', 6, 0, '<p style=\"text-align: justify;\">Sistemas multim&iacute;dia em redes e distribu&iacute;dos, aplica&ccedil;&otilde;es e servi&ccedil;os multim&iacute;dia,&nbsp;controle de tr&aacute;fego, modelagem, projeto, dimensionamento e planejamento de capacidade&nbsp;de sistemas multim&iacute;dia em redes e distribu&iacute;dos, simula&ccedil;&atilde;o, emula&ccedil;&atilde;o, introdu&ccedil;&atilde;o aos &nbsp;processos estoc&aacute;sticos, &nbsp;Teoria das Filas, t&eacute;cnicas de medi&ccedil;&otilde;es e monitoramento, projeto e&nbsp;an&aacute;lise experimental de sistemas, estudo de modelagem de sistemas utilizando Teoria de&nbsp;Otimiza&ccedil;&atilde;o e Teoria de controle.</p>', NULL, 0, 16, 22, 0, 1),
(4250, 'MC964', 'T√≥picos em Computa√ß√£o Distribu√≠da', 4, 'G', 6, 0, '<p>Estudos de t&oacute;picos avan&ccedil;ados em computa&ccedil;&atilde;o distribu&iacute;da.</p>', NULL, 0, 16, 20, 0, 1),
(4341, 'MD441', 'Pr√°tica de Ci√™ncias IV', 2, 'G', 2, 0, 'Tendo elaborado seu projeto de pesquisa, levantado conhecimentos biom&#233;dicos e tendo vis&#227;o mensurada desta constru&#231;&#227;o, os alunos simular&#227;o pareceres sobre artigos&#160;SciELO ao treinar a cr&#237;tica epistemol&#243;gica e metodol&#243;gica, fechando o ciclo dos IPCs. Elementos&#160;subjacentes aos artigos, comp&#234;ndios, aulas, inicia&#231;&#245;es cient&#237;ficas/teses e congressos cient&#237;ficos. Investiga&#231;&#245;es experimentais, epidemiol&#243;gicas, em ensaios cl&#237;nicos e pesquisas psicossociais: seus m&#233;todos e instrumentos. Forma&#231;&#227;o cl&#237;nica privilegiada pela an&#225;lise de estudos de campo e de vis&#227;o humanista, cobrindo as especialidades m&#233;dica e &#225;reas da Sa&#250;de.', NULL, 0, 4, 763, 0, 1),
(4342, 'MD442', 'Sa√∫de e Sociedade II', 4, 'G', 2, 0, '<p>Rela&ccedil;&otilde;es entre Sa&uacute;de e Sociedade, estudadas do ponto de vista da integralidade da assist&ecirc;ncia nos n&iacute;veis de complexidade da rede de servi&ccedil;os de sa&uacute;de, considerando a especificidade de um determinado problema de sa&uacute;de, no &acirc;mbito das pol&iacute;ticas p&uacute;blicas de sa&uacute;de dirigidas ao problema abordado. Dando continuidade &agrave; MD342, ministrada no primeiro semestre, a MD442 dever&aacute; aprofundar e sistematizar os conhecimentos e experi&ecirc;ncias acumulados no primeiro semestre, restituindo os resultados do trabalho &agrave;s unidades de sa&uacute;de nas quais os temas foram desenvolvidos.</p>', NULL, 0, 4, 998, 1, 1),
(4343, 'MD443', 'Introdu√ß√£o √† Patologia', 8, 'G', 2, 0, '<p>Altera&ccedil;&otilde;es morfol&oacute;gicas macro e microsc&oacute;picas dos processos patol&oacute;gicos gerais que fundamentam as doen&ccedil;as mais prevalentes em nosso meio correlacionando-as com a fisiopatologia, etiopatog&ecirc;nese, sinais, sintomas e aspectos laboratoriais. Mecanismos b&aacute;sicos que levam &agrave;s muta&ccedil;&otilde;es gen&eacute;ticas sejam elas cromoss&ocirc;micas ou g&ecirc;nicas e relacion&aacute;-las com as doen&ccedil;as mais comuns no campo das anomalias cromoss&ocirc;micas, dos erros inatos de metabolismo e do c&acirc;ncer.</p>', NULL, 0, 4, 996, 0, 1),
(4344, 'MD444', 'Laborat√≥rio de Habilidades II', 4, 'G', 2, 0, '<p>Pr&aacute;tica m&eacute;dica por meio de anamnese, enfatizando no atendimento os aspectos sociais, hist&oacute;ricos e ambientais do paciente. T&eacute;cnicas e procedimentos b&aacute;sicos de enfermagem. Princ&iacute;pios de t&eacute;cnicas cir&uacute;rgicas em modelo experimental.</p>', NULL, 0, 4, 1003, 4, 1),
(4345, 'MD445', 'Anatomia Aplicada √† Pr√°tica M√©dica I', 2, 'G', 2, 0, '<p>Estudos complementares de anatomia topogr&aacute;fica e cir&uacute;rgica, aspectos radiol&oacute;gicos e de&nbsp;imagem, correla&ccedil;&atilde;o an&aacute;tomo-cir&uacute;rgica-radiol&oacute;gica dos org&atilde;os das regi&otilde;es cervical, t&oacute;racica e abdominal, medicina legal, enfatizando doen&ccedil;as mais prevalentes e alguns procedimentos b&aacute;sicos e iniciais.</p>', NULL, 0, 4, 996, 2, 1),
(4347, 'MD448', 'Bio√©tica II', 2, 'G', 2, 0, '<p>Continuidade do estudo iniciado na MD348, com discuss&atilde;o de aspectos m&eacute;dicos e filos&oacute;ficos de temas de Bio&eacute;tica, a partir de situa&ccedil;&otilde;es concretas.</p>', NULL, 0, 4, 783, 0, 1),
(4418, 'ME173', 'Estat√≠stica Descritiva', 4, 'G', 1, 0, '<p>Popula&ccedil;&atilde;o e amostras. Levantamento e apura&ccedil;&atilde;o de dados. Dados registrados e n&atilde;o registrados: censo e estimativa de popula&ccedil;&atilde;o. Descri&ccedil;&atilde;o de dados amostrais: tabelas, gr&aacute;ficos, medidas de posi&ccedil;&atilde;o e de variabilidade. No&ccedil;&otilde;es elementares de probabilidade. An&aacute;lise de uma distribui&ccedil;&atilde;o de freq&uuml;&ecirc;ncia de natureza qualitativa: coeficientes e &iacute;ndices mais usados. Elementos de demografia.</p>', NULL, 0, 22, 1159, 72, 4),
(4422, 'ME203', 'Estat√≠stica Elementar', 4, 'G', 2, 0, '<p>O ensino de Hist&oacute;ria e o campo do Patrim&ocirc;nio Cultural material e imaterial. Explora&ccedil;&atilde;o das conex&otilde;es das institui&ccedil;&otilde;es de mem&oacute;ria com os campos da cultura, do mercado, da ci&ecirc;ncia e da educa&ccedil;&atilde;o. A partir de estudos de caso e de levantamentos gerais sobre a situa&ccedil;&atilde;o dos museus brasileiros, s&atilde;o examinadas as novas concep&ccedil;&otilde;es de ensino de Hist&oacute;ria nos museus trazidas pela discuss&atilde;o contempor&acirc;nea sobre patrim&ocirc;nio, mem&oacute;ria, identidade cultural e educa&ccedil;&atilde;o.</p>', '<p>ABREU, Regina. CHAGAS, M&aacute;rio (orgs.). Mem&oacute;ria e Patrim&ocirc;nio: ensaios contempor&acirc;neos. Rio de Janeiro: Lamparina, 2009.</p>\n\n<p>ANDERSON, Benedict. Comunidades Imaginadas. S&atilde;o Paulo: Companhia das Letras, 2008.</p>\n\n<p>CHUVA, M&aacute;rcia. Os arquitetos da mem&oacute;ria: sociog&ecirc;nese das pr&aacute;ticas de preserva&ccedil;&atilde;o do patrim&ocirc;nio cultural no Brasil (1930-1940). Rio deJaneiro: ed. UFRJ, 2009.</p>\n\n<p>CASTRIOTA, Leonardo. Patrim&ocirc;nio Cultural: conceitos, pol&iacute;ticas e instrumentos. S&atilde;o Paulo: Annablume, 2009.</p>\n\n<p>CHOAY, Francoise. A alegoria do patrim&ocirc;nio. S&atilde;o Paulo: UNESCO, 2001. FARGE, Arlette. Lugares para a hist&oacute;ria. Belo Horizonte: Aut&ecirc;ntica,2011.</p>\n\n<p>OLIVEIRA, Lucia Lippi. Cultura &eacute; Patrim&ocirc;nio: um guia. Rio de Janeiro: FGV, 2009.</p>\n\n<p>SALVADORI, Maria &Acirc;ngela Borges. Hist&oacute;ria, Ensino e Patrim&ocirc;nio. Araraquara, SP: Junqueira &amp; Marin Ed', 0, 22, 1703, 268, 5),
(4423, 'ME210', 'Probabilidade I', 4, 'G', 5, 0, '<p>Espa&ccedil;o de probabilidade. Axiomas de Kolmogorov, propriedades, independ&ecirc;ncia, probalidade condicional, Teorema de Bayes. Espa&ccedil;os amostrais equiprov&aacute;veis. Espa&ccedil;os amostrais infinitos. Vari&aacute;veis e vetores aleat&oacute;rios discretos bi e tri dimensionais; distribui&ccedil;&otilde;es marginais, conjuntas e condicionais e independ&ecirc;ncia. Transforma&ccedil;&otilde;es. Momentos. Modelos: uniforme, binomial, geom&eacute;trica, binomial negativa, hipergeom&eacute;trica e Poisson. Fun&ccedil;&otilde;es geratrizes. Aproxima&ccedil;&atilde;o da binomial. Vari&aacute;veis aleat&oacute;rias cont&iacute;nuas, distribui&ccedil;&atilde;o, densidade e momentos. Modelos uniformes, exponencial e normal. Simula&ccedil;&otilde;es.</p>', NULL, 0, 22, 2345, 706, 5),
(4428, 'ME319', 'No√ß√µes de Infer√™ncia', 4, 'G', 5, 0, '<p>Distribui&ccedil;&atilde;o dos momentos amostrais. No&ccedil;&otilde;es de estima&ccedil;&atilde;o pontual e por intervalo. M&eacute;todos de estima&ccedil;&atilde;o: momentos, m&aacute;xima verossimilhan&ccedil;a, m&iacute;nimos quadrados. Intervalos de confian&ccedil;a para propor&ccedil;&otilde;es. Intervalos de confian&ccedil;a para m&eacute;dia e vari&acirc;ncia no caso de normalidade. No&ccedil;&otilde;es de teste de hip&oacute;teses. Erros de tipo I e II, n&iacute;vel de signific&acirc;ncia, tamanho e poder do teste. Testes sobre m&eacute;dias e vari&acirc;ncias de distribui&ccedil;&otilde;es normais. Testes sobre propor&ccedil;&otilde;es. Tamanho de amostra. Testes n&atilde;o param&eacute;tricos baseados em postos para uma e duas amostras.</p>', NULL, 0, 22, 389, 135, 0),
(4429, 'ME320', ' Infer√™ncia I', 4, 'G', NULL, 0, 'Distribui√ß√£o dos momentos amostrais. No√ß√µes de estima√ß√£o pontual e por intervalo . M√©todos de estima√ß√£o: momentos, m√°xima verossimilhan√ßa, m√≠nimos quadrados. Intervalos de confian√ßa para propor√ß√µes. Intervalos de confian√ßa para m√©dia e vari√¢ncia no caso de normalidade. No√ß√µes de teste de hip√≥teses. Erros do tipo I e II, n√≠vel de signific√¢ncia, tamanho e poder do teste. Testes sobre m√©dias e vari√¢ncias de distribui√ß√µes normais. Testes sobre propor√ß√µes. Tamanho de amostra. Testes n√£o param√©tricos baseados em postos para uma e duas amotras.', NULL, 0, 22, 359, 126, 5),
(4431, 'ME323', 'Introdu√ß√£o aos Modelos Probabil√≠sticos', 4, 'G', 1, 0, '<p>Introdu&ccedil;&atilde;o &agrave; probabilidade. Vari&aacute;veis aleat&oacute;rias. Esperan&ccedil;a de vari&aacute;vel aleat&oacute;ria. Vetor aleat&oacute;rio. No&ccedil;&otilde;es de infer&ecirc;ncia estat&iacute;stica. Introdu&ccedil;&atilde;o aos processos estoc&aacute;sticos.</p>', NULL, 0, 22, 2396, 353, 4),
(4434, 'ME414', 'Estat√≠stica para Experimentalistas', 4, 'G', 5, 0, '<p>Conceitos b&aacute;sicos de probabilidade e estat&iacute;stica descritiva. Principais distribui&ccedil;&otilde;es discretas e cont&iacute;nuas: Binomial, Hipergeom&eacute;trica, Poisson, Normal, t, F,&nbsp;qui-quadrado. Amostragem. Estima&ccedil;&atilde;o, teste de hip&oacute;tese e intervalo de confian&ccedil;a para m&eacute;dias, propor&ccedil;&otilde;es e vari&acirc;ncias. Regress&atilde;o e correla&ccedil;&atilde;o. An&aacute;lise de vari&acirc;ncia.</p>', NULL, 0, 22, 6701, 791, 6),
(4440, 'ME501', 'Processos Estoc√°sticos', 4, 'G', 2, 0, '<p>Cadeias de Markov a tempo discreto. Classifica&ccedil;&atilde;o de estados, no&ccedil;&otilde;es de recorr&ecirc;ncia e transi&ecirc;ncia. Medida estacion&aacute;ria. Reversibilidade. Processo de Poisson. Cadeias de Markov a tempo cont&iacute;nuo, processos de nascimento e morte. Aplica&ccedil;&otilde;es: no&ccedil;&otilde;es de teoria de renova&ccedil;&atilde;o e teoria de filas, simula&ccedil;&otilde;es.</p>', NULL, 0, 22, 440, 63, 3),
(4666, 'MP160', 'Produ√ß√£o Musical I', 2, 'G', 1, 0, 'Estudo dos processos sociais e t√©cnicos da produ√ß√£o musical. Processos fonogr√°ficos e visuais na constitui√ß√£o da linguagem da m√∫sica popular.', NULL, 0, 14, 155, 6, 3),
(4745, 'MS149', 'Complementos de Matem√°tica', 2, 'G', 1, 0, '<p>No&ccedil;&otilde;es b&aacute;sicas de l&oacute;gica. Elementos da teoria dos conjuntos. Princ&iacute;pio da indu&ccedil;&atilde;o. A demonstra&ccedil;&atilde;o em matem&aacute;tica. Conjuntos dos n&uacute;meros naturais, inteiros e racionais. No&ccedil;&otilde;es de n&uacute;meros reais e n&uacute;meros complexos. Fun&ccedil;&otilde;es e sequ&ecirc;ncias de n&uacute;meros reais. Elementos de an&aacute;lise combinat&oacute;ria.</p>', NULL, 0, 22, 2488, 354, 4),
(4747, 'MS211', 'C√°lculo Num√©rico', 4, 'G', 5, 0, '<p>Aritm&eacute;tica de ponto flutuante. Zeros de fun&ccedil;&otilde;es reais. Sistemas lineares. Interpola&ccedil;&atilde;o polinomial. Integra&ccedil;&atilde;o num&eacute;rica. Quadrados m&iacute;nimos lineares. Tratamento num&eacute;rico de equa&ccedil;&otilde;es diferenciais ordin&aacute;rias.</p>', NULL, 0, 22, 10423, 2423, 7),
(4760, 'MS428', 'Programa√ß√£o Linear', 4, 'G', 2, 0, '<p>Formula&ccedil;&atilde;o de problemas de programa&ccedil;&atilde;o linear. Resolu&ccedil;&atilde;o Gr&aacute;fica. M&eacute;todo Simplex. Teoria de dualidade. An&aacute;lise de sensibilidade e an&aacute;lise param&eacute;trica. Algoritmos de pontos interiores.</p>', NULL, 0, 22, 513, 103, 4),
(4766, 'MS512', 'An√°lise Num√©rica I', 4, 'G', 5, 0, '<p>Fatora&ccedil;&atilde;o de Choleski. Fatora&ccedil;&otilde;es ortogonais. Quadrados m&iacute;nimos lineares. Decomposi&ccedil;&atilde;o em valores singulares. M&eacute;todos iterativos para resolu&ccedil;&atilde;o de sistemas lineares. Introdu&ccedil;&atilde;o &agrave; resolu&ccedil;&atilde;o de sistemas n&atilde;o-lineares. C&aacute;lculo de autovalores e autovetores.</p>', NULL, 0, 22, 914, 328, 6),
(4773, 'MS550', 'M√©todos de Matem√°tica Aplicada I', 6, 'G', 1, 0, '<p>An&aacute;lise Vetorial (revis&atilde;o). Revis&atilde;o de equa&ccedil;&otilde;es diferenciais: equa&ccedil;&otilde;es da F&iacute;sica Matem&aacute;tica; sistemas de coordenadas. Exist&ecirc;ncia e unicidade da solu&ccedil;&atilde;o das equa&ccedil;&otilde;es diferenciais ordin&aacute;rias. Pontos singulares regulares: m&eacute;todo de Frobenius. Fun&ccedil;&otilde;es especiais (Bessel, Legendre). Equa&ccedil;&otilde;es Fuchsianas; Fun&ccedil;&atilde;o Hipergeom&eacute;trica. Sistemas de Sturm-Liouville. Polin&ocirc;mios ortogonais. Expans&atilde;o em autofun&ccedil;&otilde;es: s&eacute;ries de Fourier, s&eacute;ries generalizadas.</p>', NULL, 0, 22, 417, 139, 3),
(4788, 'MS650', 'M√©todos de Matem√°tica Aplicada II', 6, 'G', 2, 0, '<p>Fun&ccedil;&otilde;es de vari&aacute;veis complexas (revis&atilde;o). Transformadas integrais (Fourier e Laplace). Transformadas inversas. Representa&ccedil;&atilde;o integral de fun&ccedil;&otilde;es. Equa&ccedil;&otilde;es diferenciais parciais. Classifica&ccedil;&atilde;o; problemas bem-postos. Equa&ccedil;&otilde;es da onda, do calor e de Laplace. M&eacute;todo de separa&ccedil;&atilde;o de vari&aacute;veis. Introdu&ccedil;&atilde;o &agrave;s equa&ccedil;&otilde;es integrais. C&aacute;lculo de varia&ccedil;&otilde;es.</p>', NULL, 0, 22, 298, 83, 3),
(4810, 'MS993', 'M√©todos Computacionais de √Ålgebra Linear', 4, 'G', 6, 0, '<p>Estudo dos aspectos te&oacute;ricos e computacionais dos m&eacute;todos num&eacute;ricos aplicados &agrave; resolu&ccedil;&atilde;o de sistemas lineares provenientes da discretiza&ccedil;&atilde;o de problemas el&iacute;pticos e parab&oacute;licos atrav&eacute;s dos m&eacute;todos de diferen&ccedil;as finitas, incluindo m&eacute;todos diretos e m&eacute;todos iterativos para sistemas lineares, an&aacute;lise de sensibilidade, converg&ecirc;ncia e aspectos da estrutura de programa&ccedil;&atilde;o de uma linguagem de alto n&iacute;vel.</p>', NULL, 0, 22, 23, 0, 1),
(4836, 'MU063', 'R√≠tmica VI', 1, 'G', 2, 0, '<p>Treinamento auditivo e pr&aacute;tica progressiva em r&iacute;tmica. Conceitos, an&aacute;lise, exerc&iacute;cios e ditados.</p>', NULL, 0, 14, 321, 16, 2),
