(5078, 'MU573', 'Est√°gio Pedag√≥gico I', 6, 'G', 5, 0, '<p>O aluno dever&aacute; assumir situa&ccedil;&otilde;es de reg&ecirc;ncia supervisionada de classe, planejando, desenvolvendo e avaliando atividades de m&uacute;sica dentro da educa&ccedil;&atilde;o formal - em escolas de educa&ccedil;&atilde;o b&aacute;sica ou escolas especializadas de m&uacute;sica - ou ainda em espa&ccedil;os de educa&ccedil;&atilde;o n&atilde;o-formal, como projetos sociais, projetos de extens&atilde;o universit&aacute;ria, igrejas, programas extracurriculares desenvolvidos em escolas, entre outros. Pelo menos 100 (cem) horas das 400 (quatrocentas) horas totais de est&aacute;gio t&ecirc;m que ser desenvolvidas na educa&ccedil;&atilde;o b&aacute;sica, preferencialmente em escola p&uacute;blica. O aluno dever&aacute; apresentar relat&oacute;rio.</p>', NULL, 0, 14, 113, 0, 1),
(5111, 'MU673', 'Est√°gio Pedag√≥gico II', 8, 'G', 5, 0, '<p>O aluno dever&aacute; assumir situa&ccedil;&otilde;es de reg&ecirc;ncia supervisionada de classe, planejando, desenvolvendo e avaliando atividades de m&uacute;sica dentro da educa&ccedil;&atilde;o formal - em escolas de educa&ccedil;&atilde;o b&aacute;sica ou escolas especializadas de m&uacute;sica - ou ainda em espa&ccedil;os de educa&ccedil;&atilde;o n&atilde;o-formal, como projetos sociais, projetos de extens&atilde;o universit&aacute;ria, igrejas, programas extracurriculares desenvolvidos em escolas, entre outros. Pelo menos 100 (cem) horas das 400 (quatrocentas) horas totais de est&aacute;gio t&ecirc;m que ser desenvolvidas na educa&ccedil;&atilde;o b&aacute;sica, preferencialmente em escola p&uacute;blica. O aluno dever&aacute; apresentar relat&oacute;rio.</p>', NULL, 0, 14, 104, 3, 1),
(5120, 'MU693', 'Percep√ß√£o Musical VI', 3, 'G', 2, 0, '<p>Treinamento auditivo para m&uacute;sicos. Codifica&ccedil;&atilde;o e decodifica&ccedil;&atilde;o de eventos musicais mel&oacute;dicos e harm&ocirc;nicos apresentados de maneira gradual, por ordem de dificuldade. Continua&ccedil;&atilde;o da disciplina MU593.</p>', NULL, 0, 14, 341, 23, 3),
