(5312, 'QF531', 'F√≠sico-Qu√≠mica II', 4, 'G', 5, 0, '<p>Teoria cin&eacute;tica dos gases: equa&ccedil;&atilde;o barom&eacute;trica, Lei de Maxwell-Boltzmann para a distribui&ccedil;&atilde;o de velocidades; potencial intermolecular. Cin&eacute;tica qu&iacute;mica: equa&ccedil;&otilde;es de velocidade; cat&aacute;lises homog&ecirc;nea e heterog&ecirc;nea; rea&ccedil;&otilde;es r&aacute;pidas, no&ccedil;&otilde;es sobre din&acirc;mica molecular. Eletroqu&iacute;mica: condutividade de solu&ccedil;&otilde;es, Lei de Ostwald; equil&iacute;brio i&ocirc;nico; propriedades termodin&acirc;micas; coeficientes de atividade; teoria de Debye-H&uuml;ckel; pilhas e rea&ccedil;&otilde;es eletroqu&iacute;micas; passiva&ccedil;&atilde;o e corros&atilde;o.</p>', NULL, 0, 23, 995, 157, 4),
(5314, 'QF536', 'Qu√≠mica Qu√¢ntica', 4, 'G', 2, 0, '<p>Postulados da Mec&acirc;nica Qu&acirc;ntica. Equa&ccedil;&atilde;o de Schroedinger. Solu&ccedil;&otilde;es exatas e m&eacute;todos de aproxima&ccedil;&atilde;o. &Aacute;tomo de Hidrog&ecirc;nio e &aacute;tomos multieletr&ocirc;nicos. M&eacute;todos de estruturas eletr&ocirc;nicas para sistemas moleculares.</p>', NULL, 0, 23, 510, 75, 3),
(5316, 'QF632', 'F√≠sico-Qu√≠mica Experimental I', 6, 'G', 2, 0, '<p>Experimentos relacionados aos temas: termodin&acirc;mica qu&iacute;mica, cin&eacute;tica, eletroqu&iacute;mica, equil&iacute;brio de fases e propriedades coligativas.</p>', NULL, 0, 23, 473, 11, 1),
(5317, 'QF636', 'Introdu√ß√£o √† Espectroscopia e √† Termodin√¢mica', 4, 'G', 1, 0, 'Espectroscopia &#243;tica molecular. Espectroscopia de resson&#226;ncia paramagn&#233;tica de el&#233;trons (ERP) e magn&#233;tica nuclear (RMN). Lasers. Fotoqu&#237;mica. Ensembles e postulados. Fun&#231;&#245;es de parti&#231;&#227;o e conex&#227;o termodin&#226;mica. Sistema de part&#237;culas independentes: distingu&#237;veis e indistingu&#237;veis. Aplica&#231;&#245;es.', NULL, 0, 23, 447, 24, 2),
(5318, 'QF661', 'Qu√≠mica Aplicada', 4, 'G', 5, 0, '<p>Materiais: pol&iacute;meros, metais, cer&acirc;micas e vidros. Col&oacute;ides e superf&iacute;cies: surfactantes, espumas, molhabilidade, deterg&ecirc;ncia, estabilidade e propriedade de dispers&otilde;es.</p>', NULL, 0, 23, 630, 112, 2),
(5319, 'QF732', 'F√≠sico-Qu√≠mica Experimental II', 6, 'G', 1, 0, '<p>Experimentos relacionados aos temas: espectroscopia molecular, propriedades de materiais e f&iacute;sico-qu&iacute;mica de coloides e superf&iacute;cies.</p>', NULL, 0, 23, 537, 4, 2),
(5332, 'QG100', 'Qu√≠mica', 4, 'G', 5, 0, '<p>Periodicidade e propriedades; rea&ccedil;&otilde;es redox e estados de oxida&ccedil;&atilde;o; a liga&ccedil;&atilde;o qu&iacute;mica em materiais isolantes, condutores e semicondutores; conceitos de eletroqu&iacute;mica; potenciais de redu&ccedil;&atilde;o; armazenamento de energia.</p>', NULL, 0, 23, 3808, 238, 5),
(5334, 'QG102', 'Qu√≠mica Experimental I', 4, 'G', 5, 0, '<p>Experi&ecirc;ncias ilustrando o m&eacute;todo cient&iacute;fico, os conceitos de mol e de liga&ccedil;&atilde;o qu&iacute;mica, &oacute;xido-redu&ccedil;&atilde;o, equil&iacute;brio qu&iacute;mico, pH, produto de solubilidade, prepara&ccedil;&atilde;o e purifica&ccedil;&atilde;o de subst&acirc;ncias.</p>', NULL, 0, 23, 3416, 199, 5),
(5341, 'QG564', 'Qu√≠mica Org√¢nica e Inorg√¢nica Experimental', 8, 'G', 1, 0, '<p>Estudo de estrat&eacute;gias de s&iacute;ntese, purifica&ccedil;&atilde;o e caracteriza&ccedil;&atilde;o de subst&acirc;ncias org&acirc;nicas e inorg&acirc;nicas, ilustrando-se o deslocamento do equil&iacute;brio de rea&ccedil;&otilde;es atrav&eacute;s da remo&ccedil;&atilde;o dos produtos ou de subprodutos, ou pela precipita&ccedil;&atilde;o dos mesmos; a utiliza&ccedil;&atilde;o de atmosfera inerte; a purifica&ccedil;&atilde;o por destila&ccedil;&atilde;o, cristaliza&ccedil;&atilde;o, sublima&ccedil;&atilde;o ou cromatografia em coluna; a caracteriza&ccedil;&atilde;o por espectroscopia no infravermelho, espectroscopia de resson&acirc;ncia magn&eacute;tica nuclear, ponto de fus&atilde;o, espectrometria de massa e cromatografia em fase gasosa.</p>', NULL, 0, 23, 449, 3, 2),
(5350, 'QG835', 'Processos Industriais', 4, 'G', 5, 0, 'Cin√©tica de Reatores. Descri√ß√£o e an√°lise de alguns processos de grande import√¢ncia encontrados nas ind√∫strias qu√≠micas. Fermenta√ß√µes, refino de petr√≥leo, manufatura de papel, etc.', NULL, 0, 23, 557, 10, 2),
(5360, 'QI145', 'Intera√ß√µes Qu√≠micas', 2, 'G', 5, 0, '<p>Teoria dos orbitais moleculares para mol&eacute;culas poliat&ocirc;micas. Introdu&ccedil;&atilde;o &agrave; teoria de grupo. &Aacute;cidos e bases.</p>', NULL, 0, 23, 1366, 256, 3),
