(5369, 'QI542', 'Qu√≠mica Inorg√¢nica Experimental II', 8, 'G', 1, 0, '<p>S&iacute;ntese de complexos de metais de transi&ccedil;&atilde;o (compostos de coordena&ccedil;&atilde;o e organomet&aacute;licos), compostos modelos bioinorg&acirc;nicos e de &oacute;xidos e/ou sulfetos. Caracteriza&ccedil;&atilde;o dos compostos sintetizados explorando a s&eacute;rie nefelaux&eacute;tica, espectros eletr&ocirc;nicos, medidas de magnetismo, de dicro&iacute;smo circular, de espectroscopia vibracional, de resson&acirc;ncia magn&eacute;tica nuclear, eletroqu&iacute;micas e de luminesc&ecirc;ncia. Cin&eacute;tica de substitui&ccedil;&atilde;o de ligantes em complexos de metais de transi&ccedil;&atilde;o. Rea&ccedil;&otilde;es de intercala&ccedil;&atilde;o. Cat&aacute;lise (homog&ecirc;nea e heterog&ecirc;nea).</p>', NULL, 0, 23, 545, 2, 1),
