(5393, 'QO521', 'Qu√≠mica Org√¢nica II', 6, 'G', 5, 0, '<p>Alde&iacute;dos e cetonas. &Aacute;cidos carbox&iacute;licos e derivados. Conjuga&ccedil;&atilde;o, sistemas al&iacute;licos, dienos e polienos, compostos carbon&iacute;licos insaturados, rea&ccedil;&otilde;es do tipo Diels-Alder. Benzeno e o anel arom&aacute;tico, substitui&ccedil;&atilde;o eletrof&iacute;lica arom&aacute;tica. Haletos de arila e substitui&ccedil;&atilde;o nucleof&iacute;lica arom&aacute;tica. Fen&oacute;is. Aminas. Outras fun&ccedil;&otilde;es nitrogenadas. Em todos os casos, rela&ccedil;&atilde;o entre caracter&iacute;sticas estruturais e reatividade, com &ecirc;nfase em mecanismos, rela&ccedil;&otilde;es estereoqu&iacute;micas envolvidas e ampla exemplifica&ccedil;&atilde;o de aplica&ccedil;&otilde;es.</p>', NULL, 0, 23, 1396, 435, 4),
(5394, 'QO551', 'Bioqu√≠mica I', 4, 'G', 5, 0, '<p>Introdu&ccedil;&atilde;o, amino&aacute;cidos, prote&iacute;nas: estrutura, m&eacute;todos para an&aacute;lise de prote&iacute;nas, fun&ccedil;&atilde;o de prote&iacute;nas, carboidratos, &aacute;cidos nucleicos e estrutura de RNA e DNA, m&eacute;todos para an&aacute;lise de &aacute;cidos nucleicos, princ&iacute;pios da tecnologia de DNA recombinante, lip&iacute;deos e membranas biol&oacute;gicas, transporte atrav&eacute;s de membranas, enzimologia, t&oacute;picos selecionados.</p>', NULL, 0, 23, 1009, 182, 5),
(5398, 'QO622', 'Qu√≠mica Org√¢nica Experimental II', 8, 'G', 2, 0, '<p>An&aacute;lise qualitativa de compostos org&acirc;nicos utilizando m&eacute;todos qu&iacute;micos e f&iacute;sicos. Projetos de s&iacute;ntese org&acirc;nica e de produtos naturais.</p>', NULL, 0, 23, 479, 1, 1),
(5438, 'ST008', 'Metodologia do Trabalho Cient√≠fico', 2, 'G', 5, 0, '<p>M&eacute;todo cient&iacute;fico: conceitos e hist&oacute;rico; m&eacute;todos e t&eacute;cnicas de pesquisa; Pesquisa: conceitos, defini&ccedil;&otilde;es e tipos; elabora&ccedil;&atilde;o, comunica&ccedil;&atilde;o e divulga&ccedil;&atilde;o da pesquisa: fases da elabora&ccedil;&atilde;o da pesquisa, comunica&ccedil;&atilde;o da pesquisa (estrutura, forma e conte&uacute;do); normas ABNT; linguagem cient&iacute;fica; monografias; disserta&ccedil;&otilde;es; teses, relat&oacute;rios t&eacute;cnicos; artigos; eventos cient&iacute;ficos.</p>', NULL, 0, 2, 1977, 73, 3),
