(5555, 'ST264', 'Ingl√™s para Inform√°tica', 2, 'T', 5, 0, '<p>Compreens&atilde;o e Interpreta&ccedil;&atilde;o de Textos Gerais e T&eacute;cnicos. Tradu&ccedil;&atilde;o de textos de car&aacute;ter eminentemente t&eacute;cnico.</p>', NULL, 0, 2, 458, 10, 2),
