(6976, 'ST468', 'C√°lculo Num√©rico', 4, 'G', 5, 0, '<p>Erro de truncamento e arredondamento. Aritm&eacute;tica de ponto flutuante. Zeros de fun&ccedil;&otilde;es. M&eacute;todos de solu&ccedil;&atilde;o de sistemas lineares. Resolu&ccedil;&atilde;o de problemas n&atilde;o-lineares. Interpola&ccedil;&atilde;o. Ajuste de fun&ccedil;&otilde;es. Integra&ccedil;&atilde;o num&eacute;rica.</p>', NULL, 0, 25, 285, 19, 0),
