(9856, 'SI800', 'Empreendedorismo e Inova√ß√£o', 2, 'T', 2, 0, '<p>Empreendedorismo e tipo psicol&oacute;gico do empreendedor. Gest&atilde;o da Inova&ccedil;&atilde;o e sustentabilidade. An&aacute;lise estrat&eacute;gica. Fatores cr&iacute;ticos de sucesso e vantagem competitiva. An&aacute;lise de cen&aacute;rios, t&eacute;cnicas de mercado para novos produtos. An&aacute;lise financeira de investimento e forma&ccedil;&atilde;o de pre&ccedil;o de venda. Composi&ccedil;&atilde;o de plano de neg&oacute;cios.</p>', NULL, 0, 25, 57, 2, 0),
(10027, 'SI220', 'Matem√°tica Discreta', 4, 'T', 2, 0, '<p>Conjuntos. &Aacute;lgebra dos conjuntos. Rela&ccedil;&otilde;es. Fun&ccedil;&otilde;es. Estruturas alg&eacute;bricas. Reticulados. &Aacute;lgebra Booleana.</p>', NULL, 0, 25, 163, 28, 0),
(10028, 'SI250', 'Economia e Finan√ßas', 4, 'T', 5, 0, '<p>Introdu&ccedil;&atilde;o &agrave; Economia; economia pol&iacute;tica e marxista. Introdu&ccedil;&atilde;o &agrave; teoria do consumidor e teoria do mercado. Introdu&ccedil;&atilde;o &agrave; engenharia econ&ocirc;mica. Tipos de investimento e m&eacute;todos de an&aacute;lise de investimento.</p>', NULL, 0, 25, 128, 8, 0),
(10029, 'SI350', 'Teoria Geral de Sistemas', 2, 'T', 1, 0, '<p>A origem e o conceito da Teoria Geral de Sistemas. O conceito de sistema. Componentes gen&eacute;ricos de um sistema. As rela&ccedil;&otilde;es entre sistema e ambiente. Hierarquia de sistemas. Classifica&ccedil;&otilde;es dos sistemas. Enfoque sist&ecirc;mico. O pensamento sist&ecirc;mico aplicado na resolu&ccedil;&atilde;o de problemas. O pensamento sist&ecirc;mico aplicado &agrave;s organiza&ccedil;&otilde;es. Modelagem de Sistemas.</p>', NULL, 0, 25, 120, 2, 0),
(10030, 'SI450', 'Administra√ß√£o da Produ√ß√£o', 2, 'T', 2, 0, '<p>Sistemas de produ&ccedil;&atilde;o, ferramentas da produ&ccedil;&atilde;o enxuta e produ&ccedil;&atilde;o sustent&aacute;vel. Gest&atilde;o da cadeia de suprimentos. Planejamento e coordena&ccedil;&atilde;o de atividades em projetos. Indicadores de desempenho. Estrat&eacute;gia de produ&ccedil;&atilde;o.</p>', NULL, 0, 25, 78, 1, 0),
(10032, 'SI701', 'Introdu√ß√£o a Multim√≠dia', 2, 'T', 1, 0, '<p>Conceitos de multim&iacute;dia e sistemas multim&iacute;dia. Arquitetura e aplica&ccedil;&otilde;es multim&iacute;dia, classifica&ccedil;&atilde;o dos tipos de sistemas multim&iacute;dias. Dispositivos de entrada e sa&iacute;da em ambientes multim&iacute;dia. Fundamentos do processamento de imagens. Fundamentos de anima&ccedil;&atilde;o. Fundamentos de processamento de som. Crit&eacute;rios de sele&ccedil;&atilde;o de solu&ccedil;&otilde;es multim&iacute;dia.</p>', NULL, 0, 25, 38, 0, 0),
(10245, 'SI901', 'Inicia√ß√£o Cient√≠fica I', 10, 'T', 6, 0, '<p>Atividades de Inicia&ccedil;&atilde;o Cient&iacute;fica, desenvolvidas sob orienta&ccedil;&atilde;o de docente da Unicamp.</p>', NULL, 0, 25, 1, 0, 0),
(10521, 'MC521', 'Desafios de Programa√ß√£o I', 4, 'G', 6, 0, '<p>Estruturas de dados. Busca por padr&otilde;es. Ordena&ccedil;&atilde;o. Combinat&oacute;ria. Teoria dos N&uacute;meros. Backtracking. Algoritmos em grafos. Programa&ccedil;&atilde;o din&acirc;mica. Reticulados. Geometria computacional.</p>', NULL, 0, 16, 38, 0, 0),
(10715, 'MO644', 'Programa√ß√£o Paralela', 4, 'P', NULL, 0, 'Esta disciplina cobre as principais t√©cnicas utilizadas em modelos de computa√ß√£o paralela distribu√≠da e compartilhada (ex. processos, threads e mem√≥rias transacionais) bem como as metodologias de programa√ß√£o para multicores e nuvem, como MPI, PThreads,  OpenMP e Google MapReduce. Ao final do curso, espera-se que o aluno compreenda os principais m√©todos usados em computa√ß√£o paralela, e os ambientes de programa√ß√£o comumente utilizados pela ind√∫stria.', '(a) An Introduction to Parallel Programming by Peter S. Pacheco. Morgan Kauffman. [livro-texto], (b) The Art of Multiprocessor Programming, Revised Reprint , Maurice Herlihy and  Nir Shavit. Morgan Kauffman. (c) Programming Massively Parallel Processors: A Hands-on Approach, David B. Kirk and Wen-mei W. Hwu.  Morgan Kauffman.', 0, 16, 106, 1, 0),
(10916, 'IA897', 'Introdu√ß√£o √† Otimiza√ß√£o Matem√°tica', 4, 'P', NULL, 0, 'Fundamentos Matem√°ticos; Conjuntos e Fun√ß√µes Convexas; Condi√ß√µes de Otimalidade; Teoria da Dualidade; An√°lise de Sensibilidade; Problemas de Otimiza√ß√£o; M√©todos B√°sicos de Otimiza√ß√£o; Modelos e M√©todos de Otimiza√ß√£o Linear e n√£o Linear.', 'D. Luenberger, Linear and Nonlinear Programming, Second Edition, Addison-Wesley, 1984; M.S. Bazaraa, H.D. Sherali, C.M. Shetty, Nonlinear Programming - Theory and Algorithms, Second Edition, 1993; D.P. Bertsekas, Nonlinear Programming, Second Edition, 1995; A.P. Ruszczynski, Nonlinear Optimization, Princeton University Press, 2006; S. Boyd, L. Vandenberghe, Convex Optimization, Cambridge University Press, 2004; D. Bertsimas, J.N. Tsitsiklis, Introduction to Linear Optimization, Athena Scientific, 1997; I. Griva, S.G. Nash, A. Sofer, Linear and Nonlinear Optimization, SIAM, 2009; E.K.P. Chong, S.H. Zak, An Introduction to Optimization, Fourth Edition, Wiley, 2013.', 0, 9, 44, 0, 0),
(11471, 'FI034', 'Teoria da Relatividade', 4, 'P', NULL, 0, 'Revis√£o de Relatividade Especial. Nota√ß√£o de quadrivetores. Relatividade Especial e Princ√≠pio Variacional. Princ√≠pio de Equival√™ncia. Espa√ßo-tempo curvo. Vetores em Espa√ßo-tempo curvos. Geod√©sicas. M√©trica em torno de objetos esf√©ricos. Cosmologia. Equa√ß√£o de Einstein. Limite Newtoniano. Ondas gravitacionais.', '', 0, 20, 15, 0, 0);
